INSERT INTO `noticias` (`id`, `user_id`, `titulo`, `resumen`, `fecha`, `texto`, `youtube`, `imagen`, `created_at`, `updated_at`) VALUES
(23, NULL, 'Clausuran a lo grande su Curso de Verano 2016', 'El Club de Gimnasia Wolosky celebró a lo grande el cierre de clases de su Curso de Verano 2016, el cual contó con una duración de un mes, con 80 horas de trabajo y un promedio de 50 niños de entre 3 y 6 años de edad. Para la celebración.', '2016-08-12', 'Wolosky Gym realizó una exhibición para los padres de los niños y niñas<br><br>\r\nPor: Nein Gómez<br><br>\r\n\r\nEl Club de Gimnasia Wolosky celebró a lo grande el cierre de clases de su Curso de Verano 2016, el cual contó con una duración de un mes, con 80 horas de trabajo y un promedio de 50 niños de entre 3 y 6 años de edad. Para la celebración, estos pequeñines realizaron una exhibición a sus padres y familiares.\r\n<br><br>\r\nRebeca Wolosky, directora del club, así como el cuerpo de entrenadores del gimnasio, prepararon todo el programa de actividades, donde lo primordial era que los padres de familia observaran todo lo que sus hijos lograron aprender en 60 días de trabajo.\r\n<br><br>\r\nEstos pequeñines lograron adquirir conocimientos sobre las bases de la gimnasia, así como de actividades tales como: danza en tela o gimnasia aérea y parkour; así como la realización de manualidades para activar la creatividad de los niños.\r\n<br><br>\r\nPara complementar la exhibición, Wolosky Gym preparó algunas intervenciones de las atletas que participaron en el Campeonato Regional 2016: Alondra Mena, Cinthia Sánchez y Karime Reyes, así como de los gimnastas varoniles que estuvieron en el Campeonato Nacional de este mismo año, hablamos de, Joel Mendoza, Patricio Gómez y Michael Solís.\r\n<br><br>\r\nEntre estos seis atletas dieron muestras de lo que se puede desarrollar en los aparatos como viga de equilibrio, barras paralelas, piso; esto para la rama femenil, así como la barra fija y anillos en el caso de los varones.\r\n<br><br>\r\nActo seguido, los niños del curso de verano realizaron un sinfín de movimientos de motricidad esto a través del parkour, así como la danza en telas.\r\n<br><br>\r\nFinalmente la exhibición se concluyó con una coreografía grupal, las cuales se incluyen dentro del programa de gimnasia para todos y que promociona la federación de la especialidad.\r\n<br><br>\r\nComo es característico de estos cursos, Wolosky hizo entrega de los reconocimientos de participación a los niños, así como los atletas participantes y entrenadores que estuvieron al frente del curso durante el mes que duró.\r\n<br><br>\r\nArticulo publicado en: <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/13421-clausuran-a-lo-grande-su-curso-de-verano-2016\">Zona de Campeones</a>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '23.jpg', NULL, NULL),
(27, NULL, 'Campeonato Nacional y Universiada GAF 2014', 'Nuestra Alumna Itacushi López Moran se lleva la medalla de Oro en este campeonato Nacional 2014', '2014-04-03', 'Aprovechando el marco del Campeonato Nacional de Gimnasia 2014 realzado del 27 de abril al 3 de mayo en Cancún, Quintana Roo, la Federación Mexicana de la especialidad desarrolló también las competencias correspondiente a la etapa Nacional de la Universiada, donde hubo un destacado resultado con la única chiapaneca participante, Itacuishi López Morán.\r\n<br><br>\r\nNuestra Alumna Itacushi López Moran se lleva la medalla de Oro en este campeonato Nacional 2014<br><br>\r\nPor todo lo hecho hasta este 2014, Itacuishi López Moran se convierte en un referente importante del club Wolosky Gym, y ella como toda atleta aguerrida, se echa a los hombros esa responsabilidad y sólo espera seguir cosechando más éxitos mientras practique la gimnasia artística.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/vH2OTiQzyIY\" frameborder=\"0\" allowfullscreen></iframe>', '27.jpg', NULL, NULL),
(28, NULL, ' Itacuishi López Moran, la gimnasia es mi amor.', 'A sus 16 años, Itacuishi López Moran se encuentra en una etapa de muchos sueños y ambiciones como prac', '2011-12-14', 'A sus 16 años, Itacuishi López Moran se encuentra en una etapa de muchos sueños y ambiciones como practicante de la gimnasia artística. Pese a que es la más veterana dentro del gimnasio Wolosky Gym, ella no se siente así, y cada vez que llega a entrenar siempre busca seguir progresando como atleta y demostrar que su amor por esta disciplina es único.<br><br>\r\n\r\nPor el momento, Itacuishi ya tiene dos participaciones en el Campeonato Nacional de Gimnasia Artística y actualmente se ubica dentro de la Clase IV. Además, ella siempre ha sido una jovencita enamorada del deporte y por ello, antes de llegar a practicar la gimnasia artística, practicó por seis años la gimnasia rítmica.\r\n<br><br>\r\nEn entrevista, la propia Itacuishi nos platicó como se dio ese interés de dejar la gimnasia rítmica y practicar la modalidad de artística, donde actualmente lleva cuatro años.\r\n<br><br>\r\n“Al principio entré a la gimnasia porque me gustaba ver como giraban, saltaban… pero pasó el tiempo y veía competencias de los cuatro aparatos y yo dije; quiero hacer eso, y ya fue que le dije a mis papás y ya ellos dijeron un día que si quería cambiarme y ya vine aquí (Wolosky Gym), a hacer gimnasia artística”.\r\n<br><br>\r\nFue obvio que el cambio de modalidad trajo consigo muchos cambios en su manera de entrenar y López Moran nos comenta sobre ello, “las diferencias son muchas. Para empezar en lo anterior que yo practicaba (gimnasia rítmica); no utilizaba los cuatro aparatos y se me hacía fácil, pero al cambiarme aquí pues lo veo más difícil porque son los cuatro aparatos (barra, viga, piso, salto de caballo), distintos ejercicios, distinta manera de trabajar en cada uno, más concentración, más flexibilidad y aquí es más una disciplina, hay que poner retos, cumplirlos y nunca darse por vencido”.\r\n<br><br>\r\nEsos 10 años de experiencia han marcado sin duda a Itacuishi, tanto que no se visualiza que sería ella si dejara la gimnasia, deporte que se ha convertido en el amor de su vida.\r\n<br><br>\r\n“En realidad toda mi vida, porque yo amo la gimnasia en pocas palabras. La gente me dice, ya estás grande; y yo digo que no porque me encanta, saber que yo hago cosas que no todo el mundo puede hacer, ponerme retos… a veces me desespero, pero hay que mejorar poco a poco y te ayuda en la vida diaria, porque si te pones retos, puedes hacer todo en la vida”.\r\n<br><br>\r\nDe la misma manera, ella nos comentó lo que le transmite un día de entrenamiento de gimnasia artística, “llego y todo se me borra de la mente, todo es gimnasia, se me olvida si tengo problemas afuera, si me fue mal en un examen, todo se me olvida, sólo pienso en la gimnasia; el que haré hoy, qué hay de nuevo, voy a volver a practicar esto, que hay que mejorar en aquello, que no hay que darse por vencido”.\r\n<br><br>\r\nPasando a sus experiencia en la Nacional de la especialidad, ella volvió a recordar ese momento que le tocó por primera vez estar en un evento de esta categoría, “en el primer nacional yo iba demasiado nerviosa, porque ya no sólo iba a representando al gimnasio, sino al estado, pero al final de cuentas me divertí, hay que disfrutarlo. Vas y ves gimnastas de otros estados, otros gimnasios, platicar las experiencias en los tiempos libres que te dan”.\r\n<br><br>\r\nLuego de esos dos años de asistir al nacional, a Itacuishi López Moran sigue sintiendo esa emoción de representar a Chiapas, donde como ella lo explica, es todo un orgullo por representar al estado en un deporte que no cualquiera puede practicarlo.\r\n“La verdad me da mucho orgullo que vaya representando a mi estado y en gimnasia, un deporte que no cualquiera lo practica, no cualquiera hace gimnasia… un basquetbolista no puede venir a hacer mortales y eso me llena de orgullo, valentía, de ganas de seguir practicando gimnasia, me inspira a seguir”.\r\n<br><br>\r\nDada esa experiencia que tiene en este deporte, la jovencita también explica como este amor por su deporte trae muchos beneficios de salud y por lo tanto, sería magnífico que se acercara para practicar esta disciplina.\r\n<br><br>\r\n“Es un deporte maravilloso, muy bonito, al principio sólo vas con la visión de que sólo es gimnasia, pero ya luego se le toma una gran importancia que ya no se puede salir de aquí… yo me enamoré de la gimnasia. Yo lo recomiendo, porque aparte de ayudarte a tener una buena salud, también te ayuda en tu manera de pensar, no rendirte ante las cosas, ser mejor persona, te enseña valores, aprendes muchas cosas”.\r\n<br><br>\r\nTocando su lado sensible, nos comentó un poco la relación que tiene ella con sus entrenadores. Primeramente quiso agradecer a su entrenador, José Alfonso Esponda, a quien en estos cuatro años la ha sacado adelante y ha sido el pilar fundamental para sus logros deportivos en su etapa dentro de la gimnasia artística.\r\n<br><br>\r\nYa en torno a su entrenadora Rebeca Wolosky, así se expresó Itacuishi de ella, “es una maestra que me ha enseñado muchas cosas buenas, me ha ayudado a mejorar mucho y en los momentos que digo que ya no puedo, ella llega y me dice que sí se puede, en pocas palabras me ayudado en todos los aspectos. Y que le digo que muchas gracias por todo, porque le he tomado afecto, es una buena maestra”. Así mismo agregó “la verdad mucho, porque yo soy la única que queda de mi generación y esta es como mi segunda o tercera casa, después de la escuela es muy grande el significado que le tengo hacía este gimnasio”.\r\n<br><br>\r\nEl ciclo del 2011 ya pasó y ahora ella y sus entrenadores tienen el nuevo plan de trabajo, así como los objetivos para el nuevo proceso rumbo al 2012.\r\n<br><br>\r\n“Ahorita estamos en la preparación para los trabajos en Clase IV, para el Nacional que viene. Igual parece en diciembre vamos a un campamento y mejorar todo lo que ya llevo aprendido aquí y seguir mejorando, para traer un mejor lugar para Chiapas para el Nacional del 2012”.\r\n<br><br>\r\nAsí mismo, Itacuishi tiene más que claro sus pretensiones para el siguiente nacional, “traer una medalla en salto, porque es el aparato que más me gusta y el que mejor se me da. Y mejorar mi lugar a diferencia del 2011, estar entre los mejores 15”.\r\nPara despedir esta entrevista, la gimnasta de Wolosky Gym no quiso pasar la oportunidad para agradecer a dos pilares fundamentales en su vida como gimnasta. Se trata de sus padres, quienes en las buenas y en las malas han estado con ella.\r\n“A mis papás, a los dos. Cuando yo digo; ya no puedo más, ellos me dicen que se puede y antes de cada competencia me animan y les agradezco a ellos, porque si no es por ellos yo no estuviera practicando gimnasia, siempre desde chica me inculcaron el deporte, estuve en muchos deportes, pero el que más me encantó fue gimnasia”.\r\n<br><br>\r\nPor todo lo hecho hasta este 2011, Itacuishi López Moran se convierte en un referente importante del club Wolosky Gym, y ella como toda atleta aguerrida, se echa a los hombros esa responsabilidad y sólo espera seguir cosechando más éxitos mientras practique la gimnasia artística.', '<iframe class=\"youtube\" width=\"420\" height=\"315\" src=\"https://www.youtube.com/embed/naGBvrZBwlU\" frameborder=\"0\" allowfullscreen></iframe>', '28.jpg', NULL, NULL),
(29, NULL, 'Campeonato Regional 2009 Cancun', 'La academia de Gimnasia Wolosky, participa en el Campeonato Regional 2009 Zona sur y Logramos traernos el campeonato en 1er Lugar en Clase 6 \"Wolosky CAMPEON\" y el 3 y 4° lugar en Clase 7 y el 8° en Clase 8.', '2009-02-25', 'La academia de Gimnasia Wolosky, participa en el Campeonato Regional 2009 Zona sur y Logramos traernos el campeonato en 1er Lugar en Clase 6 \"Wolosky CAMPEON\" y el 3 y 4° lugar en Clase 7 y el 8° en Clase 8.', '<iframe class=\"youtube\" width=\"420\" height=\"315\" src=\"https://www.youtube.com/embed/xA5ixvfKVSI\" frameborder=\"0\" allowfullscreen></iframe>', '29.jpg', NULL, NULL),
(30, NULL, 'Wolosky en exhibición en la Feria Chiapas 2013', 'Como parte de sus últimas actividades del mes de diciembre, Wolosky Gym participó dentro del marco de los eventos deportivos de la Feria Chiapas 2013, esto al presentar una exhibición gimnástica, esto con un promedio de 50 alumnos, de todas las edades y niveles que manejan.', '2013-10-04', '• Wolosky Gym participó con 50 alumnos dentro del marco de este evento\r\n<br><br>\r\nPor: <a hrer=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/7811-contaron-con-exhibicion-en-la-feria-chiapas\">Nein Gómez</a>\r\n<br><br>\r\nComo parte de sus últimas actividades del mes de diciembre, Wolosky Gym participó dentro del marco de los eventos deportivos de la Feria Chiapas 2013, esto al presentar una exhibición gimnástica, esto con un promedio de 50 alumnos, de todas las edades y niveles que manejan.\r\n<br><br>\r\n\r\n“Se nos hizo la invitación, como todos los años, para una participación y presentación gimnástica. Tuvimos una participación de 50 gimnastas, desde las más pequeñitas de 3 a 5 años, hasta los más grandes”, dijo en entrevista la directora de este club.\r\n<br><br>\r\nSobre las actividades realizadas en el área donde los colocaron dentro de la Feria Chiapas, Rebeca Wolosky habló sobre todos los actos realizados.\r\n<br><br>\r\n“Se hicieron seis cuadros diferentes con los que se presentaron en el marco de la Feria Chiapas. Se presentó un cuadro con las más pequeñitas, estuvo otro cuadro con una rutina mixta de jóvenes entre 9 y 14 años, y una más con pequeñitas entre 6 y 9 años”.\r\n<br><br>\r\n“Se presentó al igual el cuadro de gimnastas que se presentaron en Querétaro al Festival Nacional de Gimnasia, con ajustes a las medidas y al espacio que teníamos, también fue muy aplaudido”.\r\n<br><br>\r\nAsí mismo, la directora de este club aprovechó para agradecer el apoyo y la invitación del patronato de la feria. \r\n<br><br>\r\n“Se agradece al patronato y al licenciado Emmanuel por todos estos eventos que se promueven a los jóvenes chiapanecos”.\r\n<br><br>\r\nFinalmente, como presidenta de asociación, habló de la importancia realizar este tipo de exhibiciones, que siguen ayudando en la promoción de este deporte en el estado.\r\n<br><br>\r\n“Mucha gente no tiene conocimiento que se desarrolla gimnasia en el estado y por eso es muy importante seguir promoviéndola. Cualquier evento al que se pueda asistir, con uno o dos grupos, 10 o 50 gimnastas y es para fomentar el deporte en el estado, y los conocimientos de la gimnasia en todas sus modalidades”.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '30.jpg', NULL, NULL),
(34, NULL, 'Wolosky se ubica en la posición 12 en el Regional de Gimnasia', 'La Academia de Gimnasia Wolosky, obtuvo uno de sus mejores resultados, al colgarse una medalla de plata en el pasado Campeonato Regional de la especialidad, realizado en Villahermosa, Tabasco.', '2010-07-19', 'La Academia de Gimnasia Wolosky, obtuvo uno de sus mejores resultados, al colgarse una medalla de plata en el pasado Campeonato Regional de la especialidad, realizado en Villahermosa, Tabasco, gracias a la excelente participación de María José Aranda en la Clase 8 del certamen.<br><br>\r\nCon este resultado, el Gimnasio que es dirigido por Rebeca Wolosky, se colocó en la posición 12 del certamen regional del Sureste, de entre 25 clubes participantes de la Región 5, que agremia a los estados de Veracruz, Yucatán, Quintana Roo, Campeche, Tabasco y Chiapas.\r\n<br><br>\r\nA decir de la dirección del Gimnasio, “la Academia de Gimnasia Wolosky cumple con sus expectativas un año más, y se congratula con los resultados al arduo trabajo que realiza todo el equipo de entrenadores, padres de familia y por supuesto del trabajo, constancia y perseverancia de sus gimnastas”.\r\n<br><br>\r\nA este torneo viajaron 18 gimnastas para el Regional y 12 más que también tuvieron una destacada actuación en la Copa Bicentenario realizada a la par del clasificatorio.\r\n<br><br>\r\nLos resultados dejaron satisfecha a la dirección del Gimnasio, “excelente participación en ambos eventos, contra todas las expectativas, las gimnastas, todas ellas novatas, pues por primera ocasión participan en un evento de esta magnitud”, dijo.\r\n<br><br>\r\n“Todas muy nerviosas, pero decididas a dar su máximo esfuerzo logran sus objetivos, consolidar resultados, colocándose en las mejores y punteando la región 5 Sureste, logrando la segunda posición”, aseguró.\r\n<br><br>\r\nAdemás, la Academia destacó la participación de las 12 gimnastas en la Copa Bicentenario en la que todas las gimnastas se colocaron entre los tres primeros lugares de la competencia, Ingrid Estefanía Vázquez Ochoa, Ámbar Irene Flores Montero, Aleyda Itzel Ramón López, Susana Edaly Ramos Morales, Sofía Graham Coello, Enelda Nigenda Asseburg, María José Pravia Ballinas, Karen Alejandra Cruz Luna y Berenice Rosales Acosta; además de señalar que Camila Fernández, fue quien en el pasado Campeonato Nacional se llevó una medalla de plata.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '34.jpg', NULL, NULL),
(35, NULL, 'Campeonato Nacional 2016. Monterrey, N. L', 'Los representantes chiapanecos Joel Alonzo Solórzano, Patricio Grajales Michael Solís, cada uno en diferentes categorías, participaron en esta justa', '2016-07-08', 'Por Maricarmen Vázquez <br><br>Con la presentación de Chiapas acudieron atletas de la academia gimnasia wolosky de Tuxtla Gutiérrez al campeonato nacional de gimnasia artística en monterrey, nuevo león, en él se dieron cita alrededor 600 representantes de diferente estados del país. Los chiapanecos se destacaron entre los primeros lugares. Este evento resulta importante y muy competitivo, ya que acuden los mejores gimnastas, pues sirve como filtro para buscar la calificación a la olimpiada nacional del 2016, participación que los alumnos de wolosky como fogueo para ganar experiencia y lograr mejores resultado a la de competir en eventos a futuro<br><br>\r\nLos representantes chiapanecos Joel Alonzo Solórzano Patricio Grajales y Michael Solís, cada uno en diferentes categorías, son quienes tomaron parte en esta parte justa donde mostraron sus mejores rutina y sus habilidades en seis aparato distintos que contempló cada presentación, de acuerdo su categoría. Tras la participación de jóvenes, la directora de la academia Woloski, Rebeca Wolosky, comentó en entrevista a su regreso sobres las expectativas que se tenían y que cumplieron. VENIMOS trabajando con ellos los gimnastas poco tiempo, sin embargo concretaron buenos resultado. Para la academia el objetivo era estar dentro de la media y se logró pues no es fácil competir en un evento a nivel nacional, dijo.<br><br>\r\nDe la participación de los jóvenes, la entrenadora explicó que Michael Solís llegó hasta la última ronda, y a pesar de que se lesionó, no bajo la guardia y se colocó entre los primeros lugares. Por su parte Joel quien compitió en nivel cuatro, se colocó en el onceavo lugar en barra física, en tanto que de Grajales, al quien al principio lo rebasaron los nervios, reconoció su valor y su esfuerzo por dar muestra de su potencia. Finalmente wolosky dijo que tras ver otro equipo de Gimnasia y nivel, los jóvenes regresaron con ganas de seguir preparándose para acudir a futuros eventos y dar mejores resultados, para lo cual ella estará dispuesta a apoyarlos, de acuerdo al interés de cada uno tenga.\r\n', '<iframe class=\"youtube\" width=\"420\" height=\"315\" src=\"https://www.youtube.com/embed/qzMTJVTa4W4\" frameborder=\"0\" allowfullscreen></iframe>', '35.jpg', NULL, NULL),
(36, NULL, 'Club Wolosky sigue impulsando la gimnasia en el estado', 'Con el objetivo de ser motivando a las niñas y niños, la Academia de Gimnasia Artística Wolosky, se presentó dentro de las actividades que se realizaron en la Feria Chiapas, dando en esta ocasión una pequeña muestra de esta disciplina olímpica.', '2009-12-18', 'Por: <a href=\"http://diariolavozdelsureste.com/club-wolosky-sigue-impulsando-la-gimnasia-en-el-estado/\">Yuri Gumeta</a>\n<br><br>\nCon el objetivo de ser motivando a las niñas y niños, la Academia de Gimnasia Artística Wolosky, se presentó dentro de las actividades que se realizaron en la Feria Chiapas, dando en esta ocasión una pequeña muestra de esta disciplina olímpica.\n<br><br> \nA esta gran presentación asistieron más de 40 alumnos entre la rama femenil como la rama varonil, que comenzaron con las rutinas, un grupo de diez niñas entre tres y cinco años de edad, dando paso después a las niñas más avanzadas de dicha academia, quienes intervendrán en el próximo campeonato regional de la especialidad.\n<br><br>\nEn este mismo espacio, el Club Wolosky presentó una rutina mixta con varones avanzados adolescentes y con niñas de niveles básicos, en donde este grupo bailó al son de una pieza musical, de esta manera, la academia de gimnasia hizo esta muestra en la que el público asistente quedaron encantados al observar a las pequeñas atletas.\n <br><br>\nY es que el Club Wolosky, busca que los niños y niñas se interesen por un deporte, en especial por esta disciplina olímpica, para erradicar los vicios sociales que aqueja a la sociedad mexicana, comenzando desde muy pequeños para que siempre estén en constante actividad física.\n <br><br>\nEn dicho marco, la profesora Rebeca Wolosky, agradeció al patronato de la Feria Chiapas 2009, por su invitación a estar presentes en este evento, que año con año le abren las puertas, para mostrar lo que a través del tiempo esta academia tan importante en el estado sigue haciendo.\n <br><br>\nAl finalizar esta pequeña muestra de gimnasia artística, la directora del club dio unas palabras a todo el público que asistió, en especial a los padres y madres de familia que apoyan a sus hijos de seguir dentro de esta disciplina.\n <br><br>\n“Este 2009 ha sido un gran año para toda la comunidad de nuestra academia de gimnasia Wolosky, asistiendo a diversos eventos, tanto de intercambios, clínicas y otras competencias en estados como Tabasco, Veracruz, Yucatán y el Campeonato Regional 2009, donde nos coronamos campeonas y conseguimos el primer lugar en clase 6 con Mónica Ruíz Gaona, quien quedo acreditada para el Campeonato Nacional del 2010”, agregó Rebeca Wolosky.\n', ' <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '36.jpg', NULL, NULL),
(38, NULL, 'Nacional en San Luis Potosí 2012', 'La Academia de Gimnasia Wolosky regresó del Nacional de San Luis Potosí contentos y satisfechos del buen desempeño que tuvo el equipo de gimnastas que representan.', '2012-02-02', 'Por<a href=\"http://old.nvinoticias.com/deportes/otros-deportes/94940-wolosky-reporta-avances\">Hans Gómez Cano</a\r\n<br><br>\r\nLa Academia de Gimnasia Wolosky regresó del Nacional de San Luis Potosí contentos y satisfechos del buen desempeño que tuvo el equipo de gimnastas que representan este club y que formaron parte de la delegación Chiapas, en la modalidad de gimnasia artística femenil.\r\n<br><br>\r\nItacuishi López Morán se desarrolló con gran destreza, habilidad y seguridad logrando colocarse en el treceavo lugar en la modalidad de barras asimétricas y en quinceavo lugar de su clase y categoría.\r\n<br><br>\r\nPor su parte, Jennifer Pérez Gómez, debido a su corta edad y su poca experiencia en participaciones a nivel nacional, el escenario la avasalló y desfavoreció su participación, sin embargo Rebeca Wolosky reconoció su tenacidad, disciplina, valor y entrega a este deporte.\r\n<br><br>\r\nCon respecto a la gimnasia en la rama varonil, los participantes: José Antonio López Ovando y Luis Fernando Durante García hicieron historia, por ser los únicos participantes de nuestro estado, estos recibieron innumerables felicitaciones por diversos representantes de las delegaciones del norte del país, teniendo la oportunidad de compartir escenario con experimentados gimnastas a nivel nacional como son los del Estado de México, Nuevo León y Yucatán y muchos otros.\r\n<br><br>\r\nLa delegación de gimnasia representando a Chiapas en este Campeonato Nacional se conformó por ocho gimnastas en la modalidad de gimnasia femenil.', ' <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '38.jpg', NULL, NULL),
(39, NULL, 'Wolosky en la 7ª edición de la Copa Ganesha', 'En su necesidad, curiosidad y deseos de expandir sus conocimientos, tres atletas de la categoría femenil del Club Wolosky Gym decidieron foguearse en la Ciudad de México, esto acudiendo.', '2016-10-01', 'Se foguearon en la Ciudad de México <br><br>\r\n• Atletas de Wolosky Gym hicieron las maletas para acudir a la Copa Ganesha <br><br>\r\n\r\nEn su necesidad, curiosidad y deseos de expandir sus conocimientos, tres atletas de la categoría femenil del Club Wolosky Gym decidieron foguearse en la Ciudad de México, esto acudiendo a la 7ª edición de la Copa Ganesha, evento realizado por el gimnasio que lleva por nombre la copa.\r\n<br><br>\r\nKaterine Amaya Vela, Alondra Mena Borraz y Nicole Vázquez León, fueron las tres aventureras por parte del Club Wolosky, quienes fueron supervisadas por el profesor José Alfonso Esponda.\r\n<br><br>\r\nLas tres competidoras lograron estar dentro de los parámetros exigidos en este tipo de competencias, obteniendo las tres, sus medallas en cada uno de los aparatos, así como all around, además de dos copas del evento. \r\n<br><br>\r\nOtro de los objetivos era que las gimnastas pudieran obtener los puntos necesarios para su siguiente nivel, objetivo que se quedaron muy cerca, por lo cual, ese seguirá siendo el trabajo a pulir.\r\n<br><br>\r\nEn entrevista con las protagonistas en el torneo, Alondra Mena Borraz, Nivel 3 Grupo E; fue la primera en dar sus impresiones: “Fuimos a una competencia a la Ciudad de México, la Copa Ganesha, hubo un poco de nervios, pero sabía que iba bien preparada para poder competir. Obtuvo primer lugar en todos los aparatos”.\r\n<br><br>\r\n“He entrenado diario durante dos horas y siendo constante. Mis rivales estaban bien. Ahora viene seguir entrenando para alcanzar mi Nivel 4”.\r\n<br><br>\r\nPor su parte, Katerine Amaya Vela, Nivel 5 Grupo E, dijo esto al respecto del torneo: “Me sentí nerviosa al principio, pero poco a poco me fui soltando en la competencia, obtuve primer lugar en todos los aparatos”.\r\n<br><br>\r\n“Acá he entrenado diariamente inicié con dos, ahora entreno 3 horas y pude hacerle frente a las competidoras que iban bien preparadas”.\r\n<br><br>\r\n“Siento que pude mejorar en barras y viga de equilibrio, pero son detalles que se irán puliendo”.\r\n<br><br>\r\nCon esta jovencita en particular, Wolosky Gym busca la meta del nacional en un par de años más: “Ahorita es buscar mi pase al Nacional, creo que para el próximo verano y pues buscaremos el mejor evento para dar los puntos para estar en el Nacional”, expuso Amaya Vela.\r\n<br><br>\r\nFinalmente, Nicole Vázquez León comentó del torneo, “hubo nervios por ver a las demás competidoras, pero pude lograr 2 primeros lugares, 2 segundos lugares y un tercer puesto”.\r\n<br><br>\r\n“Pude haber mejorado en barras asimétricas. Mis competidoras eran buenas, estuvimos parejas en viga. Y ahorita espero practicar más las barras asimétricas, que es lo que me gusta”.\r\n<br><br>\r\nLas tres niñas regresaron motivadas y ahora su directora, Rebeca Wolosky, espera que una vez pasado el ciclo escolar puedan retomar un trabajo más intenso con estas atletas, para el proceso 2017 y 2018.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/dE5RDxvOMjA\" frameborder=\"0\" allowfullscreen></iframe>', '39.jpg', NULL, NULL),
(40, NULL, 'Rebeca Wolosky es la nueva presidenta ', 'La Asociación Chiapaneca de Gimnasia cuenta con nueva titular para el periodo 2012-2016', '2012-03-28', 'Por: <a href=\"http://old.nvinoticias.com/deportes/89852-rebeca-wolosky-es-nueva-presidenta\">Hans Gómez Cano</a>\r\n<br><br>\r\nLO QUE DIJO\r\n<br><br>\r\n“Estamos integrando un nuevo cuerpo directivo con más ganas de salir adelante y crecer en la gimnasia con los clubes afiliados, hay muchas cosas que hacer en el Campeonato Nacional y en la Olimpiada Nacional.”\r\n<br><br>\r\nRebeca Wolosky. Titular de la Asociación Chiapaneca de Gimnasia\r\n<br><br>\r\nLuego de más de un año de irregularidades donde se estableció un comité reorganizador y más de tres años de grilla total en la Asociación Chiapaneca de Gimnasia, ya hay una nueva presidenta en este gremio, después de seis horas de discusiones en las instalaciones del Instituto del Deporte, Rebeca Wolosky toma el mando de esta disciplina deportiva.\r\n<br><br>\r\nLa nueva Presidenta de la Asociación Chiapaneca de Gimnasia habló en exclusiva para NOTICIAS acerca de esta nueva responsabilidad que ha tomado a fin de hacer crecer este deporte.\r\n<br><br>\r\n“Estamos integrando un nuevo cuerpo directivo con más ganas de salir adelante y crecer en la gimnasia con los clubes afiliados, hay muchas cosas que hacer en el Campeonato Nacional y en la Olimpiada Nacional.”\r\n<br><br>\r\nTras establecerse el comité reorganizador en la gimnasia, Rebeca Wolosky no dejó de trabajar en busca de ser la presidenta de la asociación a sabiendas que en el camino se iba a encontrar muchas piedras las cual las quitó de su camino.\r\n<br><br>\r\n“Estuvimos gestionando esto con CONADE y CODEME, todo se resolvió por parte de la Federación Mexicana de Gimnasia encabezada por el ingeniero Gustavo Salazar, el encabezó la junta y hubo elección de consejo, todo fue tensión porque tardó más de seis horas, ya se asentó todo y quedó establecido el consejo directivo.”\r\n<br><br>\r\nEl trabajo a ejercer por parte de la nueva presidenta de la gimnasia es de manera inmediata pues no hay tiempo de perder, a la vuelta de la esquina está el campeonato Nacional y la Olimpiada Nacional 2012.\r\n<br><br>\r\n“El interés es de que crezca la gimnasia, hay que reestructurar todo, ya no veremos atrás sino iremos adelante en el crecimiento de los niños, ahora hay niños participando en el estado para el Nacional y Regional, hay que hacer muchas cosas y darle para adelante, hay planes en rítmica, en acrobática y algunos clubes les ha interesado.\r\n<br><br>\r\n“Sabemos que el campeonato Nacional es el filtro para la Olimpiada, los primeros 40 lugares tienen pase directo, estuvimos cerca el año pasado pero esperemos que este año estemos en Olimpiada.”\r\n<br><br>\r\nRebeca Wolosky se muestra entusiasmada tras este nuevo reto en su carrera, esperando hacer un destacado papel.\r\n<br><br>\r\n“Mucho gusto, con ganas de trabajar y sacar adelante la gimnasia junto al gran equipo de trabajo, viendo al futuro queremos pelear con estados que luchan en la gimnasia como en el norte del país.”\r\n<br><br>\r\n- De cuatro años será el periodo de Rebeca Wolosky en la Asociación Chiapaneca de Gimnasia (2012-2016)<br>\r\n- Uno de los primeros trabajos a realizar es llevar a cabo un evento de asociación que involucre a todas las modalidades<br>\r\n- Se buscará difundir más la gimnasia en todos los rincones del estado<br>\r\n- Se gestionará pedir apoyos estatales y federales a fin de que crezca este deporte<br>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '40.jpg', NULL, NULL),
(43, NULL, 'Día de Muertos llegó a Wolosky Gym 2016', ' El alumnado y cuerpo de entrenadores contaron con fiesta y concurso de disfraces', '2016-11-02', 'Por:  <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/13786-dia-de-muertos-llego-a-wolosky-gym\">Xigván Álvarez</a>\r\n<br><br>\r\nCon el objetivo de conmemorar a esas almas que ya no están entre nosotros y fraternizar entre todo el equipo de trabajo y el alumnado, Wolosky Gym contó con su fiesta de Día de Muertos, esto dentro de las instalaciones del gimnasio, donde todos los presentes pasaron unas horas de amena convivencia.\r\n<br><br>\r\nEntre kermes, show de payaso, mucho color y disfraces, fue como transcurrió las casi 3 horas del evento de Wolosky Gym, donde Rebeca Wolosky, directora del club, hizo esto con el mayor cariño para los peques y no tan peques gimnastas del club.\r\n<br><br>\r\nLos más pequeñines disfrutaron al máximo el show del payaso, quien con sus ocurrencias sacó más de una risa a todos los presentes, pero faltaba la cereza en el pastel al evento: el concurso de disfraces.\r\n<br><br>\r\nA manera de pasarela y con jurado calificador, fue como Wolosky Gym dio paso a esta parte de su festejo de Día de Muertos, dividiendo el concurso en dos partes, uno para los alumnos de edades por arriba de los 10 años, y a parte el concurso para los niños de 3 a 9 años.\r\n<br><br>\r\nComenzando con los jovencitos mayores a 11 años, se dio paso a la pasarela, donde el jurado deliberó de la siguiente manera a los tres ganadores: En tercer lugar dieron la victoria a un jovencito vestido de Catrín, así como a la portadora del disfraz de Momia, en el segundo puesto estuvo la alumna que llevó el traje de Vampira, para finalmente darle el primer lugar a un buen confeccionado traje de Catrina.\r\n<br><br>\r\nEl concurso se cerró con los más pequeñitos, donde la elección no fue fácil, pero finalmente el jurado otorgó de la siguiente manera los lugares: En el tercer lugar hubo empate entre los alumnos que vistieron de Gatita y Pirata. En el segundo puesto también hubo un empate esto entre los niños que portaron los trajes de Jocker y Harley Quinn, para finalmente dar el primer lugar a la niña que vistió un elegante disfraz de Catrina, demostrando que este tradicional personaje mexicano de José Guadalupe Posada maravilla a más de uno.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/moneZCUEoPY\" frameborder=\"0\" allowfullscreen></iframe>', '43.jpg', NULL, NULL),
(44, NULL, ' Wolosky  campeón regional 2011', 'El club chiapaneco obtuvo su mejor participación en este 2011, al ser reconocido como el mejor club del sureste', '2011-06-24', 'Por: <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/1034-wolosky-gym-campeones-regionales\">Nein Gómez</a>\r\n<br><br>\r\nEn la conferencia tuvieron la visita especial de Elsa Colinas de Vázquez, Directora del DIF Municipal\r\n<br><br>\r\nExcelencia y calidad, esos fueron los distintivos que demostró el Club de Gimnasia Artística Wolosky Gym en su participación en el Campeonato Regional celebrado los días 23 y 24 de junio en la ciudad de Mérida, Yucatán, donde este gimnasio chiapaneco logró obtener el galardón del primer lugar por equipos.\r\n<br><br>\r\nY para hacer público tan excelentes logros, este lunes 4 de julio, Wolosky Gym realizó una conferencia de prensa, esto en conocido restaurant ubicado en lado poniente de la ciudad capital, en la cual se detalló todos los resultados, así como se hizo extensivo los agradecimientos a todas las personas que estuvieron involucrados en este éxito.\r\n<br><br>\r\nDentro de esta conferencia de prensa, Rebeca Wolosky, directora general del gimnasio, se hizo acompañar de personalidad como, Juan Gabriel Estrada de Coss, Director de PRODEM y de la Diputada local, Silvia Areli Díaz, quien a parte está dentro de la Comisión del Deporte y Juventud del Congreso del Estado.\r\n<br><br>\r\nNo fue fácil para Wolosky Gym hacer este logro, ya que dentro de este Regional tienen que medirse ante atletas de estados de gran nivel en el sureste como lo son Yucatán, Tabasco, Quintana Roo y Campeche, las cuales incluso tienen atletas que ya han participado en campeonatos nacionales y Olimpiada Nacional, pero entre todos, Wolosky Gym dio muestras que en Chiapas hay gran nivel en la gimnasia y su primer lugar por equipos dan fidelidad a esta premisa. \r\n<br><br>\r\nOtro de los puntos que se destacaron dentro de esta conferencia de prensa fueron, el logro de Jennifer Pérez Gómez; quien logró acreditar de nivel y eso le ayuda a que para el año 2012 ya tendrá la oportunidad de participar en el Campeonato Nacional de la especialidad. También se le dio una felicitación a Susana Edaly Ramos Morales, quien logró la medalla de oro en al all around de su categoría. Y para finalizar, Rebeca Wolosky, explicó que todos los participantes de su gimnasio en este Regional lograron acreditar a su siguiente nivel.\r\n<br><br>\r\nEn el resto de resultados de los atletas en el Regional fueron los siguientes, Ana María Lizano, su mejor aparato fue las barras asimétricas donde obtuvo el oro; aparte de un cuarto lugar en el all around. Aleyda Itzel Ramos López; logró una medalla de plata en barras asimétricas y quinto lugar en el all around.\r\n<br><br>\r\nAdemás están, Liliana Langle Ayala, con medalla de plata en piso y bronce en el all around y María José Aranda Lizano con un cuarto lugar en barras y otro cuarto sitio en el all around.\r\n<br><br>\r\nFinalmente, el Club Wolosky Gym extendió el agradecimiento por el esfuerzo hecho por sus dos juezas, Shanny Rebeca Valdez Wolosky (jueza estatal) y Rebeca Wolosky (jueza nacional nivel 2) y a su entrenador, José Alfonso Esponda.\r\n<br><br>\r\nVISITA ESPECIAL\r\n<br><br>\r\nEl festejo de este éxito de Wolosky Gym se vio más galardonado cuando hizo acto de presencia a la conferencia la Directora del DIF Municipal de Tuxtla Gutiérrez, Elsa Colinas de Vázquez, quien se le hizo notificación de todos los resultados de cada uno de los atletas, así como del duro trabajo que ha hecho Wolosky Gym en el estado.\r\n<br><br>\r\nElsa Colinas expresó la felicitación a los atletas, haciéndoles entrega a cada uno de una rosa. Así mismo, le hizo entrega de una de estas rosas a la profesora Rebeca Wolosky por su trabajo de tantos años en la gimnasia y pasaron a tomarse la foto grupal. \r\n<br><br>\r\nTras la felicitación personal de la Directora estatal del DIF, pasaron a festejar con algunos bocadillos del restaurant, para así terminar esta conferencia en gran camaradería y la profesora Rebeca Wolosky, rodeada de amistades y sus atletas que se dieron cita al lugar.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '44.jpg', NULL, NULL),
(45, NULL, 'Chiapas sede del Campeonato Regional de Gimnasia 2012', 'Chiapas será sede del Campeonato Regional Artístico Femenil y de la Copa Alterna Wolosky 2012, que se organizará del 30 de octubre al 2 de noviembre en la Arena Metropolitana \"Jorge Antonio Cuesy Serrano\".', '2011-10-21', 'El director de Promoción Deportiva Municipal (Prodem), Juan Gabriel Estrada de Coss, dijo que el gobierno que preside el alcalde Seth Yassir Vázquez impulsará cualquier acto deportivo que venga a Tuxtla Gutiérrez.\r\n<br><br>\r\nComentó que en esta competencia participarán los estados de Oaxaca, Tabasco, Campeche, Yucatán, Quintana Roo, Veracruz, y Chiapas.\r\n<br><br>\r\nPor su parte, Silvia Ramírez de Salazar, integrante del comité organizador, expresó que es un orgullo que la entidad organice por primera vez este campeonato de gimnasia.\r\n<br><br>\r\nManifestó que los atletas realizan durante un año una etapa de entrenamiento que los prepara para asistir a esta copa regional o para cualquier evento deportivo. \r\n<br><br>\r\nIndicó además que las gimnastas chiapanecas han conseguido buenos resultados en los campeonatos nacionales que han acudido ediciones atrás.\r\n<br><br>\r\nAsimismo, dio a conocer el calendario de actividades que se efectuarán durante los próximos ochos meses. El primer evento que se tiene en puertas es el campamento gimnástico de bases Wolosky, que se desarrollará del 30 de octubre al 2 de noviembre.\r\n<br><br>\r\nDijo que el objetivo que se tiene es que el mayor número de gimnastas de nuevo ingreso pasen a las filas de competencias en niveles regionales y nacionales; esto con base en un estricto programa gimnástico de desarrollo.\r\n<br><br>\r\nA las atletas de nuevo ingreso se les efectuará una evaluación técnica, para ver si cuentan con la capacidad para asistir a la competencia, que les permita dar la acreditación al Campeonato Regional de Gimnasia.\r\n<br><br>\r\nEn el día del torneo se contará con la presencia del profesor José Emilio Martínez Muñoz, exseleccionado nacional, y que actualmente es el entrenador del equipo de Tabasco; así como Verónica Sánchez Landeros, juez internacional de la modalidad de gimnasia artística femenil, entre otros.\r\n', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '45.jpg', NULL, NULL),
(46, NULL, 'Arranca Regional de Gimnasia 2012', 'Con el entusiasmo a todo lo que da, así se encuentran las gimnastas chiapanecas que estarán interviniendo en el Campeonato Regional de Gimnasia Artística 2012, justa que se estará efectuando los días 29 y 30 de junio en Tuxtla Gutiérrez.', '2012-06-29', 'Por: <a href=\"http://diariolavozdelsureste.com/hoy-arranca-regional-de-gimnasia/\"> Yuri Gumeta</a>\r\n<br><br>\r\nDesde hace meses atrás, las pequeñas gimnastas de los distintos clubes afiliados a la Asociación Chiapaneca de Gimnasia se han preparado al máximo para brindar su mejor esfuerzo en esta competencia que reunirá a más de un centenar de atletas provenientes de 20 clubes de estados como Veracruz, Tabasco, Yucatán, Quintana Roo y el anfitrión Chiapas.\r\n<br><br>\r\nCabe recordar que esta justa deportiva es de gran trascendencia para la gimnasia chiapaneca al ser la primera vez que el estado es sede de un Campeonato Regional de la especialidad, lo que indica que año con año este deporte olímpico ha venido en crecimiento, a pesar de los pequeños problemas que ha tenido que sobrepasar la gimnasia en Chiapas.\r\n<br><br>\r\nDentro del marco del Campeonato Regional, el Club Wolosky de Gimnasia Artística efectuará la Quinta Edición de la Copa Wolosky, una competencia no sólo estatal que por más de cuatro años se ha mantenido en el gusto de la comunidad gimnasta.\r\n<br><br>\r\nDe acuerdo a datos por los organizadores, la inauguración del Regional de la especialidad se realizará alrededor de las 12:30 horas de hoy viernes 29 de junio, donde se espera la presencia de autoridades deportivas y organizadores del evento.\r\n<br><br>\r\nLas competencias arrancarán a partir de las 9 horas hasta las 20 horas en las instalaciones que se encuentran a un costado del Hotel Hilton Garden Inn que se ubica al poniente de la capital del estado, la entrada al público es gratuita.\r\n<br><br>\r\nPalabras de Rebeca Wolosky:\r\n<br><br>\r\n-Gracias a los presidentes de las Asociaciones de la regiòn sureste que brindaron todo su su apoyo para desarrollar este evento aquí en el estado de Chiapas.\r\n<br><br>\r\nY muchas gracias a todas las personas que hicieron posible la organización de este evento, a pesar de los obstaculos a los que se han enfrentado y por supuesto a todos nuestros patrocinadores que han apoyado para finalmente hacer realidad el sueño de tener en nuestro estado un Campeonato Regional.\r\n<br><br>\r\nSe y estoy consiente de algunos detalles que se deben mejorar para el beneficio de toda la gimnasia chiapaneca, y estoy segura que con el interes de cada uno de los clubes que integramos esta asociacion en beneficio de todos los niños y jòvenes chiapanecos con esfuerzo, dedicación, trabajo, tenacidad pero sobre todo con actitud se puede lograr, pues como dice nuestro el SLOGAN del club al que pertenezco:\r\n<br><br>\r\n<center>“LA CONSTANCIA Y PERSEVERANCIA SON LA CLAVE DEL ÉXITO.”</center>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '46.jpg', NULL, NULL),
(47, NULL, 'Salida a  Festival  Nacional de gimnasia 2016 Guadalajara.', 'Tras semanas de trabajo intenso Wolosky se dirige a Guadalajara', '2016-11-13', 'Por: Wolosky\r\n<br><br>\r\nGala internacional con invitados especiales con el tema de la gimnasia a través de los tiempos. \r\n<br><br>\r\nRepresentando a CHIAPAS con 25 gimnastas. Desde los 4 años de edad y hasta los 32.  buscando puntos para la Gymnastrada Mundial de 2019 en Australia.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/LA0srMklYRQ\" frameborder=\"0\" allowfullscreen></iframe>', '47.jpg', NULL, NULL),
(48, NULL, 'Se acerca la 5ta Copa Wolosky 2012', 'Por segunda ocasión la academia Wolosky de Gimnasia realizará en la Arena Metropolitana “Jorge Cuesy Serrano” su Quinta Copa Wolosky ', '2012-05-26', 'Por: <a href=\"http://old.nvinoticias.com/deportes/otros-deportes/98754-se-acerca-la-5ta-copa-wolosky\"> Hans Gómez Cano </a>\r\n<br><br>\r\nPor segunda ocasión la academia Wolosky de Gimnasia realizará en la Arena Metropolitana “Jorge Cuesy Serrano” su Quinta Copa Wolosky que tiene como fecha programada a realizarse del 28 de junio al 1 de julio donde se espera una buena participación de atletas tanto del estado como fuera de este.Wolosky de la mano de la Asociación Chiapaneca de Gimnasia hacen el esfuerzo de llevar por buen puerto esta quinta Copa Wolosky que tendrá un escenario de lujo para la actividad de la gimnasia.\r\n<br><br>\r\nLos organizadores han dado a conocer que la inauguración del evento se llevará a cabo el día de 29 de junio en punto de las 12:30 horas.\r\n<br><br>\r\nLa entrada será gratuita gracias al apoyo del gobierno del estado, del ayuntamiento capitalino y del DIF municipal.\r\n<br><br>\r\nPara esta copa se espera el arribo de gimnastas del sureste de las entidades que pertenecen a la Región 5 como lo son: Veracruz, Tabasco, Yucatán, Quintana Roo y por supuesto el anfitrión Chiapas.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '48.jpg', NULL, NULL),
(49, NULL, 'Se realiza 6ta copa Wolosky 2013', 'Con la presencia del secretario de la Juventud, Recreación y Deporte,  Carlos Penagos Vargas, se realizó la 6ta edición de la “Copa Wolosky”', '2013-05-06', '•    Secretario de la Juventud, Recreación y Deporte, Carlos Penagos Vargas, premió a los participantes más destacados en gimnasia artística femenil y varonil\r\n<br><br>\r\n•    Rebeca Wolosky, directora de Wolosky Gym, agradeció a los estados de Tabasco y Yucatán, su interés por asistir a este evento\r\n<br><br>\r\nTuxtla Gutiérrez Chiapas, a 06 de Mayo.- Con la presencia del secretario de la Juventud, Recreación y Deporte,  Carlos Penagos Vargas, se realizó la 6ta edición de la “Copa Wolosky” de gimnasia artística femenil y varonil , que recibió a participantes de Tabasco y Yucatán, en el auditorio 2 de la SJRyD.\r\n<br><br>\r\nPenagos Vargas, resaltó la importancia de generar en las niñas y niños hábitos de vida más sanos a través del deporte y consideró, que este tipo de eventos son necesarios para la promoción de la gimnasia artística en el estado.\r\n<br><br>\r\n“Que las y los niños que practiquen la gimnasia artística, cuenten con los implementos necesarios para su preparación, es de suma importancia realizar este tipo de eventos y aprovechando la presencia de participantes de Tabasco y Yucatán, podremos lograr un mayor fogueo en esta disciplina” agregó la máxima autoridad del deporte en Chiapas.\r\n<br><br>\r\nA través de la subsecretaría del deporte, a cargo de José Luis Orantes Costanzo, se gestionó el apoyo para que la 6ta “Copa Wolosky” se llevara a cabo en las instalaciones de la propia SJRyD,  en las clases, VI, VII,VIII; del nivel I al III.\r\n<br><br>\r\nCarlos Penagos Vargas, hizo entrega de un reconocimiento  a Luis Fernando Durante, por su destacada participación en el campeonato Nacional de gimnasia, efectuado recientemente en Monterrey Nuevo León y donde obtuvo la medalla de oro en su categoría.\r\n<br><br>\r\nPor último, Rebeca Wolosky, agradeció a las y los niños de las diferentes clases y niveles por esforzarse cada día a ser mejores y  ser las grandes promesas de la gimnasia artística en Chiapas, así como a los estados de Tabasco y Yucatán, por mostrar el interés de participar en este evento.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '49.jpg', NULL, NULL);
INSERT INTO `noticias` (`id`, `user_id`, `titulo`, `resumen`, `fecha`, `texto`, `youtube`, `imagen`, `created_at`, `updated_at`) VALUES
(50, NULL, 'Wolosky Gym retornó a un Festival Nacional de Gimnasia Para Todos', 'Wolosky, decidió retornar a este evento tras 3 años de no hacerlo, por lo cual acudieron con un grupo de 25 gimnastas, de diversas edades, a la ciudad de Guadalajara, para ser parte del Festival Nacional 2016 de Gimnasia Para Todos.', '2016-12-01', 'Por: <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/13892-wolosky-gym-retorno-a-un-festival-nacional-de-gimnasia-para-todos\">Nein Gómez</a><br><br> •Desde 2013 no habían tenido la oportunidad de participar de nuevo<br>• La intención fue ir acumulando puntos para poder ganarse un espacio para la Gimnastrada Mundial 2019<br><br>El Club de Gimnasia Wolosky Gym es de los que trabaja, aparte de la gimnasia de alto rendimiento, un ramo de la gimnasia no competitiva, hablamos del programa de Gimnasia Para Todos y el cual desde hace unos años ya cuenta con su evento nacional.<br><br>El gimnasio que está bajo la tutela de la profesora Rebeca Wolosky, decidió retornar a este evento tras 3 años de no hacerlo, por lo cual acudieron con un grupo de 25 gimnastas, de diversas edades, a la ciudad de Guadalajara, para ser parte del Festival Nacional 2016 de Gimnasia Para Todos.<br><br><center><br><h5>\"La constancia y la perseverancia son la clave del éxito\"<h5><br></center><br><br>Un gran trabajo fue el que demostró este grupo entusiastas de chiapanecos, quienes dieron todo de sí para demostrar que en Chiapas se está trabajado con este deporte, así como con el programa de Gimnasia Para Todos.<br><br>La propia directora del club explicó que la competitividad queda en un segundo plano dentro de este festival, ya que lo importante es que de acuerdo a las edades de los gimnastas, los acomodan por grupos de colores y de ahí parte para que ellos acumulen puntos para la Gimnastrada Mundial.<br><br>Rebeca Wolosky espera mantener al grupo para seguir participando de esta fecha hasta el 2019, año en que será la gimnastrada, para así ver la posibilidad de estar en el listado que representará a México en este evento, que todo apunta sería en Australia.<br><br>Una vez pasada la experiencia, se platicó con dos de los entrenadores encargados de coordinar al grupo, así como también fueron parte de la rutina. En ese punto, el profesor Uzías Calvo Ramírez habló un poco de la experiencia y esencia de lo que es este evento, “El Festival Gimnasia Para Todos fue una experiencia nueva para todos, donde llevamos de diversos niveles, desde la 1 a la 3, así como de pre nivel y nivel 5 y 7 en niños”.<br><br>\"Este festival promueve una parte de la gimnasia no competitiva, pero nosotros al final de cuentas llevamos ese deseo de competir a este nacional y ver qué estado lleva su mejor rutina o acrobacias”, expuso.<br><br>Además, hizo hincapié en lo que se debe mejorar, así como dio su punto de vista en específico de la rama varonil, “recibimos buenas críticas y que nuestra rutina fue buena, aunque restan muchas cosas por mejorar que para el próximo año, ya con más acrobacia y coordinación de nuestros atletas implementaremos nuevas acrobacias”.<br><br>“Los niños tuvieron buen desempeño, sólo faltó trabajar un poco más las acrobáticas y más entendimiento en el trabajo en equipo, pero todo apunta que vamos bien con el trabajo que se hace con ellos”.<br><br>También en entrevista habló Berenice Guadalupe Flores Arrazola, coordinadora del equipo, quien expresó lo que vivió en el evento, así como los detalles más complicados que se lidiaron con el grupo.<br><br>“Son sensaciones buenas, porque te hacen sentir satisfacción y al mismo tiempo te hacen exigirte más y exigir más a los alumnos, prepararse para prepararlos a ellos”.<br><br>“Coordinar las edades fue difícil, ya que fueron de diversas edades, desde los 4 hasta niñas de 17 o 21 años y ahí se complica coordinar a las más pequeñas para que sigan el ritmo de las más grandes, conjugar todo eso fue lo difícil”.<br><br>Para complementar las reacciones, tocó turno a algunas de las gimnastas participantes en contar su experiencia. Empezando por las más peques, Helen Camacho Castellanos dijo: “Me gustó hacer vuelta de carros, hacer parada de manos. Me sentí bien en el viaje, hice las cosas bien, me gustaron mis rodadas. Me gustan como enseñan mis maestros”.<br><br>Por su parte, Karla Eugenia Solano López mencionó, “me sentí muy bien, porque estuve conviviendo con muchas compañeras y vi muchas rutinas que no conocía. Se sintió bien la participación del gimnasio”.<br><br>Pasando con atletas más grandes, Alondra Mena Borraz agregó de su experiencia, “bastante bien. Yo creo que fue una presentación buena por el esfuerzo de todo el grupo, aunque el resto de participantes también presentaron rutinas muy padres y eso deja una experiencia buena para el gimnasio, porque se aprende a trabajar en equipo”.<br><br>Renata Cancino Cortois fue otra de las concursantes, quien mencionó, “muy bien, me gustó que me lanzaran en el aire porque es como volar. Lo de lanzarme me enseñó mi profesor Uzías, quien me gusta como enseña”.<br><br>Y finalmente, Marian Barragán Negrón aportó en sus experiencias lo siguiente: “Estuvo muy padre, una experiencia muy bonita, todos los participantes se ven bastante avanzados, pero eso ayuda a que el gimnasio siga entrenando mejor para mejorar más y en lo personal mejorar mucho, aprender hacer un mortal”.<br><br>Es de esta manera, como el grupo participante regresó motivado de Guadalajara, esperando que en 2017 puedan volver a hacerse presente en este evento y dar una mejor rutina que deje sorprendidos a propios y extraños.<br><br><center><br><h5>\"La constancia y la perseverancia son la clave del éxito\"<h5><br></center>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/FstihKsEoIc\" frameborder=\"0\" allowfullscreen></iframe>', '50.jpg', NULL, NULL),
(51, NULL, ' Wolosky Gym capacita a niños de Yajalón', 'Con ese firme objetivo que la gimnasia artística toque puertas en otros municipios, Wolosky Gym abrió las suyas para albergar a un grupo de niños oriundos de Yajalón, para que recibieran un pequeño campamento de entrenamiento el sábado 26 de noviembre.', '2016-12-09', '<center>\r\n<a href=\"galerias/51/index.php\">[ Visita la Galería de Fotos ]</a>\r\n</center>\r\n<br>\r\nPor:  <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/13935-wolosky-gym-capacita-a-ninos-de-yajalon\">Nein Gómez</a>\r\n<br>\r\nEl grupo de este municipio chiapaneco está coordinado por el profesor en educación física, Abegaín Pérez Méndez \r\n<br><br>\r\nCon ese firme objetivo que la gimnasia artística toque puertas en otros municipios, Wolosky Gym abrió las suyas para albergar a un grupo de niños oriundos de Yajalón, para que recibieran un pequeño campamento de entrenamiento el sábado 26 de noviembre.\r\n<br><br>\r\nEste grupo del municipio del “ámbar” se encuentra supervisado por el profesor en educación física, Abegaín Pérez Méndez, quien en su necesidad de dar una capacitación debida a los niños que quieren practicar gimnasia en esa ciudad, solicitó el apoyo de la profesora Rebeca Wolosky para tener este campamento.\r\n<br><br>\r\nEl entrenamiento fue en un solo día, dividido en dos sesiones; mañana y tarde. En total se trabajaron un promedio de seis horas entre ambas sesiones y en las cuales los jovencitos tuvieron la oportunidad de trabajar los siguientes aspectos: preparación física, preparación específica y aspectos básicos dentro de los aparatos tanto para gimnasia varonil como femenil.<br>\r\n<center>\r\n<a href=\"galerias/51/index.php\">[ Visita la Galería de Fotos ]</a>\r\n</center>\r\n<br>\r\nEl profesor Abegaín Pérez dio a conocer que este trabajo de promocionar el deporte en Yajalón en iniciativa suya, ya que pretende con ello alejar a los niños de los vicios y tengan una mejor calidad de vida. Debido a ser un viejo conocido de la profesora Rebeca, tomó la decisión de empezar a promover la gimnasia artística en Yajalón.\r\n<br><br>\r\nPérez Méndez tiene la intención que un futuro no muy lejano lograr constituir un verdadero gimnasio en tierras del “ámbar” y lograr ser una franquicia de Wolosky Gym en esa región del estado, lo cual conllevaría afiliarse también en un futuro a la asociación rectora de este deporte.\r\n<br><br>\r\nSe pretende que este grupo reciba un seguimiento adecuado por parte del equipo de trabajo de Wolosky Gym, con tal que los niños reciban el entrenamiento adecuado, de acuerdo a sus capacidades y edades.\r\n\r\n\r\n<center>\r\n<a href=\"galerias/51/index.php\">[ Visita la Galería de Fotos ]</a>\r\n<h5>\"La constancia y la perseverancia son la clave del éxito\"<h5>\r\n</center>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '51.jpg', NULL, NULL),
(52, NULL, 'Wolosky tuvo su Gym Fest Navideño 2016', 'Con bombo y platillo fue como el Club de Gimnasia Wolosky cerró el año, esto al realizar su Gym Fest Navideño 2016, actividad que sirvió para concluir el calendario de trabajo de todos los que componen al club: gimnastas, entrenadores y staff de trabajo del gimnasio.', '2016-12-17', 'Por: <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/13975-wolosky-tuvo-su-gym-fest-navideno-2016\">Nein Gómez</a>\r\n<br><br>\r\n• Todos los niveles, femenil y varonil, fueron parte de este gran festival\r\n<br>\r\n• Con esta actividad cerraron su calendario de trabajo 2016\r\n<br><br>\r\nCon bombo y platillo fue como el Club de Gimnasia Wolosky cerró el año, esto al realizar su Gym Fest Navideño 2016, actividad que sirvió para concluir el calendario de trabajo de todos los que componen al club: gimnastas, entrenadores y staff de trabajo del gimnasio.\r\n<br><br>\r\nPara esta celebración el club preparó todo un programa completo de números, show y demostraciones, todo a cargo por los alumnos, tanto de gimnasia varonil como femenil.\r\n<br><br>\r\nEl programa se caracterizó por contar con muchas rutinas individuales y por parejas, de los atletas de femenil que participaron en el Campeonato Regional de este año en Coatzacoalcos, Veracruz; así como de los atletas de varonil que estuvieron en el Campeonato Nacional de Gimnasia 2016 en Monterrey Nuevo León.\r\n<center>\r\n<a href=\"http://www.zonadecampeones.com/v2/component/joomgallery/wolosky-tuvo-su-gym-fest-navideo-2016\"><h5>[ Visita la Galería de Fotos ]</h5></a>\r\n</center>\r\n<br>\r\nPor la femenil participaron, de las clases de Regional, Nicole Vázquez León, Cinthia Carolina Sánchez Ruiz; quien hizo pareja con Marian Negrón. Tambien se hizo demostraciones de rutinas con las niñas de pre nivel y niveles de iniciación. Las atletas participantes fueron: Alexa Monserrat Mendoza, Helen Camacho, Renata Cancino, Grecia Nucamendi, Victoria Herrera, Daniela Tapia, Aleyda López y Valentina López.\r\n<br><br>\r\nEn cuanto a la rama varonil, contaron con sus rutinas individuales: Patricio Josafat Gómez, Joel Alonso Mendoza y Leonardo Domínguez Mazariegos. En cuanto a las rutinas grupales, estas correspondieron por parte de las niñas integrantes de los horarios de 5 a 6 y 6 a 7 de la tarde.\r\n<br><br>\r\nLa rutina grupal especial en esta ocasión fue la presentación del equipo que participó en el Festival de Gimnasia Para Todos en Guadalajara, Jalisco; demostración con la cual dieron muestra de la capacidad con la que trabaja el club este programa de gimnasia y que abre una ventana para ellos el poder ser contemplados para el festival mundial.\r\n<br><br>\r\nPara cerrar con broche de oro, todo el equipo de trabajo y atletas de Wolosky Gym presentaron su rutina de baile de esta Navidad 2016, cerrando en total armonía y como la gran familia que son. El resto de la noche fue para celebrar, ya que el club aprovechó para realizar su posada.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/ZJ4zrgS2ehw\" frameborder=\"0\" allowfullscreen></iframe>', '52.jpg', NULL, NULL),
(53, NULL, 'Wolosky Gym y Makawin realizan gran festival', 'Tratando de cerrar con una nueva etapa y renovados bríos, las escuelas de gimnasia Wolosky Gym y Makawin, realizaron este pasado martes 9 de diciembre su Festival Gimnástico de Fiesta Navideña', '2014-01-17', 'Por: <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/10225-wolosky-gym-y-makawin-realizan-gran-festival-\">Nein Gómez</a>><br>\r\n• La temática fue la Fiesta Navideña\r\n• Con ello despiden las actividades del 2014<br>\r\n<br><br>\r\nTratando de cerrar con una nueva etapa y renovados bríos, las escuelas de gimnasia Wolosky Gym y Makawin, realizaron este pasado martes 9 de diciembre su Festival Gimnástico de Fiesta Navideña, esto a manera de despedir el 2014 con una magna fiesta entre alumnos, profesores y padres de familia.\r\n<br>\r\n<a href=\"http://www.zonadecampeones.com/v2/component/joomgallery/wolosky-gym-y-makawin-realizan-festival\">Visita la Galería de Fotos </a>\r\n<br>\r\nPara esta ocasión fue las instalaciones del Club Makawin, la sede de este festival, el cual reunió a cientos de niños, jóvenes y adultos practicantes de la gimnasia, así como de otras actividades físicas y culturales.\r\n<br><br>\r\nUna etapa de regeneración es la que ha vivido en los últimos meses el Club de Gimnasia Wolosky, quien ahora estará haciendo sinergia con el Club Makawin, y estar trabajando en las instalaciones de este club que está bajo el mando del profesor José Luis Herrera Sánchez.\r\n<br><br>\r\nDentro del Festival Gimnástico se contó con la presencia de personalidades como, Adriana Herrera; directora del área de estimulación temprana del Club Deportivo Makawin, Profesor José Luis Sánchez; Director General del Club Makawin, Eliseo Licona García; representante de la Secretaría de Juventud, Recreación y Deporte, así como de la directora del Club Rebeca Wolosky, quien fue la encargada de ser la maestra de ceremonias.\r\n<br><br>\r\nComo parte de todo el número del festival se vieron varias exhibiciones, esto por parte de todos los grupos de trabajo que ahora están haciendo en conjunto Makawin y Wolosky, estos grupos están denominados por colores, de acuerdo al desarrollo y edad del niño. Así que, en estos grupos participaron el Blanco (iniciación), amarillos (iniciación básica), rojos, así como los grupos mixtos (hombres y mujeres).\r\n<br><br>\r\nLa parte de gimnasia de alta competencia estuvo a cargo de los alumnos con los cuales ya ha venido trabajando de años la profesora Rebeca Wolosky, quienes dieron una muestra de los trabajos que se hacen ya con ellos en los aparatos como Barras Paralelas, Piso, Barra Fija, y Caballo con Arzones; en el caso de los varones, y las rutinas de Piso, Barras Asimétricas y Salto de Caballo en el caso de la rama femenil.\r\n<br><br>\r\nAsí mismo se contó con un espectáculo por parte de un Grupo de Ballet, quienes deleitaron con su destreza y música a los presentes.\r\n<br><br>\r\nFinalmente, el Festival concluyó con una rutina fusionando a todos los grupos de trabajo de las dos instituciones y así despedir magnamente este evento.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '53.jpg', NULL, NULL),
(54, NULL, 'Zumba en Wolosky Gym', '• El gimnasio busca dar una opción más para la práctica de alguna actividad física', '2017-03-09', 'Por:  <a href=\"http://www.zonadecampeones.com/portal/index.php/selecciona-tu-deporte/gimnasia/385-wolosky-gym-se-refuerza-con-clases-de-zumba\">Nein Gómez</a><br><br>2017 ha comenzado, en sus primeros dos meses, con renovados bríos para Wolosky Gym, ya que se suman a la tarea de proporcionar en sus instalaciones nuevas actividades para que la población de Tuxtla Gutiérrez se sume a la actividad física. Ahora, el gimnasio cuenta con clases de Zumba.<br><br><br><br>El club se mantiene a la vanguardia con su actividad principal, la enseñanza de la gimnasia artística, tanto femenil como varonil, así como la gimnasia recreativa para que incluso personas adultas se sumen a su práctica.<br><br>Rebeca Wolosky, directora del gimnasio, dio a conocer que en este inicio de las clases de Zumba han optado por tres horarios, 4-5, 5-6 y 6-7 pm, donde desde hombres, mujeres y niños se pueden sumar a las clases y tener una mejor calidad de vida y saludable.<br><br>Poco a poco el gimnasio está contando con personas interesadas para la práctica de la Zumba, pero eso no evita en que sigan invitando a que más público se sume a las clases, las cuales las podrán tomar con toda la confianza en 2ª Poniente entre 2ª y 3ª Norte #338, Colonia Centro de esta ciudad capital, lugar de las instalaciones del gimnasio.<br><br>Wolosky Gym da la certeza y certificación que las clases son con el mayor profesionalismo posible, donde los que gusten tomarlas, podrán obtener resultados de salud óptimos, esto acompañado de la buena alimentación que ellos deben seguir para llegar a su peso ideal.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1489570774_zumba.jpg', NULL, NULL),
(55, NULL, 'Descuento del 80% en inscripciones!!!', 'No te pierdas esta gran oportunidad de vivir la experiencia Wolosky aprovechando esta increíble promoción', '2017-04-07', 'Todo Abril por ser el mes del Niño  Descuento del 80% en inscripciones!!!!!<br><br>No te lo pierdas. <br><br>Trabajamos en horarios regulares durante estas semanas de vacaciones. <br>Solo suspendemos clases los días 13, 14 y 15 de abril. <br><br>Los esperamos<br><br><h3 style=\"text-align: center;\">\"LA CONSTANCIA Y LA PERSEVERANCIA SON LA CLAVE DEL EXITO “</h3>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', 'promocion.jpg', NULL, NULL),
(56, NULL, 'Wolosky pule detalles para el Regional 2017', 'Este gimnasio está en etapa de entrenamientos para este evento que será en abril', '2017-04-02', 'Por:  <a href=\"http://zonadecampeones.com/portal/index.php/selecciona-tu-deporte/gimnasia/521-wolosky-pule-detalles-para-el-regional\">Nein Gómez</a><br><br>El Club de Gimnasia Artística Wolosky Gym se encuentra en plena etapa de preparación para el próximo Campeonato Regional, el cual será los días 28 y 29 de abril próximos, por ello, marzo fue un mes muy activo para estar trabajando con las niñas que cumplen con los niveles para este torneo.<br><br>La profesora y directora de este club, Rebeca Wolosky, afirmó que por el momento el gimnasio está puliendo los detalles con las niñas que están candidateadas para poder realizar el viaje al estado de Campeche, sede del Regional 2017.<br><br>Confirmada la lista de participantes, el gimnasio podrá entrar a una segunda etapa del entrenamiento, donde ya estará enfocado a las rutinas y ejecuciones que necesita cada una de las gimnastas de acuerdo al grupo y nivel en el cual participarán.<br><br>Para el club es importante poder tener un buen desempeño dentro de este Regional, ya que sirve como trampolín para poder promover a las niñas a su siguiente nivel y con ellos aspirar a contar con más atletas con posibilidad en un futuro de poder contemplarlas para el Campeonato Nacional.<br><br>El club tendrá cerca de un mes más para trabajar con las niñas que finalmente queden seleccionadas para viajar, para cumplir con uno de los eventos más importantes del calendario de trabajo del gimnasio, esperando puedan hacer un buen papel y poner en alto el nombre de Chiapas.<br><br>Finalmente, Rebeca Wolosky detalló que también se encuentran trabajando para lo que sería un evento de exhibición en conmemoración de un aniversario más del club, el cual sería con bombo y platillo, porque sería el festejo número 20 de vida del club.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492146302_woloskypuldtllsplreg.jpg', NULL, NULL),
(58, NULL, 'Realizaron exhibición previo a su viaje al Nacional 2016', 'La escuela de gimnasia artística Wolosky Gym preparó toda una fiesta este sábado 18 de junio, esto con una exhibición, en la cual se persiguió tres objetivos', '2016-06-21', '• Esto para los cuatro atletas que representarán a Wolosky<br>• Con la rama femenil fue para homenajear a las niñas de Regional<br><br>Por: Nein Gómez<br><br>La escuela de gimnasia artística Wolosky Gym preparó toda una fiesta este sábado 18 de junio, esto con una exhibición, en la cual se persiguió tres objetivos: Reconocer a las atletas de gimnasia femenil que participaron en el Regional de este año, homenajear a los atletas de mayor antigüedad en la escuela, así como dar una exhibición con los tres atletas que están participando en el Campeonato Nacional de Gimnasia Varonil.<br><br>Las instalaciones del club fueron testigos de esta breve, pero emotiva exhibición, donde se contó con una buena cantidad de público; quienes fueron testigos de las evoluciones del alumnado más avanzado del club.<br><br>Como maestra de ceremonia del evento estuvo la directora del club, Rebeca Wolosky, respaldada por todo su cuerpo de entrenadores para supervisar las ejecuciones de los alumnos.<br>[ Visita la Galería de Fotos ]<br><br>El programa constó de varias etapas, donde las encargadas de abrir fueron las niñas de Regional, de manera alterna fueron incluyendo a los atletas de varonil, destacando a los que participan en el Nacional que comenzó este 20 de junio.<br><br>Estos atletas tanto de varonil como femenil se fueron alternando por etapas, pasando por cada uno de los aparatos que componen su competencia y rama, hasta concluir.<br><br>De los agregados extras a la exhibición, se contó con la presencia del grupo de atletas de la modalidad de formas de la escuela Academia Deportiva de taekwondo del profesor Faustino Fong; donde en dos intervenciones dieron muestra de su talento en esta modalidad de este arte marcial; destacando que los cuatro alumnos que intervinieron, estarán en la próxima Olimpiada Nacional.<br><br>Finalmente, se dio paso al momento de felicitar, motivar y dar la mejor de las vibras a los tres participantes en el Nacional: Joel Alonso Mendoza Solorzano (Nivel 4 grupo C), Patricio Josafat Gómez Grajales (Nivel 5 Grupo C), Michael Solís Yock (Nivel 5 grupo B).<br><br>De esta manera, se le deseó la mejor de las vibras a estos jovencitos que están dando lo mejor de sí dentro de este Nacional que se está desarrollando en la ciudad de Monterrey, Nuevo León.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492137236_asd.jpg', NULL, NULL),
(61, NULL, 'Wolosky Gym se mantuvo activo en vacaciones', 'Aunque mucho aprovecharon las vacaciones para descansar, hay otros que prefirieron seguir trabajando. Este es el caso de la Academia de Gimnasia Wolosky', '2013-09-01', 'Por: <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/6858-wolosky-gym-se-mantuvo-activo-en-vacaciones-\">Nein Gómez</a><br><br>• Contaron con Curso de Verano y Campamento<br>• Se trabajó estas dos actividades desde el mes de julio hasta agosto<br><br>Aunque mucho aprovecharon las vacaciones para descansar, hay otros que prefirieron seguir trabajando. Este es el caso de la Academia de Gimnasia Artística Varonil y Femenil Wolosky Gym, quienes en el lapso vacacional, contaron con su tradicional Curso de Verano, así como su Campamentos gimnástico.<br><br>Rebeca Wolosky, Directora General de esta organización fue la encargada de dar los pormenores de estas actividades.<br><br>Primeramente, el Curso de Verano se realizó entre los meses de julio y agosto, esto con niños que se adentraban por primera vez al mundo de la gimnasia, donde en las mismas instalaciones de la academia aprendieron varias cosas. <br><br>“Como cada año es el Curso de Verano que se lleva a cabo en el periodo de los meses julio-agosto, donde hubo mucha participación de niños nuevos que se están adentrando a la gimnasia y que eso nos ayuda a seguir promocionando nuestro deporte en el estado, sin ningún motivo de competencia, sino simplemente recreativo”.<br><br>“Fueron 30 días activos, donde 20 fueron en especifico para la gimnasia, tuvimos niños desde los 2 hasta los 15 y 18 años, donde dimos la iniciación de la gimnasia”, así lo afirmó Rebeca Wolosky.<br><br>En el trabajo en específico, Rebeca Wolosky habló sobre ello. En cuanto a los más pequeñitos dijo, “con los más pequeñitos fue el sistema psicomotor básico, todo lo que es coordinación básica e irlos introduciendo en el área gimnástica y probar poquito a poquito los aparatos, hasta donde lo pueden desarrollar”.<br><br>En cuanto a los de edad ya avanzada afirmó, “los mayores, según su desarrollo, se fueron adentrando un poco, esto por las mayores cualidades y que incluso algunos ya se incorporaron a entrenar dentro del curso normal del nuevo ciclo de trabajo y esto nos va a permitir avanzando con ellos lo que ya se dio de inicio en el curso de verano”. <br><br>Ya pasando al rubro del campamento, este contó con la presencia de niños que ya están dentro del programa de trabajo de este gimnasio.<br><br>“También tuvimos un campamento de gimnasia, que lo realizamos año con año, en niveles ya más avanzados, donde hubo participación de 15 gimnastas con experiencia dentro de competencia”.<br><br>En cuanto a la enseñanza que recibieron, la directora de la academia informó, “se desarrolló bastante bien y esta actividad la tuvimos en esta última semana de agosto, donde hubo participación de las ramas varonil y femenil, desde los 6 hasta los 15 años. Estuvieron avanzando bien, donde desarrollaron los nuevos elementos que van a estar trabajando durante este ciclo y con ello cerramos el periodo vacacional y dar inicio al nuevo proceso de las nuevas competencias que serán para el 2014, en específico el Regional y Campeonato Nacional”.<br><br>Ambas actividades dejaron buenas cosas para el equipo de Wolosky Gym, quienes con ello, desde este mes de septiembre ya inician con su nuevo ciclo de trabajo.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492142037_handstand--2-smweb1.jpg', NULL, NULL),
(62, NULL, 'Próximamente Campeonato regional gimnasia artística Campeche 2017', 'Se llevará a cabo el campeonato regional de gimnasia artística en Campeche', '2017-04-15', 'Campeche los espera con los brazos abiertos en su primer campeonato regional de gimnasia artística femenil.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492284504_FB_IMG_1492284259321.jpg', NULL, NULL),
(64, NULL, 'Universidad Descartes y Woloksy Gym trabajarán juntos', 'El nuevo ciclo de trabajos para la Academia de Gimnasia Artística y Varonil Wolosky Gym ha comenzado de manera positiva y con grandes proyectos.', '2013-09-05', 'Por: Nein Gómez<br><br>El nuevo ciclo de trabajos para la Academia de Gimnasia Artística y Varonil Wolosky Gym ha comenzado de manera positiva y con grandes proyectos.<br><br>Uno de los principales trabajos que estarán para este nuevo proceso es la sinergia que acaba de realizar con la Universidad de Ciencia y Tecnología Descartes, donde los estudiantes de la Licenciatura Deportiva en Educación Física estarán llevando a práctica lo aprendido en clases, esto con entrenamiento gimnástico.<br><br>Wolosky Gym será el encargado de estar entrenando a estos jóvenes del Descartes durante todo su plan cuatrimestral, así lo informó la directora general de la academia, la profesora Rebeca Wolosky.<br><br>Estos jóvenes, que son un aproximado a los 45 alumnos, estarán trabajando los fines de semana dentro de las instalaciones de la propia academia, esto como clases extras.<br><br>El objetivo de esta actividad con los alumnos del Descartes es que lo aprendido de manera teórica en clases lo llevan a cabo de manera práctica, aparte de, que los alumnos puedan aprender las bases de la gimnasia artística y las practiquen.<br><br>Otro de los objetivos es que cada uno de los alumnos al final de su periodo escolar pueda tener las herramientas básicas de un entrenador en gimnasia artística, esto tomando en cuenta a las categorías de iniciación.<br><br>Como todo alumno, al final de su ciclo escolar, serán evaluados tal y como lo hacen en los cursos de entrenadores, esto para ver si todo el trabajo hecho en el semestre dio sus frutos.<br><br>De esta manera, Wolosky Gym se está abriendo espacios para seguir difundiendo la gimnasia a nivel estatal.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492391237_dewotraju.jpg', NULL, NULL),
(65, NULL, 'Asociación de gimnasia acudirá al congreso de Federación', 'Para la Asociación Chiapaneca de Gimnasia, no habrá descanso por las fiestas patrias. Rebeca Wolosky, presidenta de dicho gremio, así como también es directora de la Academia de Gimnasia Artística Varonil y Femenil ‘Wolosky Gym’, fue la encargada de dar a conocer que justamente en esas fechas, específicamente del 13 al 15 de septiembre, estará acudiendo a la Ciudad de México para los Congresos Técnicos y Asamblea General de la Federación.  En entrevista, Rebeca Wolosky expuso la importancia del por qué Chiapas debe estar presente en este congreso y asamblea próximos.  “Son los congresos técnicos por modalidad y lo que es la asamblea general. Ahorita estamos en cambios, es muy importante ahorita la participación de nosotros como asociación, porque vienen cambios radicales en los códigos de federación, sobre todo de gimnasia artística femenil”.  “Vienen todos los cambios del ciclo olímpico, que hay que tomarlos, lo que es gimnasia varonil igualmente y esos cambios hay que ponerlos a votación dentro de la asamblea, entonces si es importante estar participando”.  Así mismo, la asociación estará viajando a esta reunión, ya que para ellos será importante saber los ajustes que se vienen para las rutinas de femenil, así como estar informados con las nuevas fechas de capacitación para la gimnasia varonil, donde Wolosky quiere estar más que preparados para el próximo Campeonato Nacional.  “Hay que ver lo de las nuevas rutinas en femenil, ver las fechas próximas para los obligatorios de gimnasia varonil, puesto que suspendieron el curso que se había programado el mes anterior y si es importante para el próximo Campeonato Nacional”...', '2013-09-10', 'Por: Nein Gómez<br><br>Para la Asociación Chiapaneca de Gimnasia, no habrá descanso por las fiestas patrias. Rebeca Wolosky, presidenta de dicho gremio, así como también es directora de la Academia de Gimnasia Artística Varonil y Femenil ‘Wolosky Gym’, fue la encargada de dar a conocer que justamente en esas fechas, específicamente del 13 al 15 de septiembre, estará acudiendo a la Ciudad de México para los Congresos Técnicos y Asamblea General de la Federación.<br><br>En entrevista, Rebeca Wolosky expuso la importancia del por qué Chiapas debe estar presente en este congreso y asamblea próximos.<br><br>“Son los congresos técnicos por modalidad y lo que es la asamblea general. Ahorita estamos en cambios, es muy importante ahorita la participación de nosotros como asociación, porque vienen cambios radicales en los códigos de federación, sobre todo de gimnasia artística femenil”.<br><br>“Vienen todos los cambios del ciclo olímpico, que hay que tomarlos, lo que es gimnasia varonil igualmente y esos cambios hay que ponerlos a votación dentro de la asamblea, entonces si es importante estar participando”.<br><br>Así mismo, la asociación estará viajando a esta reunión, ya que para ellos será importante saber los ajustes que se vienen para las rutinas de femenil, así como estar informados con las nuevas fechas de capacitación para la gimnasia varonil, donde Wolosky quiere estar más que preparados para el próximo Campeonato Nacional.<br><br>“Hay que ver lo de las nuevas rutinas en femenil, ver las fechas próximas para los obligatorios de gimnasia varonil, puesto que suspendieron el curso que se había programado el mes anterior y si es importante para el próximo Campeonato Nacional”.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492392816_rebe.jpg', NULL, NULL),
(66, NULL, 'Chiapas con fuerte presencia en el Congreso Nacional de Gimnasia', 'La estancia en la Ciudad de México de la presidenta de la Asociación Chiapaneca de Gimnasia, Rebeca Wolosky, en fechas recientes fue también con el objetivo de estar en el Congreso...', '2013-11-10', 'Por: Nein Gómez<br><br>• Rebeca Wolosky asistió para ver los nuevos cambios en este deporte<br>• Así mismo, fue invitada a los eventos especiales de este congreso<br><br>La estancia en la Ciudad de México de la presidenta de la Asociación Chiapaneca de Gimnasia, Rebeca Wolosky, en fechas recientes fue también con el objetivo de estar en el Congreso convocado por la federación de dicha disciplina, donde se tomaron decisiones muy importantes para la gimnasia en el país.<br><br>LA detalle, la presidente de la asociación en el estado nos mencionó lo que se viene para la gimnasia en México, así como la manera en que la federación transmitirá los nuevos cambios a todos los jueces y entrenadores.<br><br>“Este Congreso fue muy importante, porque tuvimos participación en las diferentes modalidades, no en presencia, pero si en tener la información correspondiente para la femenil y varonil, donde cambian todas las rutinas obligatorias, así como muchas cosas del código de competencia”.<br><br>“Se nos avisó que para el mes de noviembre estaríamos aplicando el curso de jueces, donde nos estarían dando toda la información correspondiente. Hubo cambios en la gimnasia rítmica también”.<br><br>Tras el congreso, a la presidente de la asociación en Chiapas de este deporte se le hizo la invitación para estar presentes, primeramente a la presentación del programa Gimnasia Para Todos, donde se abre una nueva ventana a Chiapas para tener presencia internacional.<br><br>“Estuvimos presentes en la presentación del programa Gimnasia Para Todos, correspondiente al Mundial que se celebrará en el 2015, donde Chiapas; estaremos buscando algún puntaje para poder participar en el Mundial”.<br><br>Así mismo, estuvo en la segunda inducción al Salón de la Fama Nacional, proyecto que incluso se quiere hacer en el estado.<br><br>“Pudimos participar en el segundo ingreso del Salón de la Fama de ex gimnastas, donde se da a las personalidades dentro de este deporte. En este caso fue la segunda generación; donde entraron 5 personajes, donde están StoyankaDobreva, Álvaro Fabio Sánchez Zamora y los hermanos Monatañez; Alonso, Armando y Fernando”.<br><br>“Esto trataremos hacerlo en Chiapas. Estamos pensando hacer todo el reconocimiento a la gimnasia chiapaneca, desde sus inicios, y vamos a tratar de hacer la historia de la gimnasia en el estado”.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492391518_rewoco.jpg', NULL, NULL),
(67, NULL, 'Rebeca Wolosky se capacitó para ser visora', 'Rebeca Wolosky, Directora General de la Academia de Gimnasia Artística ‘Wolosky Gym’, se sigue abriendo puertas en las capacitaciones...', '2013-11-12', 'Por: Nein Gómez<br><br>Rebeca Wolosky, Directora General de la Academia de Gimnasia Artística ‘Wolosky Gym’, se sigue abriendo puertas en las capacitaciones, es por ello, que del 12 al 13 de septiembre, estuvo presente en la Ciudad de México, donde tomó el curso para ingresar a la modalidad del programa Gimnasia Para Todos que promueve la federación de la especialidad.<br><br>La propia profesora nos contó su experiencia en entrevista, sobre el éxito obtenido al tomar dicha capacitación.<br><br>“Este curso fue una invitación que nos hicieron por parte del programa de Gimnasia Para Todos, una servidora tomó el curso como visor, para esta modalidad. Se aplicó el examen correspondiente, se hizo todo el curso y tuvimos buenos resultados. Quedo como visor de la modalidad en esta gimnasia, que equivale a un juez en artístico, y quedo con uno de los promedios más altos y eso nos da mucho orgullo”.<br><br>“Como visor tengo obligación, al igual que en las otras modalidades, de juzgar los niveles básicos o de iniciación, porque es la primera vez que participamos en esta modalidad y estoy recién ingresada al panel de visores”.<br><br>Una vez obtenida la categoría de visor, Rebeca Wolosky tendrá ya su primer reto para estar en un evento de Gimnasia Para Todos, se trata del Festival Nacional de Gimnasia.<br><br>“Esta modalidad nos invitan para diciembre al Festival Nacional de Gimnasia que se llevará a cabo del 5 al 8 de diciembre en la Ciudad de Querétaro y estaremos participando con un grupo de 10 gimnastas”.<br><br>“Me tocará estar visoreando a los grupos básicos que son los blancos, que es como se divide la modalidad, en blancos, azules y rojos, entonces me tocará los grupos blancos en el Festival Nacional”.<br><br>Ahora que llega este nuevo reto para ella como profesora, sólo espera cumplir al 100% y dejar buenas cuentas para el estado como nueva visora.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492391646_rebe.jpg', NULL, NULL),
(68, NULL, 'Wolosky se capacito en clínica de gimnasia varonil', 'La capacitación es un tema importante dentro de la Academia de Gimnasia Artística Wolosky Gym, por ello, en los últimos meses han buscado la manera...', '2013-09-13', 'Por: Nein Gómez<br><br>La capacitación es un tema importante dentro de la Academia de Gimnasia Artística Wolosky Gym, por ello, en los últimos meses han buscado la manera de tener bien entrenados y capacitados tanto a sus alumnos, como entrenadores, en este caso hablando específicamente dentro de la rama varonil.<br><br>Boca del Río, Veracruz fue sede, del 27 al 29 de septiembre, de una clínica de gimnasia artística varonil, donde Wolosky Gym hizo su esfuerzo para que su entrenador, José Luis Esponda y dos gimnastas de la academia, acudieran a esta clínica para tomar la mayor experiencia posible.<br><br>T“Wolosky estuvo con dos gimnastas en la clínica de gimnasia varonil que se impartió en Boca del Río, Veracruz. Aquí participaron los dos gimnastas con un profesor, José Luis Esponda con la intención de perfeccionar algunos movimiento preparativos para el Campeonato Nacional 2014 que ya estamos preparando, tanto como en femenil como en varonil”, fueron las palabras de la directora de esta academia entorno al tema de esta capacitación.<br><br>Así mismo, comentó, “tuvieron varias sesiones de trabajo en cada uno de los aparatos y fue muy benéfico, avanzaron mucho los dos jóvenes”.<br><br>Aunque ella no estuvo presente, la directora de esta academia si puede notar los avances que tuvieron los alumnos y su entrenador con esta clínica, ya que han sido de mucho apoyo para la preparación del resto del equipo que ya está entrenando para el Campeonato Nacional 2014.<br><br>“Estamos esperando que para el próximo nacional estén bien preparados, aunándose a ellos otros gimnastas que no tuvieron la oportunidad de participar en la clínica por la lejanía y la economía, pero se siguen preparando en el gimnasio y con la experiencia que adquirieron sus dos compañeros que asistieron”.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492391821_portada.jpg', NULL, NULL),
(69, NULL, 'Wolosky Gym se adentra a la gimnasia acrobática', 'Woloksy Gym, la profesora Rebeca Wolosky, quien en su afán de seguir capacitándose dentro de esta disciplina que es la gimnasia, busca nuevos horizontes, tal como es el caso de la modalidad de la gimnasia acrobática...', '2013-09-14', 'Por: Nein Gómez<br><br>• Rebeca Wolosky tomó la clínica que se impartió en la Ciudad de México<br><br>Los últimos meses ha sido una agenda cargada de trabajo para la directora General de la Academia de Gimnasia Artística Varonil y Femenil Woloksy Gym, la profesora Rebeca Wolosky, quien en su afán de seguir capacitándose dentro de esta disciplina que es la gimnasia, busca nuevos horizontes, tal como es el caso de la modalidad de la gimnasia acrobática.<br><br>Fue el 26 y 27 de octubre, donde Rebeca Wolosky estuvo en la Ciudad de México, primeramente y como ella lo comentó en entrevista, para estar presentes en la Gala de Estrellas de la Gimnasia, evento que fue el 26 y que al día siguiente apertura un espacio para tener una clínica de gimnasia acrobática.<br><br>“Fuimos invitados a la Gala de Estrellas de la Gimnasia acrobática, artística y rítmica, que se llevó a cabo el 26 de octubre en la Universidad Anáhuac Norte de la Ciudad de México, de esta gala pues tuvimos la oportunidad de estar en la clínica de gimnasia acrobática, donde fuimos invitados”.<br><br>“El dueto de Estados Unidos, Eryan Smith y Brian Kinsher, junto con su entrenadora, fueron los que nos impartieron el curso de la gimnasia acrobática, fue el día 27 de octubre”.<br><br>Para la directora de Wolosky Gym, el adentrarse a conocer esta modalidad de la gimnasia, es de grata experiencia, ya que pudo ver que hay trabajos que fácilmente se pueden amoldar a un programa de trabajo en la gimnasia artística, de la cual ellos son expertos.<br><br>“Fue de mucho aprendizaje, estábamos muchos entrenadores que no hacen mucho la acrobática, pero es una modalidad que bien se puede amoldar a la rítmica y artística, empezar para introducirlos a los grupos del programa Gimnasia Para Todos, con algunos movimientos de fuerzas, pirámides, algunas técnicas”.<br><br>De hecho, la profesora afirmó que ya con sus alumnos de niveles básicos e iniciación, ya están trabajando algunos elementos de la gimnasia acrobática y que ella ha ido introduciendo en el plan de trabajo que hacen estos pequeñines.<br><br>Finalmente, habló un poco de las personalidades presentes en la gala, quienes con su espectáculo deleitaron a todos los invitados.<br><br>“En la Gala hubo gimnastas invitados de varios países, fue bonito el espectáculo, estuvo Rumania, Rusia, Brasil, Cuba, Francia, Daniel Corral de México y Mario Valdez, Ucrania, ele quipo español.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492392084_NW5OPURIDJF3RCMSA2ELKNQ2UU.jpg', NULL, NULL),
(70, NULL, 'Woloksy Gym pasará lista de presente en Curso Nacional de Jueces', 'En el entendido que para los jueces con carnet de la Federación Mexicana de Gimnasia es obligatorio el Curso del Programa de Obligatorios USAG de GAF y GAV 2013, el CLub de Gimnasia Wolosky...', '2013-09-18', 'Por: Nein Gómez<br><br>En el entendido que para los jueces con carnet de la Federación Mexicana de Gimnasia es obligatorio el Curso del Programa de Obligatorios USAG de GAF y GAV 2013, el CLub de Gimnasia Wolosky ya está en espera de las fechas, 20 al 24 de noviembre, para asistir a este curso y seguir siendo tomados en cuenta con su gente para evaluar en los torneos nacionales y regionales.<br><br>“Para los que somos jueces es obligatorio este curso, porque no habrá otro, aunque también se está haciendo la invitación a todos los entrenadores para que aprendan los nuevos obligatorios por aparatos de los cuales nos regiremos”, esto lo afirmó la propia directora de Woloksy Gym, la profesora Rebeca Wolosky.<br><br>La directora de este club afirmó que dentro del Congreso Nacional, donde asistió como presidenta de la asociación chiapaneca de la especialidad, se dieron los detalles teóricos de lo que habrá en este curso, donde algunos detalles significativos es quitar las clases de femenil y pasar a los niveles como en varonil.<br><br>“Ahora ya no habrá Clases para femenil, ahora iremos por niveles como en el varonil, del 1 al 10 y de alguna manera se incrementa la dificultad en los niveles, ahora estaremos trabajando Pre Nivel, Nivel 1 y 2, Nivel 3, 4 y 5 vendrá a ocupar lo de Regionales y lo que es el Nivel 6, 7 y 8 son los que participarán en el Nacional, entonces todas estas rutinas tendremos que aprender del Nivel 1 al 6”.<br><br>Cabe señalar que Wolosky Gym tiene pretendido participar con 2 jueces para femenil, uno en varonil, más un entrenador, donde hay plena confianza que se pueda pasar la evaluación y acreditar para seguir siendo jueces avalados.<br><br>“Esperemos seguir teniendo nuestras acreditaciones y el aval de la federación para seguir siendo jueces. Sabemos que será un curso difícil, pero hay que prepararse para tener bien cimentadas las bases”.<br><br>Cabe señalar que el curso será impartido por gente extranjera en ambas ramas y tiene valor curricular al ser avalado por la Federación Mexicana de Gimnasia.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492392248_wolipre.jpg', NULL, NULL),
(71, NULL, 'Wolosky acudira a Festival Nacional de Gimnasia Acrobática', 'La agenda para la Academia de Gimnasia Artística Varonil y Femenil Wolosky Gym estará bastante cargada para los dos últimos meses del año, con...', '2013-11-20', 'Por: Nein Gómez<br><br>La agenda para la Academia de Gimnasia Artística Varonil y Femenil Wolosky Gym estará bastante cargada para los dos últimos meses del año, con eventos que resaltan por si importancia a nivel nacional.<br><br>Una de las principales participaciones de esta academia para el mes de diciembre, será de los días del 5 al 8, en el Auditorio General Arteaga de la Ciudad de Querétaro, donde se desarrollará el Festival Nacional de Gimnasia.<br><br>Este festival es parte del programa de Gimnasia Para Todo de la Federación Mexicana de la especialidad y donde por fin Chiapas se ha animado a participar, siendo Wolosky Gym el representante estatal, esto con 10 atletas de todos los niveles.<br><br>La importancia de la participación en este festival es que Chiapas logre acumular, de aquí al 2015, puntos suficientes para ser tomados en cuenta como parte del equipo mexicano que estará en la gimnastrada mundial a realizarse en Helsinki, Finlandia, dentro de 2 años.<br><br>“Este festival nos estará dando puntos para poder tener una participación a nivel mundial en el 2015, en lo que es la gimnastrada mundial, que se celebra cada 2 años. Entonces, estamos buscando obtener puntos para Chiapas y hacer los puntos necesarios dentro de 2 años; para estar participando en la gimnastrada que se va a celebrar en Helsinki, Finlandia”, esto lo informó Rebeca Wolosky, directora general de esta academia.<br><br>Desde la confirmación de su participación en este festival, la profesora de esta academia ha estado trabajando intensamente con el grupo que hará el viaje a Querétaro, donde indica que todo parece ir viento en popa.<br><br>“Ya vimos de qué trata un poco la modalidad, estamos tratando de organizar el grupo de acuerdo a las normatividades de la modalidad, de hecho los chicos ya se están preparando, los 10 atletas que van a ir, que son desde niveles básicos, hasta los que participan en campeonatos nacionales”.<br><br>“Es muy bonito ver que desde una misma modalidad y de un mismo grupo; logramos tener gimnastas de todos los niveles y que se puedan presentar en un festival de esta magnitud”.<br><br>A este grupo le restan alrededor de 3 semanas de trabajo más para estar en Querétaro, donde Wolosky Gym, aparte de estar en el festival, fue invitado para presencia una gala gimnástica que se ofrecerá, así como un curso para entrenadores.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492392399_original.jpg', NULL, NULL);
INSERT INTO `noticias` (`id`, `user_id`, `titulo`, `resumen`, `fecha`, `texto`, `youtube`, `imagen`, `created_at`, `updated_at`) VALUES
(72, NULL, 'Pasaron lista de presente en el Curso Nacional de Gimnasia', 'Con el objetivo de cumplir con los estatutos, reglamentos y convocatorias obligatorias que realiza la Federación Mexicana de Gimnasia...', '2013-03-28', 'Por: Nein Gómez<br><br>Con el objetivo de cumplir con los estatutos, reglamentos y convocatorias obligatorias que realiza la Federación Mexicana de Gimnasia, la Asociación Chiapaneca en la especialidad, logró cumplir con la presencia de dos juezas y una entrenadora, al Curso Nacional del Programa de Obligatorios de la USAG 2013, el cual se realizó del 21 al 24 de noviembre en la Ciudad de México.<br><br>Rebeca Wolosky, Guadalupe Roblero y Maythé Thomas Castorena, de los gimnasios Wolosky Gym y Dorthom, fueron las representantes del estado de Chiapas presentes en este importante curso, de carácter obligatorio, debido a que de no contar con la realización de este itinerario, tanto juezas como entrenadoras no podrían estar dentro de los torneos nacionales y regionales del 2014.<br><br>La presidente de la asociación, Rebeca Wolosky, informó que este curso tuvo como punto primordial, el de una vez por todas que México esté trabajando bajo los programas que utiliza la gimnasia en los Estados Unidos, uno de los programas que mejores resultados ha tenido en los últimos años en este deporte.<br><br>Por ello, en este curso se impartieron temas desde los Niveles 1 al 5 para la rama femenil, mientras que para la rama varonil, se impartieron temas desde el Nivel 1 al 8. <br><br>Tom Koll y Connie Maloney, fueron los ponentes para este curso al cual se dieron cita 350 entrenadores para los cursos de la rama femenil y 100 más para el de rama varonil. Estos dos ponentes son entrenadores reconocidos en Estados Unidos, así mismo, de ser miembros de la Federación Internacional de Gimnasia (FIG).<br><br>Las ponencias y clínicas dentro de este curso dieron inicio con la rama femenil, donde la ponente, Connie Maloney fue la encargada de dar todos los pormenores de salto y barras asimétricas y Tom Koll se encargó de las coreografías de viga de equilibrio y de manos libres, tocando algunos puntos correspondientes al momento de juzgar a las atletas en los 4 aparatos.<br><br>Fue un curso intensivo a partir del día 21 de noviembre, en sesiones de doble trabajo por la mañana y tarde; en las que se tuvieron las clínicas y prácticas de los 4 diferentes aparatos.<br><br>Para los temas y clínicas de la rama varonil, Tom Koll fue el encargado único de exponer todo lo referente a esta rama. El curso fue correspondiente a los 6 aparatos de los niveles básicos, desde nivel 1 hasta el nivel 8. En esta rama, los niveles básicos son del 1 al 3; que se denominan los promocionales, y los participantes en campeonato nacional son del nivel 4 en adelante.<br><br>Al término de cada una de las clínicas, se hizo entrega de los reconocimientos de participación por parte de la Federación Mexicana de Gimnasia, los cuales constatarán la participación de Rebeca Wolosky, Guadalupe Roblero y Maythé Thomas, por el estado de Chiapas, en este curso nacional de jueces.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492392576_palicun.jpg', NULL, NULL),
(73, NULL, 'Gimnastas de Wolosky son convocados al Festival Mundial del 2015', 'Con la reciente participación de Chiapas, a través de la Academia de Gimnasia Artística Varonil y Femenil ‘Wolosky Gym’...', '2013-12-23', 'Por: Nein Gómez<br><br>Con la reciente participación de Chiapas, a través de la Academia de Gimnasia Artística Varonil y Femenil ‘Wolosky Gym’, en el Festival Nacional de Gimnasia realizado a inicios de este mes en Querétaro, los 10 gimnastas de esta academia se han ganado el derecho de participar en el Festival Mundial de la especialidad a realizarse en el año 2015 en Helsinki, Finlandia.<br><br>“Esta noticia fue dada a conocer vía entrevista por la directora general de esta academia, la profesora Rebeca Wolosky.<br><br>“Ahora tenemos derecho, por primera vez en la historia, de tener la oportunidad de estar en el Festival Mundial de Gimnasia que se llama la ‘gimnastrada’, en 2015 y que será en Helsinki, Finlandia en el mes de agosto”.<br><br>Así mismo informó que por el momento hay 3 gimnastas ya registrados por el estado, y están a la espera de ver si la economía los beneficia para poder registrar a los 7 restantes.<br><br>“Ahorita sólo esperamos que todos los padres de familia acepten esta invitación y sobre todo por los gastos que esto implica. Por el momento somos tres los inscritos y que participaremos en esa gimnastrada; que es Luis Fernando Durante García, Itacuishi López Moran y su servidora”.<br><br>La entrenadora también aseguró que en el dado caso no se lograran registrar a los 10 gimnastas, ya tienen dos propuestas para unirse a otro grupo de gimnastas y estar representando a México en este Festival Mundial.<br><br>“Si no completamos el grupo de 10 participantes, estaríamos incorporándonos a un grupo del Distrito Federal o a uno de Veracruz, para que los gimnastas tengan la oportunidad de participar en las rutinas grupales, independientemente de que todos participaremos en el Festival de Medianoche, que así se llama en el evento principal de la gimnastrada, en el estadio Olímpico de Helsinki”.<br><br>De esta manera, estos atletas de Wolosky Gym tendrán todo un año entero para trabajar en sus rutinas para este Festival Mundial y demostrar que quieren ser más participes de esta modalidad de gimnasia que promueve el programa Gimnasia Para Todos.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1492392697_giwoko.jpg', NULL, NULL),
(74, NULL, 'Wolosky Gym está preparado para el reto del Regional', 'Nueve gimnastas buscarán poner en alto el nombre del club y de Chiapas', '2017-04-27', 'Por: <a href=\"http://www.zonadecampeones.com/portal/index.php/selecciona-tu-deporte/gimnasia/605-wolosky-gym-esta-preparado-para-el-reto-del-regional\">Nein Gómez</a><br><br>Con la convicción de hacer el mejor de los papeles para el gimnasio y Chiapas, es como viajaron las 9 atletas de la Academia de Gimnasia Artística Wolosky Gym a la ciudad de Campeche, para ser partes del Campeonato Regional 2017 de la especialidad, a llevarse a cabo los días 28 y 29 de abril.<br><br>Para este club que está bajo la tutela de la profesora Rebeca Wolosky, este es el evento más importante en el año para con las gimnastas femeniles, por ello, el trabajo ha sido muy intenso con las jovencitas que han hecho el viaje.<br><br>La directora del club dio a conocer que participarán con 4 niñas en el Nivel 3: Regina Martínez Edison, María Paula García Escobar, Daniela Rodríguez Tapia, Valeria Castellanos Maza. Por el Nivel 4 tendrán participación con 3 jovencitas: Marián Barragán Negrón, Alondra del Carmen Mena Borraz y Cinthia Carolina Sánchez Ruiz. Finalmente, en el Nivel 5 estarán las gimnastas, Nicole Vázquez León y Katerine Amaya Vela.<br><br>En entrevista, Rebeca Wolosky dio los detalles de las pretensiones del club para con estas niñas en el Regional, así como los sentimientos previos a la participación en Campeche.<br><br>“Vamos buscando primeramente las acreditaciones a los siguientes niveles, la idea es buscar mejorar nuestros puntajes. Todas ellas están bien emocionadas, preparadas, los nervios normales de cualquier evento. Tendremos ahí dos niñas que van como novatas y que este Regional es su primer evento fuera del estado y de fogueo, otras niñas que son veteranas y que son con ellas que aspiramos a tener el Nivel 6 para que en 2018 estar nuevamente en un nacional femenil”, expuso la directora del club.<br><br>En esta ocasión, el trabajo técnico de las niñas fue complementado con trabajo psicológico, “desde las últimas 4 semanas principalmente estuvimos trabajando en lo psicológico, sobre todo en las mayores, porque empieza a ver ciertas presiones por saber el nivel en qué estará la competencia”, dijo Rebeca Wolosky.<br><br>Para Wolosky Gym el 2017 es significativo, por que llegarán dos décadas de vida en la capital chiapaneca, festejo que esperan enmarcar de manera perfecta con buenos resultados en el Regional.<br><br>“Como academia es un evento muy importante, porque en unas semanas más festejaremos nuestro 20 aniversario y sería un plus en el festejo tener a estar presentando a estas niñas con excelentes resultados y sus niveles acreditados en este Regional”.<br><br>Para esta ocasión, los profesores José Alfonso Esponda y Berenice Flores Arrazola estarán al frente del equipo, ausentándose la profesora Rebeca Wolosky, pero quien aprovechó a dejar su mensaje para sus alumnas que darán la cara por el gimnasia y por Chiapas en este Regional.<br><br>“Hay que estar conscientes de lo que se ha trabajado, hacer lo que se ha hecho en los entrenamientos, hacerlo con ganas y amor, disfrutar del evento y lo que saben hacer. Deseamos mucha suerte al equipo y esperar regresar con muchas recompensas”.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1493833535_woloskygymstapreppralretdlreg[1].jpg', NULL, NULL),
(75, NULL, 'Wolosky Gym con medallas en regional 2017', 'Obtuvieron resultados importantes para este club que dirige la profesora Rebeca Wolosky Álvarez.', '2017-05-03', 'Por: <a href=\"http://www.cuartopoder.mx/woloskygymconmedallasenregional-200758.html\">Cuarto Poder</a><br><br>Nueve atletas de la la Academia de Gimnasia Artística Wolosky Gym regresaron a la capital chiapaneca luego de su participación en el Campeonato Regional 2017 de Gimnasia celebrado en la ciudad de Campeche, donde obtuvieron resultados importantes para este club que dirige la profesora Rebeca Wolosky Álvarez.<br><br>Regina Martínez Edison, María Paula García Escobar, Daniela Rodríguez Tapia y Valeria Castellanos Maza tomaron parte en el Nivel 3, y en el Nivel 4 participaron con Marián Barragán Negrón, Alondra del Carmen Mena Borraz y Cinthia Carolina Sánchez Ruiz.<br><br>El club Wolosky asistió a ese certamen con la intención de aspirar a tener el Nivel 6 para que en 2018 puedan estar nuevamente en un nacional femenil. En este sentido y entre los logros obtenidos, Katerine Amaya Vela y Nicole Vázquez León tuvieron participación en el nivel 5. Esta última logró medalla de bronce en barras, mientras que Amaya Vela obtuvo cinco medallas, cuatro de oro y una de plata.<br><br>Los profesores José Alfonso Esponda y Berenice Flores Arrazola fueron los responsables de la preparación del equipo y de la actuación de este durante el certamen, bajo el mando de la profesora Rebeca.<br><br>Este resultado obtenido es significativo para el club Wolosky Gym, pues se suma a la celebración de su 20 aniversario en Tuxtla Gutiérrez, así como de ser semillero de grandes gimnastas.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1493848229_asdasd.jpg', NULL, NULL),
(76, NULL, 'Invitación a  Festejo de Aniversario 20 Años', 'Es para mí un gusto y orgullo invitarles al próximo Festejo de ANIVERSARIO de nuestra Academia, ya con 20 años de trayectoria', '2017-05-06', '<h3>Amigos Todos</h3>  <br>Es para mí un gusto y orgullo invitarles al próximo Festejo de ANIVERSARIO de nuestra Academia, ya con 20 años de trayectoria; que se dicen rápido pero han sido años de trabajo constante, en el que han pasado por nuestras manos gran cantidad de pequeños, jóvenes y adultos chiapanecos que de una u otra manera hemos podido intervenir e influir en su formación. <br><br><a href=\"http://www.woloskygimnasia.com//especiales/invitacion20años.pdf\" class=\"btn blue\" target=\"_blank\">Descarga Invitación</a><br><br>Por lo que estamos preparando un festejo muy especial meritorio de la ocasión; con participación no solo de nuestros gimnastas, ex gimnastas y entrenadores; además de grupos invitados; por lo que les invitamos con muchísimo cariño a ser partícipes de este gran evento. <br><br>Nos encantara recibirlos y que si No conoces mucho de Gimnasia puedas conocer un poco de ella; es un evento ABIERTO al PUBLICO SIN COSTO; Apúntate, Ven, Se parte, y Vive este gran festejo de la familia “Wolosky”  y de la trayectoria del gimnasio<br><br><center><br><strong>Festival del 20º Aniversario WOLOSKY <br>Sábado 13 de Mayo <br>A las 17:30  horas <br>En las instalaciones del Gimnasio  “Wolosky” <strong><br>2ª Poniente Norte # 338, Col. Centro (entre  2ª y 3ª Norte, antes la Cristóbal Colon) <br><br>No Faltes!!! Esperamos contar con tu asistencia y formar parte de este gran acontecimiento. <br><br><h4>Rebeca Wolosky Alvarez </h4><br>Directora y Fundadora de la Academia de Gimnasia Wolosky <br></center>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1494101859_20-años.jpg', NULL, NULL),
(77, NULL, 'Wolosky Gym representó a Chiapas en el Festival Nacional de Gimnasia', 'La gimnasia chiapaneca poco a poco busca abrirse espacios a nivel nacional y en esta ocasión, a través de la Academia de Gimnasia Artística Varonil y Femenil ‘Wolosky Gym', '2013-12-23', 'Por: <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/7793-wolosky-gym-represento-a-chiapas-en-el-festival-nacional-de-gimnasia-\">Nein Gómez</a><br><br>• Este festival promueve el programa ‘Gimnasia Para Todos’<br>• 10 representantes de esta Academia estuvieron en Querétaro<br><br>La gimnasia chiapaneca poco a poco busca abrirse espacios a nivel nacional y en esta ocasión, a través de la Academia de Gimnasia Artística Varonil y Femenil ‘Wolosky Gym’, Chiapas tuvo la oportunidad de participar del 5 al 8 de diciembre en el Festival Nacional de Gimnasia, esto en la ciudad de Querétaro; en evento que fue avalado por la propia federación mexicana de la especialidad.<br><br>Rebeca Wolosky, directora general de este club, dio a conocer los pormenores de la participación, de un pequeño grupo de chiapanecos, pero los cuales se mostraron muy entusiastas.<br><br>El festival tuvo una excelente respuesta, ya que se presentaron 800 gimnastas, procedentes de toda la república mexicana, y quienes contaron con un público excelente, ya que al lugar del evento llegaron un promedio de 3000 mil aficionados; quienes disfrutaron de todas las exhibiciones mostradas.<br><br>En entrevista a la directora de este club, hizo hincapié en el reconocimiento que se llevaron, por ser uno de los dos estados, que está incursionando en esta modalidad de gimnasia, parte del programa ‘Gimnasia Para Todos, de la federación mexicana.<br><br>“La participación fue un éxito, fue muy aplaudida la rutina y al final tuvimos un reconocimiento y una medalla de participación, más una placa por ser la primera vez que se participa en esta modalidad que es del programa ‘Gimnasia para Todos”.<br><br>“Chiapas participó con 10 gimnastas del Club Wolosky, con mucha satisfacción cerramos el año; recibiendo un reconocimiento de la ejecución de la rutina grupal que se presentó en Querétaro. Fue la mejor música presentada en el festival. Llevamos el huapango del Moncayo”.<br><br>Dentro de lo ejecutado ella informó sobre las rutinas, así como la sorpresa, hasta para ella misma, de haber sido parte del grupo que realizó la exhibición.<br><br>“Se ejecutaron varias acrobacias, cargadas de gimnasia acrobática y estuvo la participación de 9 chicos y en lo personal, de muchos años, una servidora se incorporó a la rutina, entonces completé el cuadro”.<br><br>Así mismo, Rebeca Wolosky concluyó diciendo que esta participación ha motivado a poder llevar este programa a más sectores de la sociedad en el estado, esperando hacerla crecer y que más gente se inmiscuya.<br><br>“Acabamos muy bien el año y creemos que para el siguiente podemos seguir aportando más grupos a este programa y tipo de gimnasia, incursionar a personas de la tercera edad, personas de capacidades especiales. Hubo mucho aprendizaje”.<br><br>PARTICIPANTES:<br>Daira Briget Trujillo Martínez, Regina Castillejos Ávila, María Fernanda Moreno Borges, Wendy Guadalupe Pérez Gómez, Itacuishi López Moran, Luis Fernando Durante García, José Alberto Estrada González, José Antonio López Ovando, José Alfonso Esponda Domínguez, Rebeca Wolosky.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1494199246_wgfen[1].jpg', NULL, NULL),
(78, NULL, 'Festejo de Posada 2013 en WoloskyGym', 'Entre piñatas, dulces, villancicos y el tradicional Santa Claus, la Academia de Gimnasia Artística Femenil y Varonil, WoloskyGym,', '2013-12-24', 'Por: <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/7819-festejan-su-posada-2013-en-woloskygym\">Nein Gómez</a><br><br>• Hubo muchos regalos y ambiente familiar<br><br>Entre piñatas, dulces, villancicos y el tradicional Santa Claus, la Academia de Gimnasia Artística Femenil y Varonil, WoloskyGym, realizó su tradicional Posada 2013, siendo la última actividad para ellos en este año, terminando esta reunión, entre alumnos y padres de familias, así como entrenadores, como la familia que son dentro de este gimnasio.<br><br>“Llegamos a la última actividad en el año, previo a los mínimos días de vacaciones que tendremos, se desarrolló la posada el día 18 de diciembre, donde siempre invitamos a todos nuestros gimnastas”, así lo confirmó la directora del club, Rebeca Wolosky.<br><br>Aunque la invitación es girada a todos los alumnos que componen el gimnasio, siempre por problemas de tiempo, no logran asistir todos, aun así, Rebeca Wolosky afirmó que la posada estuvo con una buena participación de los niños.<br><br>“Hubo buena asistencia por parte de los niños, realizaron un intercambio de regalos, estuvieron presentes cerca de 30 a 35 gimnastas”.<br><br>La parte más noble de esta posada, fue la presentación de una persona que caracteriza a Santa Claus, que aparte de entretener a los niños durante la posada, se apoya a este personaje con su labor altruista y de eso nos platicó la directora de la academia.<br><br>“Se hizo la presentación con un santa Claus, entregando presentes a los niños ya poyándolo nosotros como organización, porque el día 24 él hace labor altruista al ir a las colonias más humildes y entregar regalos y damos la ayuda, un paquetón de regalos y los reparta en esas colonias”.<br><br>Es de esta manera, que WoloskyGym finaliza un gran año 2013, esperando que el 2014 sea de muchos más éxitos.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1494199456_fepowo[1].jpg', NULL, NULL),
(79, NULL, 'Proponen a Chiapas como sede de Festival de Gimnasia', 'La Asociación Chiapaneca de Gimnasia sigue creando lazos fuertes con la Federación Mexicana de la especialidad, esto para dejar en claro...', '2013-12-30', 'Por: <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/7832-proponen-a-chiapas-como-sede-de-festival-de-gimnasia-\">Nein Gómez</a><br><br>• Rebeca Wolosky, presidenta de la asociación, buscará ver que se tenga el apoyo para ser sedes en 2015<br><br>La Asociación Chiapaneca de Gimnasia sigue creando lazos fuertes con la Federación Mexicana de la especialidad, esto para dejar en claro que es un gremio que quiere ser participativo en los eventos que se hagan con el aval de los federativos.<br><br>Aprovechando que se contó con la presencia de Wolosky Gym en el Festival Nacional de Gimnasia en Querétaro, Rebeca Wolosky, en su calidad de presidenta de asociación, contó con una pequeña reunión con la gente que se encarga de organizar estos festivales y de manera formal, le hicieron la propuesta a Chiapas para organizar el Festival Nacional del año 2015.<br><br>“Como presidenta de asociación tuve la oportunidad de tener acercamiento con la coordinadora técnica de la modalidad, con la gente de federación; consejo directivo y nos hacen la invitación a Chiapas, para que seamos sede de este evento para diciembre de 2015”, fue lo que afirmó en entrevista la presidente de la asociación chiapaneca de la especialidad.<br><br>La asociación vio con buenos ojos la propuesta, por lo cual, iniciarán las gestiones ante las autoridades de regir el deporte en Chiapas, así como con el propio gobernador, para poder contar con el apoyo. De tener el visto bueno de las autoridades, la asociación haría la confirmación como sede en la siguiente asamblea de federación.<br><br>“Ahorita pues lo que deberá continuar es que tanto la Secretaría de Recreación, Juventud y Deporte con Carlos Penagos y el gobernador, Manuel Velasco, nos apoyen y podamos realizar este evento, porque es un gran evento a nivel nacional, para diciembre del 2015”.<br>“De recibir el apoyo de las autoridades, podría hacerse oficial en la siguiente Asamblea General de Gimnasia en el primer trimestre del año”.<br><br>Rebeca Wolosky espera poder contar con este evento en el estado, ya que servirá sobre todo para la promoción de la gimnasia en Chiapas.<br><br>“De poder realizar esto, servirá de mucho, para promover la gimnasia, a todos los clubes que están dentro de la asociación, independientemente de crecer en otros rubros, al igual que darle turismo al estado”.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1494199643_prochise[1].jpg', NULL, NULL),
(80, NULL, 'Wolosky alista participación en Copa AGEPAC 2014', 'Febrero será el mes para que la Academia de Gimnasia Artística Varonil y Femenil ‘Wolisky Gym’, tome su camino de participación en torneos...', '2014-02-10', 'Por: <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/8099-alistan-participacion-en-copa-agepac\">Nein Gómez</a><br><br>• Wolosky Gym asistirá con un atleta en la rama varonil.<br><br>Febrero será el mes para que la Academia de Gimnasia Artística Varonil y Femenil ‘Wolisky Gym’, tome su camino de participación en torneos y en esta ocasión, ya se alistan para estar presentes del 13 al 19 de febrero, en la Copa AGEPAC a realizarse en el gimnasio de la Benemérita Universidad Autónoma de Puebla (BUAP).<br><br>De acuerdo al reporte otorgado por la directora general de esta academia, Rebeca Wolosky, ellos tienen la intención de asistir dentro de la categoría Varonil, con el atletas Luis Fernando Durante García.<br><br> Este atleta a su vez sería acompañado por su entrenado dentro de Wolosky Gym, José Alfonso Esponda Domínguez.<br><br>Cabe señalar que Luis Fernando Durante García se ha convertido en uno de los atletas referentes de Wolosky Gym, ya que en el Campeonato Nacional del año pasado, logró colgarse una medalla de oro por aparatos, presea que lo puso en la historia, como el primer varón en ganar una medalla de campeonato nacional en este deporte.<br><br>Para Rebeca Wolosky es importante que Luis Fernando se mantenga en fogueo, por lo cual, se ha hecho todos los trámites pertinentes, incluyendo el aval de la Asociación Chiapaneca de Gimnasia, para que pueda acudir a este evento en Puebla, pensando que será de grata experiencia para él.<br><br>Así mismo, este será un excelente fogueo previo a su participación en el Campeonato Nacional de este 2014, ya que el reto es muy grande para él, porque tendrá que luchar para igualar como mínimo esa presea dorada del 2013.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1494199816_gymca[1].jpg', NULL, NULL),
(81, NULL, 'Wolosky Gym brindó gran Festival Gimnástico 2014', 'Aprovechando la llegada de la época de la ‘primavera’ en este 2014, la Academia de Gimnasia Artística Varonil y Femenil ‘Wolosky Gym...', '2014-03-25', 'Por: <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/8461-wolosky-gym-brindo-gran-festival-gimnastico-\">Nein Gómez</a><br><br>• El festival se realizó en las instalaciones de esta academia<br><br>Aprovechando la llegada de la época de la ‘primavera’ en este 2014, la Academia de Gimnasia Artística Varonil y Femenil ‘Wolosky Gym’, llevó a cabo su 1er Festival de Gimnasia, esto dentro de la modalidad o programa de la Federación Mexicana de la especialidad, ‘Gimnasia Para Todos’, el cual fue el primero en su tipo dentro de la entidad.<br><br>Dicha actividad se realizó el sábado 22 de marzo dentro de las instalaciones de la Academia ‘Wolosky Gym’, todo siendo supervisado por su directora, Rebeca Wolosky, y grupo de entrenadores y asistentes de la academia.<br><br>Para beneplácito de Wolosky Gym, se contó con una gran concurrencia para que presenciaran el festival, el cual tuvo una duración de 1 hora 45 minutos.<br><br>Cabe señalar que durante ese lapso de tiempo se realizaron diversas muestras coreográficas. Inicialmente se hizo la inauguración del festival, así como la primera exhibición a cargo de los niños más pequeñitos de esta academia, esto exclusivamente con los de la rama varonil.<br><br>Posteriormente se dio paso a la presentación de los grupos gimnásticos que tenían ya preparado su show para todos los presentes a este festival.<br><br>El primero en aparecer fue un grupo infantil denominado ‘Candy Man’, seguido por otro par de grupos de infantiles, ‘Los Capullitos’ y ‘Tecnho Chavo’, quienes por un lapso de 12 minutos mantuvieron entretenidos a todos los presentes.<br><br>Luego fue turno a los grupos invitados a este festival. Primeramente el grupo de la Universidad de Ciencia y Tecnología Descartes, quienes de la mano de la Academia Wolosky, cuentan con actividades de ‘Gimnasia Para Todos’.<br><br>Luego fue turno para ver a un grupo de Capoeira. Acto seguido, fue turno para las femeniles con los grupos ‘Duelo de Divas’ y Single Ladies, para poner punto final con el grupo de Wolosky que fue al Festival Nacional de Gimnasia en Querétaro el año pasado, haciendo su exhibición con el Huapango del Moncayo.<br><br>Al término del festival, Rebeca Wolosky habló sobre este importante acontecimiento, “los festivales de gimnasia ya están a nivel nacional, pero en Chiapas no se había llevado a cabo ninguno, es el primer festival de ‘Gimnasia Para Todos’ que tenemos como institución, con una gran participación por parte de todos los alumnos, de grupos invitados, de los padres de familia y todos los que apoyaron”.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1494200021_wobrigf[1].jpg', NULL, NULL),
(82, NULL, 'Rebeca Wolosky cumplió en su labor como presidenta de asociación', 'En cumplimiento a sus deberes como presidenta de la Asociación Chiapaneca de Gimnasia, Rebeca Wolosky...', '2014-03-28', 'Por: <a href=\"http://www.zonadecampeones.com/v2/selecciona-tu-deporte/mas-deportes/gimnasia/8490-cumplio-en-su-labor-como-presidenta-de-asociacion-\">Nein Gómez</a><br><br>• Rebeca Wolosky estuvo en la Asamblea Nacional de la FMG<br><br>En cumplimiento a sus deberes como presidenta de la Asociación Chiapaneca de Gimnasia, Rebeca Wolosky, acudió este pasado 15 de marzo a la Ciudad de México, para ser parte de la Asamblea Nacional de la Federación Mexicana de la especialidad, donde fue fundamental su presencia, ya que ella será la porta voz de todo lo visto en este evento.<br><br>Tal y como lo dejó constatado en entrevista, Rebeca Wolosky acudió para estar lo más actualizada posible sobre lo que acontece con la gimnasia a nivel nacional, la cual trae varios cambios afirmó.<br><br>“Fue la Asamblea Nacional de la Federación Mexicana de Gimnasia. Hay varios cambios debido a la situación que se vivió con CODEME, CONADE, todos los cambios que ha habido en todos los deportes a nivel nacional”.<br><br>“Ahorita estamos en adecuación de estatutos, nuevas reglas para ciertos detalles dentro de la gimnasia”.<br><br>Dentro de los puntos más significativos y muy interesantes que se tocaron fue que por fin la gimnasia artística se contempla para proceso de Universiada.<br><br>Rebeca Wolosky dijo que aunque hay algunos problemas a nivel nacional para sacar adelante ahora este proceso de Universiada, es un buen avance para seguir teniendo competencia.<br><br>“Nos informaron que este es el primer año en que la gimnasia participa en la Universiada, con algunos peros, en cuanto a las inscripciones para este año por el tiempo que ya se acerca la etapa Nacional. Esta Universiada se va a llevar a cabo durante el mismo periodo del Campeonato Nacional. La Universiada está a partir de los 18 años en los diferentes niveles técnicos”.<br><br>Por su parte, ella confirmó que para este 2014 habrá una participante por parte del estado en el proceso de Universiada, esperando que sea la punta de lanza para que años subsecuentes se pueda trabajar con más gente para este evento.<br><br>“Acá ya tenemos registrada una gimnasta para la Universiada y que es por parte de la UNACH y será la primera participante dentro de este evento, esperando que el próximo año ya tengamos más gente, que está en universidad, trabajando gimnasia y pueda estar incluyéndose, esto en la gimnasia artística, porque la gimnasia aérobica-deportiva ya era de Universiada y este año se incluye la artística femenil y varonil”.<br><br>Afirmó la entrenadora que en próximos días realizará su asamblea estatal, esto para dar los pormenores de todos esos temas que se tocaron dentro de la asamblea nacional, así como dar a conocer los estatutos y nuevas reglas en las que se deberán guiar.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1494200307_rebe[2].jpg', NULL, NULL),
(85, NULL, 'Monumental festejo de Wolosky Gym por su 20 aniversario', 'Emprender un proyecto o trabajo siempre implicará dedicación y retos. Rebeca Wolosky decidió iniciar un sueño en 1997, la Academia de Gimnasia Artística Wolosky Gym, la cual en este 2017...', '2017-05-20', '• Rodeada de la familia, amistades, atletas y ex atletas fue como Rebeca Wolosky festejó<br><br>Por: <a href=\"http://www.zonadecampeones.com/portal/index.php/selecciona-tu-deporte/gimnasia/712-monumental-festejo-de-wolosky-gym-por-su-20-aniversario\">Nein Gómez</a><br><br>Emprender un proyecto o trabajo siempre implicará dedicación y retos. Rebeca Wolosky decidió iniciar un sueño en 1997, la Academia de Gimnasia Artística Wolosky Gym, la cual en este 2017, como si se tratase de otros de sus hijos, ve cumplir 20 años de vida, algo que no podía pasar pasarse desapercibido, así que el festejo tuvo que ser a lo grande.<br><br>La directora del club, junto a todo su equipo de trabajo, preparó durante meses un gran show para amenizar estos 20 años de vida con un monumental festival, en el cual se vieron involucrados, familia, amistades, alumnos actuales del club, pero sobre todo, ex atletas de la academia que decidieron regresar a su segundo hogar y que en diferentes etapas de Wolosky Gym, se pusieron la camisa de esta su segunda familia.<br><br>En esta ocasión las instalaciones del gimnasio se quedaron pequeñas por la recepción de la gente, ya que fue un promedio de 500 personas las que se dieron cita para este festival que estuvo lleno de magia.<br><br>Clubes invitados, escuelas de baile moderno, ballet, bachata; grupos de trabajo como los del Descartes, fueron parte del show en qué consistió este festival. Otra de las etapas fue las demostraciones de muchos atletas de otros deportes, tales como el judo o el taekwondo dieron paso a sus exhibiciones de dichas disciplinas, pero que son parte de Wolosky Gym, ya que complementan sus entrenamientos con la gimnasia.<br><br>Tampoco faltaron los números presentados por los diversos grupos de niños y jóvenes que trabajan actualmente en el gimnasio, desde los niveles de iniciación, hasta las jovencitas que participaron en el reciente Campeonato Regional, así como los atletas de la rama varonil que han participado en Campeonato Nacional.<br><br>Se presentaron todas las modalidades de la gimnasia, recreativa, de iniciación, alto rendimiento, así como la parte artística de ella como lo es la danza aérea, todo enmarcado en el emotivo momento del festejo de los 20 años.<br><br>La cereza en el pastel y que fue de los momentos más satisfactorios para Rebeca Wolosky, fueron los actos presentados por un buen número de ex atletas de la academia, quienes no quisieron quedarse fuera del festejo y a manera de tributo retornaron por unas semanas al trabajo gimnástico para presentar bellos actos que aprendieron a lo largo de su etapa como gimnastas.<br><br>La labor fue titánica, pero tras cumplir con cerca de 3 horas de festival, Rebeca Wolosky seguía sintiendo toda esa emoción por festejar de esta manera 2 décadas de vida, “francamente impresionada, ha sido muy emotivo, 20 años que no han pasado en vano, con reconocimiento de padres de familia de los atletas de la primera generación que se formó en Villaflores, gente que no veía más de 12 a 15 años y que ahora los veo todos hechos unos hombres, incluso ya formando su propia familia, pero que sigue la gimnasia presente en su vida”.<br><br>Para ella fue entrañable ver a sus ex alumnos nuevamente en acción, aunque nunca pensó que una gran cantidad de ellos se unieran para estar con ella en este festejo, “hice una invitación para algunos de mis ex alumnos, pero pensando que sería algo como máximo 10 atletas, pero esto se salió de mis manos y al final se recibió respuesta hasta de 50 ex gimnastas, de los cuales todavía se tuvo detalles y contratiempos por su trabajo y que están fuera de Tuxtla, pero los que se reunieron tuvieron 9 o 10 ensayos, todos en diferentes horarios de la noche acá en el gimnasio, pero hicieron un extraordinario trabajo”.<br><br>Con muchos sentimientos a flor de piel, la directora del club no pudo ocultar su alegría por llegar a estas dos décadas de vida, 20 años de su propia existencia de dedicarle amor y pasión a la academia, pero como ella misma afirma, han valido la pena.<br><br>“No ha sido en vano este trabajo, que la semilla que decidí cosechar la estoy cosechando, muy gratamente, que están conmigo mis hijos, mi respaldo, ellos ya como propietarios del gimnasio, yo sigo como directora y acá seguiremos como siempre, formando más gimnastas chiapanecos”, expuso Rebeca Wolosky.<br><br>Su familia, en especial sus hijos, han sido motor indispensable para la directora del club, por lo cual no podían faltar a esta fecha tan especial. Marcos Wolosky, es el hijo mayor de la profesora Rebeca, quien viajó para este momento y que no desaprovechó externar su felicidad por ver con éxito este proyecto que emprendió su madre hace 20 años.<br><br>“Muy contentos y felices por todo lo que se ha logrado en 20 años y que siga consolidándose como uno de los mejores gimnasios, grande y fuertes de la región. Feliz por mi madre, que es su trabajo, que lo ha hecho bien, reflejado en los niños y las familias que están acá y orgullosos por su ejemplo”.<br><br>Como hijos también sufrieron las ausencias de mamá, pero nada que reprochar, ya que siempre han sabido que ha sido por algo que siempre ha sido parte de la vida de su mamá, “muchas desveladas, llegadas tarde a casa, concentraciones en la CDMX, ir a prácticas, viajes, lo que hace que tenga una vida activa, que la aleja a veces de la familia, pero es por algo en lo que cree, por lo que se divierte y hace que las personas que están inmersas se diviertan”.<br><br>Como hijo igual dejó su mensaje a su madre, palabras que sólo desean lo mejor para ella y el club, “lo mejor de los éxitos, porque esto apenas empieza, son los primeros 20 años, sabe que la amo, aquí y en todo momento, estaremos alejados físicamente por nuestros proyectos, pero sabe que el cariño y el corazón lo reflejamos siempre. Deseo que este gimnasio siga siendo de los mejores de la región y posicionarse como de los mejores a nivel nacional”.<br><br>Este festival fue un éxito rotundo, pero sobre todo un momento para la remembranza de la profesora Rebeca, quien espera seguir sumando años de dedicación, pasión, pero sobre todo, de enseñanza de la gimnasia a la niñes y juventud chiapaneca.', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/YEMz3NPNJ3k\" frameborder=\"0\" allowfullscreen></iframe>', '1495465998_IMG_9914.jpg', NULL, NULL),
(86, NULL, 'Wolosky próximamente en Campeonato Nacional GAV en Guadalajara 2017', 'Les deseamos éxito en su participación a nuestros 3 gimnastas representantes', '2017-05-25', 'Nivel 4 jeshua tardó Perez Nango<br><br>Nivel 5 Joel alonso MeNdOzA Solorzano y<br><br>Nivel 6 Uzias Calvo Ramirez. <br><br>Representantes de CHIAPAS del Club Wolosky <br><br><center><h3><strong>Éxito en su participación</strong></h3></center>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1496002150_b71b1936-23e4-43cd-9649-71a69827b1f1.jpg', NULL, NULL),
