o los atletas de la rama varonil que han participado en Campeonato Nacional.</p>\r\n\r\n<p>Se presentaron todas las modalidades de la gimnasia, recreativa, de iniciaci&oacute;n, alto rendimiento, as&iacute; como la parte art&iacute;stica de ella como lo es la danza a&eacute;rea, todo enmarcado en el emotivo momento del festejo de los 20 a&ntilde;os.</p>\r\n\r\n<p>La cereza en el pastel y que fue de los momentos m&aacute;s satisfactorios para Rebeca Wolosky, fueron los actos presentados por un buen n&uacute;mero de ex atletas de la academia, quienes no quisieron quedarse fuera del festejo y a manera de tributo retornaron por unas semanas al trabajo gimn&aacute;stico para presentar bellos actos que aprendieron a lo largo de su etapa como gimnastas.</p>\r\n\r\n<p>La labor fue tit&aacute;nica, pero tras cumplir con cerca de 3 horas de festival, Rebeca Wolosky segu&iacute;a sintiendo toda esa emoci&oacute;n por festejar de esta manera 2 d&eacute;cadas de vida, &ldquo;francamente impresionada, ha sido muy emotivo, 20 a&ntilde;os que no han pasado en vano, con reconocimiento de padres de familia de los atletas de la primera generaci&oacute;n que se form&oacute; en Villaflores, gente que no ve&iacute;a m&aacute;s de 12 a 15 a&ntilde;os y que ahora los veo todos hechos unos hombres, incluso ya formando su propia familia, pero que sigue la gimnasia presente en su vida&rdquo;.</p>\r\n\r\n<p>Para ella fue entra&ntilde;able ver a sus ex alumnos nuevamente en acci&oacute;n, aunque nunca pens&oacute; que una gran cantidad de ellos se unieran para estar con ella en este festejo, &ldquo;hice una invitaci&oacute;n para algunos de mis ex alumnos, pero pensando que ser&iacute;a algo como m&aacute;ximo 10 atletas, pero esto se sali&oacute; de mis manos y al final se recibi&oacute; respuesta hasta de 50 ex gimnastas, de los cuales todav&iacute;a se tuvo detalles y contratiempos por su trabajo y que est&aacute;n fuera de Tuxtla, pero los que se reunieron tuvieron 9 o 10 ensayos, todos en diferentes horarios de la noche ac&aacute; en el gimnasio, pero hicieron un extraordinario trabajo&rdquo;.</p>\r\n\r\n<p>Con muchos sentimientos a flor de piel, la directora del club no pudo ocultar su alegr&iacute;a por llegar a estas dos d&eacute;cadas de vida, 20 a&ntilde;os de su propia existencia de dedicarle amor y pasi&oacute;n a la academia, pero como ella misma afirma, han valido la pena.</p>\r\n\r\n<p>&ldquo;No ha sido en vano este trabajo, que la semilla que decid&iacute; cosechar la estoy cosechando, muy gratamente, que est&aacute;n conmigo mis hijos, mi respaldo, ellos ya como propietarios del gimnasio, yo sigo como directora y ac&aacute; seguiremos como siempre, formando m&aacute;s gimnastas chiapanecos&rdquo;, expuso Rebeca Wolosky.</p>\r\n\r\n<p>Su familia, en especial sus hijos, han sido motor indispensable para la directora del club, por lo cual no pod&iacute;an faltar a esta fecha tan especial. Marcos Wolosky, es el hijo mayor de la profesora Rebeca, quien viaj&oacute; para este momento y que no desaprovech&oacute; externar su felicidad por ver con &eacute;xito este proyecto que emprendi&oacute; su madre hace 20 a&ntilde;os.</p>\r\n\r\n<p>&ldquo;Muy contentos y felices por todo lo que se ha logrado en 20 a&ntilde;os y que siga consolid&aacute;ndose como uno de los mejores gimnasios, grande y fuertes de la regi&oacute;n. Feliz por mi madre, que es su trabajo, que lo ha hecho bien, reflejado en los ni&ntilde;os y las familias que est&aacute;n ac&aacute; y orgullosos por su ejemplo&rdquo;.</p>\r\n\r\n<p>Como hijos tambi&eacute;n sufrieron las ausencias de mam&aacute;, pero nada que reprochar, ya que siempre han sabido que ha sido por algo que siempre ha sido parte de la vida de su mam&aacute;, &ldquo;muchas desveladas, llegadas tarde a casa, concentraciones en la CDMX, ir a pr&aacute;cticas, viajes, lo que hace que tenga una vida activa, que la aleja a veces de la familia, pero es por algo en lo que cree, por lo que se divierte y hace que las personas que est&aacute;n inmersas se diviertan&rdquo;.</p>\r\n\r\n<p>Como hijo igual dej&oacute; su mensaje a su madre, palabras que s&oacute;lo desean lo mejor para ella y el club, &ldquo;lo mejor de los &eacute;xitos, porque esto apenas empieza, son los primeros 20 a&ntilde;os, sabe que la amo, aqu&iacute; y en todo momento, estaremos alejados&nbsp;f&iacute;sicamente por nuestros proyectos, pero sabe que el cari&ntilde;o y el coraz&oacute;n lo reflejamos siempre. Deseo que este gimnasio siga siendo de los mejores de la regi&oacute;n y posicionarse como de los mejores a nivel nacional&rdquo;.</p>\r\n\r\n<p>Este festival fue un &eacute;xito rotundo, pero sobre todo un momento para la remembranza de la profesora Rebeca, quien espera seguir sumando a&ntilde;os de dedicaci&oacute;n, pasi&oacute;n, pero sobre todo, de ense&ntilde;anza de la gimnasia a la ni&ntilde;es y juventud chiapaneca.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1507160809_image[1]', '2017-10-05 01:46:49', '2017-10-05 19:48:54'),
(91, 5, 'Wolosky regresa del nacional de gimnasia varonil con medalla de bronce', '• Uzías Ramírez Calvo fue el ganador de la medalla, el logro fue en el aparato de barra fija.', '2017-06-06', '<p>Flamante trabajo realiz&oacute; el Club de Gimnasia Wolosky Gym dentro del Campeonato Nacional rama varonil, realizado en la ciudad de Guadalajara, Jalisco del 23 al 28 de mayo para esta categor&iacute;a, donde logran la segunda medalla en la historia para el estado en esta modalidad.</p>\r\n\r\n<p>Uz&iacute;as Ram&iacute;rez Calvo, dentro del Nivel 6, fue el atleta que orgullosamente aport&oacute; esta medalla para Chiapas y a la academia Wolosky Gym, esto dentro del aparato de barra fija, medalla algo inesperada o as&iacute; expuso Rebeca Wolosky, directora del club, no tanto por la capacidad de su atleta, sino porque era su primera nacional.</p>\r\n\r\n<p>&ldquo;Uz&iacute;as fue como novato y fue muy sorpresivo. Si vemos el trabajo y el esmero en sus entrenamientos y pudo meterse a un tercer lugar en la barra fija, esto en una categor&iacute;a bastante peleada y qued&oacute; a nada de lograr otra medalla al ser cuarto en caballo con arzones&rdquo;.</p>\r\n\r\n<p>&ldquo;La incertidumbre era ver qu&eacute; tanto pod&iacute;a pesar los nervios en &eacute;l por ser novato en un nacional, porque en su preparaci&oacute;n y entrenamientos estaban aptos, ya es m&aacute;s el car&aacute;cter de cada uno de ellos los que los saca adelante. La medalla nos sabe como si fuera un oro, la escuela est&aacute; orgullosa por el trabajo realizado&rdquo;.</p>\r\n\r\n<p>La participaci&oacute;n de Wolosky Gym dentro de este nacional incluy&oacute; a otro par de atletas: Jeshua Tadeo P&eacute;rez Nango en el Nivel 4 y Joel Alonso Mendoza Solorzano en el Nivel 5, quienes lograron colocarse en la media de los resultados por aparatos y all around; completando as&iacute; un logro satisfactorio en general para el club.</p>\r\n\r\n<p>&ldquo;Satisfechos con los resultados, segunda medalla en la historia para Chiapas en la gimnasia varonil, dentro de un nacional. Ya ahora estos tres atletas vieron el nivel qu&eacute; hay a nivel nacional, motivados ahora para su preparaci&oacute;n para el 2018 y tener una proyecci&oacute;n de incluso tener una participaci&oacute;n de hasta 10 gimnastas el pr&oacute;ximo a&ntilde;o&rdquo;, expuso Rebeca Wolosky.</p>\r\n\r\n<p>Precisamente, en m&aacute;s detalles de esas pretensiones de crecer en n&uacute;mero de participante aclara: &ldquo;Estamos haciendo modificaciones a nuestro programa anual para esa intenci&oacute;n de llevar un grupo m&aacute;s amplio a competir el pr&oacute;ximo a&ntilde;o, esto ayudar&aacute; al profesor Mois&eacute;s; encargado de la varonil en estos momentos, de que sepa ya con que niveles contamos, as&iacute; como los puntos que necesitamos para estar dentro de las medallas, adem&aacute;s de dar fortaleza a los novatos&rdquo;.</p>\r\n\r\n<p>Con esta medalla de bronce, la directora de Wolosky Gym tiene m&aacute;s que claro que el trabajo debe seguir por el mismo camino y con m&aacute;s fuerza que nunca, para no dejar morir a la gimnasia en Chiapas, mucho menos la rama varonil.</p>\r\n\r\n<p>&ldquo;Somos la &uacute;nica escuela en el estado que trabaja la gimnasia varonil a nivel competitivo y por ello no hay que dejar que se acabe, tanto el deporte como la modalidad de varones en el estado. Nos ha costado trabajo introducir la gimnasia en varones, mucho por la cultura del chiapaneco, pero deben saber que este deporte en ni&ntilde;os desarrolla muchas cualidades en ellos, as&iacute; que hay mucho que desarrollar en Chiapas con esta categor&iacute;a&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1507161812_image[1]', '2017-10-05 02:03:32', '2017-10-06 06:07:21');
INSERT INTO `noticias` (`id`, `user_id`, `titulo`, `resumen`, `fecha`, `texto`, `youtube`, `imagen`, `created_at`, `updated_at`) VALUES
(92, 5, 'Cuentan las horas en Wolosky Gym para su curso de verano', 'El 17 de julio fue el gran inicio de esta increíble experiencia.', '2017-07-11', '<p>La academia de gimnasia art&iacute;stica Wolosky Gym, ya cuenta las horas para dar inicio a su curso de verano 2017, el cual es una ventana para que ni&ntilde;os y ni&ntilde;as puedan acercarse a conocer esta disciplina y a su vez esta escuela pueda contar con futuros prospectos que se puedan unir de manera definitiva a las clases.</p>\r\n\r\n<p>Del 17 de julio al 11 de agosto, Wolosky Gym tendr&aacute; abierta sus puertas de su gimnasio, ubicado en 2&deg; poniente #338, en la colonia Centro de esta ciudad capital, para ni&ntilde;os a partir de los 3 a&ntilde;os de edad y gusten de pasar un verano lleno de muchas actividades que puedan desarrollar sus habilidades, as&iacute; como mejorar su salud con la actividad f&iacute;sica.</p>\r\n\r\n<p>El gimnasio contar&aacute; con un horario de 9 de la ma&ntilde;ana a 1 de la tarde para este curso de verano, donde los ni&ntilde;os y ni&ntilde;as podr&aacute;n escoger entre las siguientes actividades a desarrollar: gimnasia recreativa, acrobacia, gimnasia en telas, pound fit, actividades recreativas, manualidades y taekwondo.</p>\r\n\r\n<p>Todas las actividades tienen en com&uacute;n en poder dar muestra de una gimnasia 100% recreativa y amena, donde el ni&ntilde;o pueda desarrollar sus habilidades psicomotriz, as&iacute; como un desarrollo de integraci&oacute;n social tras la convivencia con m&aacute;s ni&ntilde;os.</p>\r\n\r\n<p>Wolosky Gym cuenta todav&iacute;a con vacantes para este curso. Para mayores informes sobre costo y registro de los ni&ntilde;os, pueden comunicarse al n&uacute;mero de celular: 961 593 68 33. Adem&aacute;s, el club da facilidades en los pagos, ya que los padres de familia pueden hacerlo ya sea por semana, quincenal o pago por el curso completo.</p>\r\n\r\n<p>De esta manera, Wolosky Gym invita a que sean parte de estas actividades y que de estar m&aacute;s interesados, a unirse a este gran club de gimnasia art&iacute;stica en el estado de Chiapas.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1507162152_IMG_3135.JPG', '2017-10-05 02:09:12', '2017-10-06 06:06:40'),
(93, 5, 'Wolosky Gym trabaja al máximo con su curso de verano 2017', 'Son casi un centenar de niños y jóvenes los que están tomando las actividades en el gimnasio', '2017-07-26', '<p>2017 sigue siendo un a&ntilde;o muy productivo para la Academia de Gimnasia Art&iacute;stica Wolosky. Luego de pasar una buena etapa de participaci&oacute;n en los campeonatos regional y nacional (con la rama varonil), ahora toc&oacute; turno enfocar todos sus esfuerzos al curso de verano de este a&ntilde;o, donde est&aacute;n trabajando a su m&aacute;xima capacidad.</p>\r\n\r\n<p>&ldquo;Iniciamos el curso de verano como cada a&ntilde;o desde este mes de julio. Este a&ntilde;o nos hemos esforzado mucho este a&ntilde;o para ofrecer gran variedad de actividades: gimnasia recreativa, gimnasia en telas, pound fit y manualidades, con ni&ntilde;os de 3 a&ntilde;os, hasta los 17 y estamos con muchas sorpresas, incluso es el primer a&ntilde;o que nos hemos visto en la necesidad de cerrar inscripciones&rdquo;, fueron las impresiones en entrevista de la directora de la academia, Rebeca Wolosky.</p>\r\n\r\n<p>Adem&aacute;s agreg&oacute;, &ldquo;ahorita contamos con 89 alumnos y aunque solo asistan clases por semana, quincenal o curso completo, en un 95% siempre estamos con la capacidad para las actividades y eso nos est&aacute; ayudando a la difusi&oacute;n de la gimnasia&rdquo;.</p>\r\n\r\n<p>La gran demanda que ha tenido el curso de verano hizo extender el staff de trabajo, el cual tambi&eacute;n se est&aacute;n retroalimentando al contar con estas actividades en el club, asegura Rebeca Woloksy, &ldquo;somos entre 15 a 16 personas de staff, distribuidos para cada una de las actividades, principalmente estamos con m&aacute;s apoyo en la gimnasia en telas. Los apoyos de gente son gente ex gimnasta, al igual maestros de Licenciatura en Educaci&oacute;n Deportiva de las universidades de ac&aacute; del estado y ac&aacute; est&aacute;n poniendo todo de su parte, as&iacute; como teniendo mucho aprendizaje al trabajar en estas actividades&rdquo;.</p>\r\n\r\n<p>El curso tendr&aacute; su clausura hasta el 11 de agosto. Una vez concluida la fecha, Wolosky Gym espera con ansias que haya una respuesta masiva de la gente de este curso para quedarse de planta en el gimnasio, ya que eso seguir&aacute; proyectando la difusi&oacute;n de este deporte en el estado.</p>\r\n\r\n<p>&ldquo;Nos gustar&iacute;a que fuera el 100%, pero hay que especificar que en este curso teneos hasta gente que viene de Sinaloa, Guadalajara, Tabasco, Veracruz y que en su estancia en Chiapas vienen al curso con sus amiguitos del estado, pero esperamos una buena captaci&oacute;n, porque ahorita s&oacute;lo 10 ni&ntilde;os inscritos ya son alumnos de la academia y el resto es gente nueva, as&iacute; que esperamos entre esos 60 a 70 ni&ntilde;os nuevos puedan quedarse de planta&rdquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1507162535_image[1]', '2017-10-05 02:15:35', '2017-10-06 06:06:14'),
(94, 5, 'Wolosky Gym clausura sus actividades del curso de verano', 'Se contó con una masiva participación durante los números llevados a cabo por el fin del curso', '2017-08-14', '<p>Con mucho colorido, alegr&iacute;a y mucha gimnasia, fue como Wolosky Gym llev&oacute; a cabo la ceremonia de clausura de su curso de verano 2017, el cual fue con una masiva participaci&oacute;n de ni&ntilde;os y j&oacute;venes, durante el mes del curso, as&iacute; como para el programa de actividades del fin del curso.</p>\r\n\r\n<p>Encabezados por la directora del club, Rebeca Wolosky, el grupo de entrenadores y auxiliares del curso de verano, apoyaron a los 90 ni&ntilde;os que se dieron cita para presentar diversos n&uacute;meros, los cuales fueron enfocados en las actividades que estuvieron aprendiendo durante el mes que dur&oacute; las clases en este verano.</p>\r\n\r\n<p>La gimnasia en tela, muestra de pound fit y movimientos de gimnasia b&aacute;sica y recreativa, fueron las principales actividades mostradas a todos los padres de familia presentes en el gimnasio, presentaciones que fueron bien acompa&ntilde;adas de m&uacute;sica.</p>\r\n\r\n<p>En entrevista con la directora del club, hizo menci&oacute;n de la alegr&iacute;a que represent&oacute; para Wolosky Gym contar con un curso de verano hasta el tope en matr&iacute;cula de registros, &ldquo;concluimos con una mega presentaci&oacute;n, en cuanto a cantidad de ni&ntilde;os presentes. En el curso estuvieron 110 ni&ntilde;os y para la clausura estuvieron 90, adem&aacute;s de 24 personas, entre entrenadores y auxiliares, que estuvieron apoyando y que es un gusto ver a esa gente que en su momento se entren&oacute; ahora ayuden y en un futuro puedan formarse como entrenadores&rdquo;.</p>\r\n\r\n<p>&ldquo;Todos los ni&ntilde;os y sus pap&aacute;s estuvieron felices, donde nos comentaron que el curso se alargara, al menos una semana m&aacute;s, lo que habla de lo bien que se la pasaron, pero ahora, se espera que en un porcentaje alto, la mayor&iacute;a se una de manera formal a Wolosky&rdquo;, expuso.</p>\r\n\r\n<p>El curso de verano tambi&eacute;n arroj&oacute; para Wolosky Gym buenas nuevas, ya que han tomado la decisi&oacute;n de abrir formalmente las clases de gimnasia en telas y pound fit, entre otros, &ldquo;con el nuevo curso, que inicia el 21 de agosto, ya implementaremos de planta la gimnasia en telas, clases pound fit, clases por las ma&ntilde;anas para adultos y con ni&ntilde;os que no pueden venir por las tardes por estar en sus escuelas en ese horario. Por la tarde seguimos con las clases normales, con varios pap&aacute;s que ya nos confirmaron que sus hijos entrenar&aacute;n&rdquo;, menciona Rebeca Wolosky.</p>\r\n\r\n<p>Aprovechando la entrevista, la directora del club expone su total agradecimiento a los padres de familia, &ldquo;nunca acabo de agradecer a los padres de familia por prestarnos a sus hijos cada a&ntilde;o, son su tesoro m&aacute;s preciado y que nos lo den a cuidar unas horas durante el verano, es de mucho agradecimiento por la confianza que nos tienen&rdquo;.</p>\r\n\r\n<p>Los ni&ntilde;os y adolescentes del curso de verano concluyeron actividades con la satisfacci&oacute;n de irse a casa con sus trabajos de manualidades hechas durante todo el mes, as&iacute; como recibir peces para poder tenerlos en casa como mascota.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1507162956_image[1]', '2017-10-05 02:22:36', '2017-10-06 06:05:41'),
(95, 5, 'Tocó turno a capacitación de entrenadores de Wolosky Gym', 'Recibieron una ponencia por parte del metodólogo de la SJRyD, Ernesto Herrera', '2017-08-23', '<p>Luego de cumplir con el trabajo del curso de verano, toc&oacute; turno en la Academia de Gimnasia Art&iacute;stica Wolosky Gym, a la capacitaci&oacute;n de sus entrenadores y auxiliares. A manera de ponencia, el metod&oacute;logo de la SJRyD, el cubano Ernesto Herrera Mart&iacute;nez, acudi&oacute; a este club a realizar esta actividad enfocada en metodolog&iacute;a del entrenamiento.</p>\r\n\r\n<p>Herrera Mart&iacute;nez tambi&eacute;n cont&oacute; con el apoyo de Erick Ochoa Ibarias, quien tambi&eacute;n trabaja para el club de patinaje sobre ruedas Cuba Training, para de esta manera apoyar y dar ciertos puntos de vista sobre la planeaci&oacute;n de entrenamiento en la disciplina de gimnasia art&iacute;stica.</p>\r\n\r\n<p>La directora de Wolosky Gym, profesora Rebeca Wolosky, tuvo a bien a solicitar esta ponencia, que tuvo una duraci&oacute;n de cuatro horas, para que su cuerpo de entrenadores y auxiliares, tengan una nueva perspectiva, al igual que ella como directora de la academia, de c&oacute;mo poder preparar todo un plan de entrenamiento, sobre todo con los ni&ntilde;os de edades tempranas.</p>\r\n\r\n<p>Precisamente de los temas tratados, expuso en entrevista el propio entrenador Ernesto Herrera, &ldquo;estamos ac&aacute; aportando un granito de arena a los profesores de gimnasia del estado, en espec&iacute;fico con los de Tuxtla Guti&eacute;rrez, viendo sobre el desarrollo de las capacidades f&iacute;sicas, desarrollo sensitivo en edades tempranas, m&eacute;todos de entrenamiento y planificaci&oacute;n de los mismos&rdquo;.</p>\r\n\r\n<p>Uno de los mensajes claves que dej&oacute; el cubano a los entrenadores fue, &ldquo;Lo importante en todo deporte es ubicar bien todas sus caracter&iacute;sticas, refiri&eacute;ndome esto a las capacidades f&iacute;sicas, psicomotriz e intelectuales del deporte en s&iacute;. Hay que partir de ir para la planificaci&oacute;n y luego potencializar las capacidades del atleta para que d&eacute; resultados en el mismo&rdquo;.</p>\r\n\r\n<p>As&iacute; mismo, Herrera Mart&iacute;nez destac&oacute; a este deporte como punto de partida esencial para que un ni&ntilde;o pueda abrirse camino en una actividad deportiva y luego, si gusta, poder desarrollarse en alguna otra disciplina.</p>\r\n\r\n<p>&ldquo;La gimnasia es un deporte de iniciaci&oacute;n temprana. El desarrollo psicomotriz est&aacute; impl&iacute;cito desde los ni&ntilde;os de 3, 4 o 5 a&ntilde;os, as&iacute; que cualquier ni&ntilde;o que pueda dominar ese aspecto dentro de la gimnasia, luego podr&iacute;a sin problema desarrollarse en alg&uacute;n otro deporte&rdquo;.</p>\r\n\r\n<p>Por &uacute;ltimo, Herrera Mart&iacute;nez agradeci&oacute; la distinci&oacute;n de la invitaci&oacute;n, esperando no sea la &uacute;ltima vez que pueda dar este tipo de ponencias a los entrenadores de gimnasia.</p>\r\n\r\n<p>&ldquo;Es un primer encuentro que ojal&aacute; no sea el &uacute;ltimo, que se pueda manifestar opciones para poder seguir ayudando a muchos m&aacute;s entrenadores a capacitarse&rdquo;.</p>\r\n\r\n<p>Wolosky Gym precisamente ver&aacute; la posibilidad de seguir manteniendo este tipo de capacitaciones a sus entrenadores, as&iacute; como los instructores de otros clubes que gustosamente quieran acercarse para recibir apoyo en metodolog&iacute;a del entrenamiento.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1507163344_image[2]', '2017-10-05 02:29:04', '2017-10-06 06:04:51'),
(96, 5, 'Wolosky Gym en preparativos para chequeo técnico', 'Afinan detalles para realizar esta actividad tanto para la gimnasia varonil como femenil', '2017-09-25', '<p>El club de gimnasia art&iacute;stica Wolosky Gym, se encuentra en preparativos para lo que ser&aacute; su primer chequeo t&eacute;cnico, correspondiente al nuevo ciclo de clases que se reanudaron en este mes de septiembre en las propias instalaciones de la academia.</p>\r\n\r\n<p>La directora del club, Rebeca Wolosky, es quien se encuentra supervisando lo que ser&aacute; este chequeo para este nuevo ciclo escolar de entrenamientos y que estar&aacute; canalizado tanto para los practicantes de la gimnasia varonil como femenil dentro del club.</p>\r\n\r\n<p>El detalle principal que se encuentran ultimando es la fecha de la realizaci&oacute;n del chequeo. De momento tienen dos fechas por elegir, el 29 de septiembre o en su defecto el 7 de octubre.</p>\r\n\r\n<p>En cuanto a las dos modalidades, con la femenil estar&aacute;n evaluando a las ni&ntilde;as que se encuentran en estos momentos en los niveles 1, 2 y 3. Por su parte, con los varones estar&iacute;an siendo examinados los ni&ntilde;os que est&aacute;n en Pre Nivel o iniciaci&oacute;n, as&iacute; como los ni&ntilde;os del Nivel 4.</p>\r\n\r\n<p>En breve estar&aacute;n definiendo la fecha exacta para el chequeo t&eacute;cnico, misma que ser&aacute; comunicada en tiempo y en forma a los alumnos, as&iacute; como los padres de familia de los ni&ntilde;os a ser evaluados. En el club esperan que haya una buena respuesta de los gimnastas que buscar&aacute;n medir sus capacidades y avances que han tenido en este deporte.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1507163482_IMG_0685.JPG', '2017-10-05 02:31:23', '2017-10-06 06:03:59'),
(97, 5, 'Unimos fuerzas la comunidad Wolosky', 'Apoyando a nuestros hermanos de Lazaro Cardenas, Chiapas.', '2017-09-28', '<p>La comunidad Wolosky,&nbsp;unimos todas nuestras fuerzas para hacernos presentes y apoyar a los damnificados del terremoto de este 7 de septiembre, con epicentro Pijijiapan Chiapas. Recordando que esto es una carrera de resistencia no de velocidad, la&nbsp;necesidad persiste y seguira por muchos meses mas, asi que&nbsp;los seguimos invitando a asistir a nuestras instalaciones para poder continuar con este gran compromizo y solidarisarnos&nbsp;con nuestros hermanos damnificados de Chiapas, Oaxaca y Mexico DF; aunque hemos recibido muchas donaciones en estos casos nada sobra, si quieres ser parte de esta gran familia seras bienvenido con tus donaciones de cualquier especie, viveres, ropa y zapato en buen estado, pa&ntilde;ales desechables, juguetes, articulos para bebes o&nbsp;articulos de higiene personal.</p>\r\n\r\n<p>Con agradecimiento especial a todos los alumnos de nuestra institucion por haber puesto su granito de arena en esta gran causa y no olviden que&nbsp;aqui solo nos unen las ganas de querer ayudar.</p>\r\n\r\n<p>&quot;LA UNION HACE A LA FUERZA&quot;</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1507167759_22323431_10155060886061818_1684931945_n.jpg', '2017-10-05 03:42:39', '2017-10-05 19:45:34'),
(98, 5, 'Se realiza 1er chequeo técnico del nuevo ciclo de trabajo.', 'Fueron 64 alumnos los que fueron evaluados, entre femeniles y varoniles.', '2017-10-09', '<p>Con la llegada del nuevo ciclo de trabajo, Wolosky Gym dio paso a su primer cheque t&eacute;cnico para con sus alumnos que se encuentran en este proceso, muchos de ellos de nuevo ingreso.</p>\r\n\r\n<p>Las instalaciones del propio gimnasio fueron el escenario para esta evaluaci&oacute;n, donde llegaron un total de 64 atletas de Pre Nivel, as&iacute; como de Nivel 1, 2, 3 y 4, tanto para la rama varonil y femenil.</p>\r\n\r\n<p>El trabajo fue extenuante, sobre todo para con la categor&iacute;a femenil, donde entre el mismo cuerpo multidisciplinario del club, encabezado por la profesora Rebeca Wolosky, as&iacute; como las entrenadoras con certificado de juezas, lograron sacar adelante y con &eacute;xito el chequeo.</p>\r\n\r\n<p>La propia directora del club, hizo menci&oacute;n en entrevista de la importancia de poder sacar este primer chequeo, adem&aacute;s de ver que esta nueva generaci&oacute;n de alumnos va con buen progreso.</p>\r\n\r\n<p>Por: Nein G&oacute;mez</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/CPjsGLcMqQc\" frameborder=\"0\" gesture=\"media\" allow=\"encrypted-media\" allowfullscreen></iframe>', '1513799578_IMG_4442.jpg', '2017-10-19 01:25:54', '2017-12-20 20:52:59'),
(99, 4, 'Triunfal actuación de Wolosky Gym en Festival Nacional GPT', 'Magna y triunfal resultó ser la actuación de la Academia de Gimnasia Artística Wolosky Gym, dentro del marco del Festival Nacional de Gimnasia Para Todos 2017', '2017-12-01', '<p>&bull; Este 2017 toc&oacute; turno a Quer&eacute;taro ser la sede de este evento</p>\r\n\r\n<p>&bull; Tras su buena participaci&oacute;n, Wolosky Gym recibi&oacute; invitaci&oacute;n para ir a la gimnastrada mundial 2019</p>\r\n\r\n<hr />\r\n<p>Por: <a href=\"http://www.zonadecampeones.com/portal/index.php/selecciona-tu-deporte/gimnasia/1715-triunfal-actuacion-de-wolosky-gym-en-festival-nacional-gpt\">Nein G&oacute;mez</a></p>\r\n\r\n<hr />\r\n<p>Magna y triunfal result&oacute; ser la actuaci&oacute;n de la Academia de Gimnasia Art&iacute;stica Wolosky Gym, dentro del marco del Festival Nacional de Gimnasia Para Todos 2017, celebrado del 30 de noviembre al 3 de diciembre en el Polideportivo de la Universidad An&aacute;huac de la ciudad de Quer&eacute;taro, donde cerca de 50 chiapanecos tomaron parte de este magno evento.</p>\r\n\r\n<p>Junto a la profesora y directora del club, Rebeca Wolosky, Chiapas cont&oacute; con una digna representaci&oacute;n en este festival, el segundo de manera consecutiva al a cual el estado hace acto de presencia, justamente con la academia Wolosky Gym.</p>\r\n\r\n<p>Cabe destacar que este evento reuni&oacute; a m&aacute;s de 600 gimnastas de diversos clubes del pa&iacute;s y en la cual tienen el privilegio de hacer un performance sobre el &aacute;rea de piso, esto dividido en acorde a los niveles de los grupos, que son: Blancos para los de iniciaci&oacute;n, Azules para nivel intermedio y Rojos; que es para todos esos clubes que ya cuentan con atletas de alto rendimiento.</p>\r\n\r\n<h3><a href=\"http://www.zonadecampeones.com/portal/index.php/component/joomgallery/triunfal-actuacion-de-wolosky-gym-en-festival-nacional-gpt\"><img alt=\"icon camera 128\" src=\"http://www.zonadecampeones.com/portal/images/icon-camera-128.png\" />&nbsp;Galer&iacute;a de Fotos</a></h3>\r\n\r\n<p>En esta ocasi&oacute;n, Wolosky Gym se present&oacute; dentro de los grupos azules o intermedios, haciendo una presentaci&oacute;n con su grupo Balam y que consisti&oacute; en una representaci&oacute;n del mundo prehisp&aacute;nico, combinando la danza ceremonial, los colores y la gimnasia art&iacute;stica.</p>\r\n\r\n<p>Esta representaci&oacute;n de Wolosky Gym tuvo como objetivo llevar un poco de la cultura del sureste mexicano y sus ra&iacute;ces; adentr&aacute;ndolos a sus corazones, as&iacute; mismo revivir el esp&iacute;ritu y amor por nuestras ra&iacute;ces de origen.</p>\r\n\r\n<p>Al t&eacute;rmino de la participaci&oacute;n, se reconoci&oacute; el trabajo de cada uno de los grupos que realizaron su presentaci&oacute;n, donde la directora del club Wolosky Gym recibi&oacute; su merecido trofeo por su actuaci&oacute;n con su equipo de gimnastas y entrenadores que estuvieron en el performance.</p>\r\n\r\n<p>Cabe hacer menci&oacute;n, que para benepl&aacute;cito de la gimnasia chiapaneca, Wolosky Gym logr&oacute; reunir los cr&eacute;ditos suficientes con su actuaci&oacute;n para ser invitados de manera formal a unirse a los grupos seleccionados que representar&aacute;n a M&eacute;xico dentro de la Gimnastrada Mundial 2019 a realizarse en Austria.</p>\r\n\r\n<p>El reto de ir a Europa no ser&aacute; nada f&aacute;cil, pero hay mucha ilusi&oacute;n por parte del club de la profesora Rebeca Wolosky en poder encontrar los recursos econ&oacute;micos suficientes para poder acudir dentro de dos a&ntilde;os a esta justa y poner en alto el nombre de M&eacute;xico y Chiapas.</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/zr9sGcgwAFs\" frameborder=\"0\" gesture=\"media\" allow=\"encrypted-media\" allowfullscreen></iframe>', '1513800109_IMG_5736.jpg', '2017-12-20 20:58:43', '2017-12-20 21:01:49'),
(100, 4, 'Gym Wolosky en Copa BUAP-AGEPAC 2018', 'Participaron alrededor de 25 clubes con más de 300 gimnastas en los diferentes niveles y logramos muy buenos resultados.', '2018-03-15', '<p>El pasado jueves 15 de marzo se llevo a cabo la copa de gimnasia BUAP-AGEPAC 2018 en la ciudad de Puebla en el centro de alto rendimiento BUAP donde dos de nuestras gimnastas destacaron en la copa - Carolina Ruiz y Valeria Castellanos.</p> <p>Carolina participo en el nivel 5 de gimnacia donde tuvo un desempe&ntilde;o destacable en los aparatos - Salto de Caballo &amp; Piso/Manos Libres opteniendo 3 lugar en ambos aparatos, mientras que Valeria participo en el nivel 4.</p> <p>Compitieron alrededor de 25 clubes con m&aacute;s de 300 gimnastas en los diferentes niveles y logramos muy buenos resultados.</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/wc3PI9WLJsA\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1522252467_IMG-20180327-WA0038.jpg', '2018-03-28 16:54:27', '2018-04-03 00:20:18'),
(101, 4, 'Wolosky Gym vivió un mágico festival navideño 2017', 'Como todos los años, este club reunió a sus alumnos y familiares para festejar Navidad', '2017-12-18', '<p>&bull; Como todos los a&ntilde;os, este club reuni&oacute; a sus alumnos y familiares para festejar Navidad</p> <hr /> <p>Por: Nein G&oacute;mez</p> <hr /> <p>Con la v&iacute;spera de la Navidad de este 2017, Wolosky Gym no pudo pasar por alto los festejos decembrinos y como lo hacen a&ntilde;o con a&ntilde;o, reuni&oacute; a alumnos y sus familiares para gozar de un m&aacute;gico festival navide&ntilde;o, realizado en las propias instalaciones del club que est&aacute; bajo la tutela de la profesora Rebeca Wolosky.</p> <p>Pese a que se cont&oacute; con un cierre de noviembre y un diciembre cargado de trabajo, el cuerpo multidisciplinario del club se pudo dar a la tarea de lograr sacar este programa del festival navide&ntilde;o, el cual estuvo lleno de mucho color, ambiente familia, pero sobre todo de mucha magia dentro del &aacute;rea de piso del gimnasio, esto con las diversas coreograf&iacute;as y rutinas gimn&aacute;sticas presentadas.</p> <p>Con la rutina de piso de Nivel 5, por parte de Cinthia Carolina S&aacute;nchez Ruiz, la presentaci&oacute;n en anillos de Kevin N&uacute;&ntilde;ez, de Nivel 4 varonil y la rutina de Valeria Castellanos Maza, del Nivel 4, fue como se dio inicio a este festival, presentaciones donde dan a mostrar a estos jovencitos que se alistan para tener un 2018 con retos importantes en los Campeonatos Nacionales Varonil y Femenil.</p> <h3><a href=\"http://www.zonadecampeones.com/portal/index.php/component/joomgallery/wolosky-gym-vivio-un-magico-festival-navideno\"><img alt=\"icon camera 128\" src=\"http://www.zonadecampeones.com/portal/images/icon-camera-128.png\" />&nbsp;Galer&iacute;a de Fotos</a></h3> <p>&nbsp;</p> <p>Drum fit es una de las nuevas modalidades de entrenamiento que us&oacute; el gimnasio Wolosky y tambi&eacute;n decidieron realizar dos presentaciones bajo este formato, donde estuvieron inmiscuidos las alumnas m&aacute;s peques del gimnasio, as&iacute; como las ni&ntilde;as de edad m&aacute;s avanzada.</p> <p>La cereza en el pastel en este festival navide&ntilde;o del 2017 fue concluir con la puesta en escena de la rutina que recientemente present&oacute; el club con el grupo de gimnastas que acudieron al Festival Nacional de Gimnasia Para Todos en la ciudad de Quer&eacute;taro.</p> <p>Este festival fue la oportunidad perfecta para dar a mostrar el gran talento de todos los participantes en esta rutina que tuvo como objetivo el dar un panorama de la cultura prehisp&aacute;nica que predomin&oacute; en la zona sureste en el pa&iacute;s, adem&aacute;s de dar a conocer a los presentes de la buena impresi&oacute;n que causaron en el nacional y que ahora le abre las puertas al gimnasio de participar en la Gimnastrada Mundial 2019 a realizarse en Austria.</p> <p>El &uacute;ltimo n&uacute;mero fue una coreograf&iacute;a grupal con todos los alumnos y profesores presentes en el festival, para as&iacute; comenzar a festejar la Navidad que est&aacute; pr&oacute;xima a llegar. Una vez concluido todo el programa del festival, se dio paso a la posada del club, que estuvo lleno de pi&ntilde;atas y mucha fraternidad entre padres, alumnos y profesores.</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/n5FCqtbrxDo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1522253433__DSC4682.jpg', '2018-03-28 17:10:33', '2018-03-28 17:10:33'),
(102, 4, 'Rebeca Wolosky acudió a capacitación', 'Participó en Curso de Fundamentos Gimnásticos FIG 2018', '2018-03-04', '<p>&bull; Particip&oacute; en Curso de Fundamentos Gimn&aacute;sticos FIG 2018</p> <hr /> <p>Por: Nein G&oacute;mez</p> <hr /> <p>Febrero marc&oacute; una grata experiencia para la directora del Club Gimnasia Art&iacute;stica Wolosky Gym, Rebeca Wolosky, esto luego de ir a la Ciudad M&eacute;xico, del 18 al 25 de dicho mes, para ser parte del Curso de Fundamentos Gimn&aacute;sticos FIG 2018.</p> <p>El Centro Deportivo Ol&iacute;mpico Mexicano fue la sede de dicha actividad en la cual se dieron cita entrenadores desde el sur al norte del pa&iacute;s, los cuales fueron elegidos minuciosamente y como dice textualmente la profesora Rebeca, fue un benepl&aacute;cito para ella ser una de las elegidas.</p> <p>&ldquo;Muy grato como experiencia y muy afortunada, porque fui una de las 30 elegidas en el pa&iacute;s para participar en este primer curso de fundamentos que se da a nivel mundial y fue ac&aacute; en M&eacute;xico. Esto fue ver fundamentos y la base real de la gimnasia, no s&oacute;lo de art&iacute;stico, sino tambi&eacute;n de r&iacute;tmica, a&eacute;robica de grupo, esa base donde los ni&ntilde;os realmente aprenden los fundamentos de la gimnasia ya s&iacute; desarrollar cada una de las modalidades que se imparten en los gimnasios&rdquo;, expuso.</p> <h3><a href=\"http://www.zonadecampeones.com/portal/index.php/component/joomgallery/rebeca-wolosky-acudio-a-capacitacion\"><img alt=\"icon camera 128\" src=\"http://www.zonadecampeones.com/portal/images/icon-camera-128.png\" />&nbsp;Galer&iacute;a de Fotos</a></h3> <p>&nbsp;</p> <p>Para este curso, se cont&oacute; con la presencia de los siguientes ponentes internacionales, Rogerio Valerio; vicepresidente del Comit&eacute; de Gimnasia para Todos de la FIG, Marco Bortoleto; Miembro del Comit&eacute; de Gimnasia para Todos de la FIG y Carmen G&oacute;mez; Experta FIG de Gimnasia Para Todos.</p> <p>La directora del Club Wolosky expuso que fue muy gratificante este curso, ya que dicho programa tambi&eacute;n tiene contemplado ser usado para varios sectores de la sociedad, estos fundamentos tambi&eacute;n va enfocado a ni&ntilde;os con capacidades especiales, es decir, con problemas de motricidad, s&iacute;ndrome de down, ni&ntilde;os con alguna problem&aacute;tica de este tipo, quienes deben ser incluidos dentro de la gimnasia, as&iacute; como tambi&eacute;n incluir a las personas de la tercera edad, que es algo que Wolosky Gym quiere recuperar, un programa que implementamos para estos sectores de la sociedad ya mencionados para integrarlos a hacer gimnasias con base en sus fundamentos&rdquo;.</p> <p>Para la profesora, el curso tambi&eacute;n tuvo relevancia, ya que comenz&oacute; con su nuevo proceso de actualizaci&oacute;n de su nuevo SICCED, &ldquo;estos nuevos cursos, en gimnasia, apenas se est&aacute;n implementando, porque a nivel nacional se van a eliminar los programas SICCED e implementar&aacute;n uno nuevo que hay que volver a tomar para cursar, esto para estar actualizados. Ser&aacute;n 5 nuevos m&oacute;dulos y este curso o programa internacional de fundamentos incluye los primeros 3 m&oacute;dulos&rdquo;, dijo.</p> <p>Finalmente, ya como an&eacute;cdota y buen recuerdo, la entrenadora del Club Wolosky expuso que dentro del curso pas&oacute; su cumplea&ntilde;os, donde tanto ponentes como entrenadores que tomaron el curso la festejaron.</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/cwObZ_1Drvc\" frameborder=\"0\" allowfullscreen></iframe>', '1522253549_1492392816_rebe[1].jpg', '2018-03-28 17:12:29', '2018-03-28 17:12:29'),
(103, 1, 'Wolosky con clases doblemente especiales 2018', 'Wolosky abrió horario para niños con TDA y Asperger', '2018-04-21', '<p>Por: Nein G&oacute;mez</p>\r\n\r\n<hr />\r\n<p>Wolosky Gym quiere mostrar su lado humanitario desde su trinchera, por ello, a partir de este mes de abril han comenzado a retomar y desarrollar nuevamente el proyecto de brindar clases para ni&ntilde;os con padecimiento de Trastorno de D&eacute;ficit de Atenci&oacute;n o TDA, as&iacute; como de S&iacute;ndrome de Asperger.</p>\r\n\r\n<p>Es desde este 23 de abril cuando arranquen de manera formal las clases, en el gimnasio ya empezaron a realizar algunas clases a manera de prueba para dar inicio formal al programa de trabajo que tendr&aacute; como horarios de lunes a viernes de 3 a 4 de la tarde.</p>\r\n\r\n<p>La directora del gimnasio, Rebeca Wolosky, expuso en entrevista que este proyecto arranca exclusivamente como una retribuci&oacute;n de ellos a la sociedad, &ldquo;este grupo se da como un servicio social o apoya a la comunidad. Vamos a estar trabajando con varios ni&ntilde;os. Desde el 23 de abril las clases ser&aacute;n formales, ya tenemos a 9 ni&ntilde;os inscritos&rdquo;, menciona.</p>\r\n\r\n<h3><a href=\"http://www.zonadecampeones.com/portal/index.php/component/joomgallery/wolosky-con-clases-doblemente-especiales\"><img alt=\"icon camera 128\" src=\"http://www.zonadecampeones.com/portal/images/icon-camera-128.png\" />&nbsp;Galer&iacute;a de Fotos</a></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>El inicio de estas clases genera una motivaci&oacute;n doble para la directora del club, debido a que es algo que ya anhelaba volver a retomar, &ldquo;esto es dar continuidad a un trabajo que ya hab&iacute;amos hecho hace unos 4 o 5 a&ntilde;os atr&aacute;s y que suspendimos por diversos temas&rdquo;, dijo Rebeca Wolosky.</p>\r\n\r\n<p>De momento, el gimnasio mantiene en pie su invitaci&oacute;n para aquellos padres que est&eacute;n interesados y tienen hijos con casos de TDA y Asperger, a que inscriban a sus hijos a aprender gimnasia y vean que es una herramienta para poder ayudar a sus ni&ntilde;os.</p>\r\n\r\n<p>Para las inscripciones, pueden hacerlas directamente en la direcci&oacute;n del club, que es en la 2&ordf; Poniente #338 entre 2&ordf; y 3&ordf; Norte. &Uacute;nicamente en el caso para estas clases, la directora explica que debe haber una previa cita, &ldquo;est&aacute;n invitados para que puedan tomar la clase muestra, aunque debe haber previa cita, para ver primero que padece el ni&ntilde;o y as&iacute; poder programar las clases para ellos&rdquo;.</p>\r\n\r\n<p>Es de esta manera que Wolosky Gym quiere ser un establecimiento socialmente responsable, esto aportando a la promoci&oacute;n del deporte, en este caso de la gimnasia, a un sector de ni&ntilde;os que tienen todas las capacidades para desarrollarse en este deporte.</p>\r\n\r\n<h3><a href=\"http://www.zonadecampeones.com/portal/index.php/component/joomgallery/wolosky-con-clases-doblemente-especiales\"><img alt=\"icon camera 128\" src=\"http://www.zonadecampeones.com/portal/images/icon-camera-128.png\" />&nbsp;Galer&iacute;a de Fotos</a></h3>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1524670778_14woloskycnclassoblemntespcials[1].jpg', '2018-04-25 17:39:38', '2018-04-25 17:39:38'),
(104, 1, 'Wolosky Gym retomará programa de clases para adultos 2018', 'Los programas de trabajo en el Club de Gimnasia Artística Wolosky Gym siguen creciendo. La directora de este gimnasio, Rebeca Wolosky, dio a conocer', '2018-04-25', '<p>Por: Nein G&oacute;mez</p>\r\n\r\n<hr />\r\n<p>Los programas de trabajo en el Club de Gimnasia Art&iacute;stica Wolosky Gym siguen creciendo. La directora de este gimnasio, Rebeca Wolosky, dio a conocer que han decidido retomar las clases con adultos y personas de la tercera edad, programa que tiene muy motivado a todo el equipo de trabajo del club.</p>\r\n\r\n<p>El grupo de adultos y tercera edad tendr&aacute;, de momento, sus clases de lunes a viernes, en horario de 10 a 11 de la ma&ntilde;ana; donde quien guste llegar por primera vez a practicar a Wolosky, podr&aacute; contar con una clase muestra gratuita.</p>\r\n\r\n<p>Todos los interesados pueden acudir directamente a las instalaciones del gimnasio, ubicado en 2&ordf; Poniente #338 entre 2&ordf; y 3&ordf; Norte de esta ciudad capital, donde con gusto ser&aacute;n atendidos por el personal para cualquier duda sobre estas clases.</p>\r\n\r\n<h3><a href=\"http://www.zonadecampeones.com/portal/index.php/component/joomgallery/wolosky-gym-retomara-programa-de-clases-para-adultos\"><img alt=\"icon camera 128\" src=\"http://www.zonadecampeones.com/portal/images/icon-camera-128.png\" />&nbsp;Galer&iacute;a de Fotos</a></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>En entrevista, Rebeca Wolosky menciona que para ellos estas clases es un renacimiento a un proyecto que ten&iacute;an ya hace tiempo, pero que ahora tambi&eacute;n nace m&aacute;s por una cuesti&oacute;n de devolverle algo a este sector de la sociedad tuxtleca.</p>\r\n\r\n<p>&ldquo;En los 20 a&ntilde;os que ha estado abierto el gimnasio Wolosky, ha tenido la oportunidad de recibir a tantos ni&ntilde;os y j&oacute;venes, los que nos ha dejado gratas satisfacciones, por lo que ahora lo que queremos es retribuir un poco a la sociedad con estas clases para adultos especiales y grupos para adultos y de tercera edad&rdquo;, dijo la directora del club.</p>\r\n\r\n<p>Wolosky Gym tampoco olvida la parte de salud, dado a que promueven un deporte como lo es la gimnasia, as&iacute; que es otro de los objetivos primordiales que persiguen con las clases para adultos, &ldquo;todo esto es con el objetivo de mejorar la condici&oacute;n f&iacute;sica y la salud de las personas adultas y tercera edad, as&iacute; como proveerles de una mejor calidad de vida a la edad que tienen y poco a poco vamos creciendo con este grupo&rdquo;, menciona.</p>\r\n\r\n<p>Las clases ya est&aacute;n activas, por lo cual, el gimnasio invita a todo el sector adulto y de tercera edad de la ciudad a que se den una oportunidad de mejorar su calidad de vida a trav&eacute;s de la gimnasia, esto de una manera recreativa, punto importante que promueve el programa gimnasia para todos de la federaci&oacute;n mexicana de la especialidad.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1526086129_image[1]', '2018-05-12 02:48:49', '2018-05-12 02:48:49'),
(105, 1, 'Wolosky demostró su destreza en el Día del Niño 2018', 'Los festejos por el Día del Niño no pasaron desapercibidos por la Academia de Gimnasia Artística Wolosky Gym, para ello, el cuerpo de entrenadores y su directora general', '2018-05-02', '<p>Por: Nein G&oacute;mez</p>\r\n\r\n<hr />\r\n<p>Los festejos por el D&iacute;a del Ni&ntilde;o no pasaron desapercibidos por la Academia de Gimnasia Art&iacute;stica Wolosky Gym, para ello, el cuerpo de entrenadores y su directora general, Rebeca Wolosky, prepararon en todos los horarios con que cuentan para sus clases, con unas actividades muy especiales para conmemorar este d&iacute;a tan especial.</p>\r\n\r\n<p>Para tener un ameno 30 de abril, Wolosky Gym prepar&oacute; retos a todos a sus alumnos, pruebas al estilo &lsquo;Exatl&oacute;n&rsquo;, donde cada uno de los peque&ntilde;ines del gimnasio; tuvieran sus clases y actividades de destreza de una manera diferente y peculiar en esta ocasi&oacute;n.</p>\r\n\r\n<p>Entre juegos de rompecabezas, fuerza con lasos, agilidad y de pensamiento r&aacute;pido, se pasaron las horas de diversi&oacute;n por el D&iacute;a del Ni&ntilde;o en el gimnasio, donde tanto padres de familia se divirtieron por ver c&oacute;mo sus hijos lograban cada reto a superar en la clase.</p>\r\n\r\n<h3><a href=\"http://www.zonadecampeones.com/portal/index.php/component/joomgallery/demostraron-su-destreza-en-el-dia-del-nino\"><img alt=\"icon camera 128\" src=\"http://www.zonadecampeones.com/portal/images/icon-camera-128.png\" />&nbsp;Galer&iacute;a de Fotos</a></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Para la directora del club, Rebeca Wolosky, pese a ser algo sencillo, no quiso dejar desapercibido este d&iacute;a, ya que para el club son los ni&ntilde;os la fuente de su trabajo y quienes se deben d&iacute;a a d&iacute;a para formarlos con una disciplina deportiva como lo es la gimnasia art&iacute;stica.</p>\r\n\r\n<p>&ldquo;Nuestros ni&ntilde;os son lo m&aacute;s importante de Wolosky, quienes nos dan vida y disfrutamos de desarrollar las cualidades de cada uno&rdquo;, expuso la profesora.</p>\r\n\r\n<p>Al t&eacute;rmino de estas clases especiales, se hizo entrega de premios a todos los participantes, as&iacute; como hacer hincapi&eacute; en quienes resultaron ser los mejores durante todo el rally, as&iacute; como tambi&eacute;n, gozaron de dulces como regalos.</p>\r\n\r\n<p>La etapa final de este festejo por el D&iacute;a del Ni&ntilde;o fue decorar una de las paredes del gimnasio con las manos de todos los ni&ntilde;os del club, esto dejando sus huellas con pintura.</p>\r\n\r\n<h3><a href=\"http://www.zonadecampeones.com/portal/index.php/component/joomgallery/demostraron-su-destreza-en-el-dia-del-nino\"><img alt=\"icon camera 128\" src=\"http://www.zonadecampeones.com/portal/images/icon-camera-128.png\" />&nbsp;Galer&iacute;a de Fotos</a></h3>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1526086372_image[1]', '2018-05-12 02:52:53', '2018-05-12 02:52:53'),
(106, 1, 'Wolosky Gym aporta su granito de arena a Cruz Verde 2018', 'La Academia de Gimnasia Artística Wolosky Gym sigue con sus trabajos altruistas, esa labor desinteresada que tiene el club para retribuir un poco de lo que la gente que los vio nacer y crecer como organizació', '2018-05-09', '<p>Por: Nein G&oacute;mez</p>\r\n\r\n<hr />\r\n<p>La Academia de Gimnasia Art&iacute;stica Wolosky Gym sigue con sus trabajos altruistas, esa labor desinteresada que tiene el club para retribuir un poco de lo que la gente que los vio nacer y crecer como organizaci&oacute;n y esta vez toc&oacute; turno al municipio donde se gest&oacute; este gimnasio, Villaflores.</p>\r\n\r\n<p>A trav&eacute;s de la organizaci&oacute;n Cruz Verde, Wolosky Gym decidi&oacute; ayudar al municipio de Villaflores, esto con la donaci&oacute;n de playeras a la gente que integra esta agrupaci&oacute;n en la zona frailesca, quienes tambi&eacute;n trabajan para brindar su ayuda a la ciudadan&iacute;a de esta zona socioecon&oacute;mica del estado.</p>\r\n\r\n<p>Nos es muy grato poder apoyar a este grupo con esa labor tan loable y altruista para la sociedad chiapaneca y en Villaflores, que es donde se fund&oacute; la ahora Asociaci&oacute;n Wolosky Centro de Desarrollo e Iniciaci&oacute;n Deportiva A.C.&rdquo;, fueron las palabras en entrevista de la directora del club, Rebeca Wolosky.</p>\r\n\r\n<h3><a href=\"http://www.zonadecampeones.com/portal/index.php/component/joomgallery/wolosky-gym-aporta-su-granito-de-arena-a-cruz-verde\"><img alt=\"icon camera 128\" src=\"http://www.zonadecampeones.com/portal/images/icon-camera-128.png\" />&nbsp;Galer&iacute;a de Fotos</a></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>El club hizo esta donaci&oacute;n gracias a la conexi&oacute;n que hay entre ellos y quienes est&aacute;n trabajando en Cruz Verde, ya que el ahora comandante de esta agrupaci&oacute;n, Itai Mac&iacute;as Hern&aacute;ndez, fue uno de los primeros alumnos de Wolosky Gym, cuando este club se ubicaba en Villaflores, esto ya hace 20 a&ntilde;os atr&aacute;s.</p>\r\n\r\n<p>Para recibir estas playeras, acudieron a las instalaciones de Wolosky Gym, ubicadas ac&aacute; en la capital chiapaneca, Jorge Castro Mart&iacute;nez; delegado de Cruz Verde Villaflores, Itai Mac&iacute;as Hern&aacute;ndez; comandante de Cruz Verde, as&iacute; como Carmen Alfaro Cham&eacute; y Deysi Rodr&iacute;guez L&oacute;pez.</p>\r\n\r\n<p>En entrevista, el delegado de Cruz Verde, Jorge Castro Mart&iacute;nez, menciona, &ldquo;estamos muy agradecidos por esta donaci&oacute;n, ya que muchas veces nosotros carecemos de este tipo de cosas y mientras haya gente como usted se va progresando&rdquo;.</p>\r\n\r\n<p>Por su parte, la esposa del delegado y tambi&eacute;n integrante de la Cruz Verde, Carmen Alfaro, dijo, &ldquo;el contacto fue con Itai, &eacute;l nos platic&oacute; de usted (Rebeca Wolosky) y para hacer ese acercamiento para ver si pod&iacute;a hacer la donaci&oacute;n de las playeras a la Cruz Verde y es muy grato saber que existen personas como usted para hacer este tipo de causas&rdquo;.</p>\r\n\r\n<p>Finalmente, el club y esta agrupaci&oacute;n quedaron de estrechar a&uacute;n m&aacute;s los lazos de trabajo, por lo cual, Wolosky Gym, espera muy pronto estar nuevamente por Villaflores para ofrecer algunas exhibiciones que sirvan como eventos de promoci&oacute;n de la gimnasia por la zona y a su vez para percibir donaciones para la Cruz Verde.</p>\r\n\r\n<h3><a href=\"http://www.zonadecampeones.com/portal/index.php/component/joomgallery/wolosky-gym-aporta-su-granito-de-arena-a-cruz-verde\"><img alt=\"icon camera 128\" src=\"http://www.zonadecampeones.com/portal/images/icon-camera-128.png\" />&nbsp;Galer&iacute;a de Fotos</a></h3>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1526086486_image[1]', '2018-05-12 02:54:46', '2018-05-12 02:54:46'),
(108, 1, '21 años y contando para Wolosky Gym', 'Con mucha alegría, sonrisas, bailes y gran colorido, fue como el Club de Gimnasia Artística Wolosky Gym llevó a cabo su festival por su 21 aniversario, esto dentro de sus mismas instalaciones y con su propio equipo de trabajo y alumnos; quienes se encargaron de hacer un gran show sobre el área de piso del club.', '2018-06-15', '<p>&bull; Este club de gimnasia festej&oacute; a lo grande un aniversario m&aacute;s</p>\r\n\r\n<hr />\r\n<p>Por: Nein G&oacute;mez</p>\r\n\r\n<hr />\r\n<p>Con mucha alegr&iacute;a, sonrisas, bailes y gran colorido, fue como el Club de Gimnasia Art&iacute;stica Wolosky Gym llev&oacute; a cabo su festival por su 21 aniversario, esto dentro de sus mismas instalaciones y con su propio equipo de trabajo y alumnos; quienes se encargaron de hacer un gran show sobre el &aacute;rea de piso del club.</p>\r\n\r\n<p>Aunque el calor del ambiente se dej&oacute; sentir dentro del gimnasio, este se mitig&oacute; al final por el propio calor humano que se mostr&oacute; durante las casi dos horas que dur&oacute; este show que cont&oacute; un gran sin fin de presentaciones de ni&ntilde;os hasta adultos mayores, esto aplicando las mismas actividades diarias que aprenden en el club.</p>\r\n\r\n<p>La profesora Rebeca Wolosky fue la gran maestra de ceremonias para este festival, el cual cont&oacute; con puestas en escenas de las clases de Drum Fit, gimnasia en tela, gimnasia competitiva y tambi&eacute;n del programa gimnasia para todos; haciendo hincapi&eacute; en la gimnasia recreativa.</p>\r\n\r\n<p>Una vez terminado todo el show, se platic&oacute; con la directora del club, profesora Rebeca Wolosky, quien mostr&oacute; su alegr&iacute;a por ver c&oacute;mo a&ntilde;o con a&ntilde;o hay algo nuevo que festejar en su club, &ldquo;ya son 21 a&ntilde;os, la verdad que fue un gran evento, al igual al del a&ntilde;o pasado, con mucha gente, rebasando m&aacute;s de los 100 gimnastas participando. Tenemos mucha gente nueva, hijos ya de ex alumnos y para nosotros eso es de mucho gusto que esa semilla que sembramos 21 a&ntilde;os atr&aacute;s ya contamos con esa segunda generaci&oacute;n para futuras competencias&rdquo;.</p>\r\n\r\n<p>Tambi&eacute;n destac&oacute; esa incursi&oacute;n que ya hacen sus alumnos de la clase de adultos mayores, &ldquo;afortunadamente tenemos el grupo de adultos y adultos mayores, hubo una abuela que particip&oacute;, que gustosamente particip&oacute;, que motiva a los dem&aacute;s e incentiva a que m&aacute;s gente se aventure a entrenar, para mantenerse sanos, pese a ser de tercera edad, dijo.</p>\r\n\r\n<p>La labor para montar un festival de este tipo con m&aacute;s de 100 personas es tit&aacute;nica, pero es algo que no ser&iacute;a posible sin la labor de todo el equipo de trabajo del club, algo que agradece enormemente la profesora, &ldquo;me dejan sin palabras para expresar de ese gran apoyo que tengo de mis entrenadores y todo el equipo Wolosky. Hay gente joven que se sigue interesando para capacitarse en gimnasia y tanta gente que ha pisado alg&uacute;n espacio donde hemos estado s&oacute;lo les digo que lo que aprendieron aqu&iacute; puedan desarrollarla en su vida cotidiana, que esa es una misi&oacute;n para nosotros, formar personas de bien y de gran calidad de vida&rdquo;.</p>\r\n\r\n<p>Finalmente, la cereza en el pastel del festival fue concretar al grupo para la Gimnastrada Mundial de Austria, un evento so&ntilde;ado para el club y el cual har&aacute;n realidad.</p>\r\n\r\n<p>&ldquo;Contentos igual porque este a&ntilde;o se pudo conjuntar el equipo para la Gimnastrada Mundial que ser&aacute; en Austria, un grupo de 20 personas entre atletas y&nbsp;sus acompa&ntilde;antes. Queremos hacer una presentaci&oacute;n con un mix chiapaneco y poder representar algo folcl&oacute;rico del estado y el pa&iacute;s y hacer un buen papel en otro continente&rdquo;, menciona la profesora Rebeca.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1529532620_IMG_8109.jpg', '2018-06-21 00:23:46', '2018-06-21 00:23:46'),
(109, 1, '1 Día del Curso De Verano Wolosky 2018', 'Como cada año, el gimnasio wolosky imparte el curso de verano Wolosky donde niños de diferentes edades asisten a divertirse y aprender de distintas', '2018-07-16', '<p>Abrimos las puertas del Gimnasio Wolosky al curso de Verano 2018 a las 9:00 del d&iacute;a, muchos ni&ntilde;os y ni&ntilde;as de todas las edades asistieron con muchos entusiasmo. Se divieron en grupos de acuerdo a sus edades para hacer equipos durante lo largo de todo el curso, algunos ni&ntilde;os mas habiles que otros mostraron su destreza en las manualidades, gimnasia y drumfit</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/ymxrSpKGYeE\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1531869227_IMG_8289.jpg', '2018-07-18 01:13:47', '2018-07-18 01:20:12');
INSERT INTO `noticias` (`id`, `user_id`, `titulo`, `resumen`, `fecha`, `texto`, `youtube`, `imagen`, `created_at`, `updated_at`) VALUES
(111, 1, 'Wolosky Gym puso a prueba a sus gimnastas', 'Previo a la Semana Santa, el Club de Gimnasia Wolosky Gym preparó su chequeo técnico para todos sus miembros de la rama varonil y femenil; de todos los niveles con los que cuentan, así mismo, tuvo el gusto de recibir a clubes de otros estados, así como de la propia entidad, quienes también examinaron a sus atletas.', '2019-04-13', '<p>&bull; Tanto la rama varonil y femenil realizaron chequeo t&eacute;cnico</p>\r\n\r\n<p>&bull; El club de la profesora Rebeca Wolosky cont&oacute; con visita de otros gimnasios</p>\r\n\r\n<hr />\r\n<p>Por: Nein G&oacute;mez</p>\r\n\r\n<hr />\r\n<p>Previo a la Semana Santa, el Club de Gimnasia Wolosky Gym prepar&oacute; su chequeo t&eacute;cnico para todos sus miembros de la rama varonil y femenil; de todos los niveles con los que cuentan, as&iacute; mismo, tuvo el gusto de recibir a clubes de otros estados, as&iacute; como de la propia entidad, quienes tambi&eacute;n examinaron a sus atletas.</p>\r\n\r\n<p>Las propias instalaciones del club que est&aacute; bajo la tutela de la profesora Rebeca Wolosky fue la sede del chequeo, esto para casi el centenar de gimnastas. Entre los clubes visitantes a Tuxtla Guti&eacute;rrez estuvieron, La Choca de Tabasco, El Carmen Gymnastics y ni&ntilde;as de Tapachula.</p>\r\n\r\n<p>Tal y como lo coment&oacute; en entrevista la profesora Rebeca, el chequeo tuvo 3 bloques, comenzando con Pre Nivel de Femenil y todos los niveles de Varonil, luego fue turno para Niveles 2, 4 y 5, para posteriormente culminar con los Niveles 1 y 3 de Femenil.</p>\r\n\r\n<h3><a href=\"https://www.zonadecampeones.com/portal/index.php/component/joomgallery/wolosky-gym-puso-a-prueba-a-sus-gimnastas\"><img alt=\"icon camera 128\" src=\"https://www.zonadecampeones.com/portal/images/icon-camera-128.png\" />&nbsp;Galer&iacute;a de Fotos</a></h3>\r\n\r\n<p>&ldquo;Nos da mucho gusto recibir a otros estados, igual grupos como de Tapachula, igual de El Carmen Gymnastics y del Club La Choca de Tabasco. Son 3 rondas las que se han realizado y haciendo crecer los grupos para los pr&oacute;ximos eventos que son el Nacional Varonil en junio y el Campeonato Regional que ser&aacute; en agosto&rdquo;, expuso la profesora Rebeca.</p>\r\n\r\n<p>Para el club es de vital importancia los chequeos t&eacute;cnicos, sobre todo con las ni&ntilde;as de iniciaci&oacute;n, ya que permite observar sobre qu&eacute; objetivos trabajar con cada uno de los ni&ntilde;os y ni&ntilde;as, &ldquo;es importante para los grupos de iniciaci&oacute;n, grupos de 4, 5 y 6 a&ntilde;os y este tipo de actividades les ayuda, porque se van premiados, ayuda a su crecimiento. Nuestro objetivo es seguir motivando a esos grupos, que si bien no todas sean de alto rendimiento, si poder desarrollarlas para la gimnasia recreativa&rdquo;, dijo la directora del club.</p>\r\n\r\n<p>En cuanto a la visita de los dem&aacute;s clubes, explica que siempre es complicado poder tener fogueo, &ldquo;fue de mucho esfuerzo. Ya desde hace tiempo ven&iacute;amos haciendo la invitaci&oacute;n, porque siempre har&aacute; falta fogueo, se procur&oacute; que fuera en estas fechas de vacaciones y as&iacute; poder traer a la gente&rdquo;.</p>\r\n\r\n<p>Tambi&eacute;n para Wolosky Gym este chequeo fue una ventana importante de oportunidad para sus entrenadores y jueces para poder seguir ganando experiencia sin que tengan que salir del estado, &ldquo;igual a veces cuesta el poder foguearse en ese &aacute;mbito, en cursos que no se pueden estar por los viajes, pero esto ayuda a los jueces tambi&eacute;n para poder desarrollarse y ver el desempe&ntilde;o de c&oacute;mo evaluar a las ni&ntilde;as, as&iacute; que esto ayuda a los jueces&rdquo;.</p>\r\n\r\n<p>De esta manera, cumplieron con esta &uacute;ltima actividad previa a los d&iacute;as de asueto que tendr&aacute;n por Semana Santa y posteriormente reanudar trabajos y enfocarse en los siguientes retos del club.</p>', 's', '1555623208_5ea603a8-6630-4fee-abf5-1838b1fdde08.jpg', '2019-04-18 21:33:28', '2019-04-18 21:33:28'),
(112, 276, 'Preparación para el Campeonato Nacional de Gimnasia Varonil 2019', 'Altas expectativas de la Academia Wolosky para el Nacional de Gimnasia Varonil 2019', '2019-05-19', '<p>Nos sentimos muy orgullosos de poder representar a Chiapas&nbsp;en el Campeonato Nacional de Gimnasia Art&iacute;stica Varonil 2019, una de las competencias que llev&aacute;mos esperando con muchas ganas. Del 23 al 29 de mayo, siete de nuestros mejores atletas viajar&aacute;n&nbsp;a la ciudad de Quer&eacute;taro para probarse a s&iacute; mismos y demostrar lo que han logrado en estos meses de entrenamiento.</p>\r\n\r\n<p>Este Campeonato es importante para calificar a futuras competencias, como los Juegos Panamericanos en Lima, Per&uacute; y el Campeonato Mundial Juvenil GAV 2019.</p>\r\n\r\n<p>Al contrario que en a&ntilde;os anteriores, esta vez participaremos con un grupo grande, seis muchachos de diferentes edades, participantes del nivel 5 y el profesor Uzias que tambi&eacute;n partici&oacute; en el nivel 7.</p>\r\n\r\n<p>La preparaci&oacute;n para esta competencia fue todo un reto debido a los cambios en el nivel m&iacute;nimo solicitado por la Federaci&oacute;n para participar, anteriormente aceptaban alumnos del nivel 4 pero esta vez el m&iacute;nimo es a partir del nivel 5; al ver que hab&iacute;an subido el est&aacute;ndar de la competencia supimos que hab&iacute;a que estar muy bien preparados, con lo cual estos meses fueron de mucho entrenamiento y pr&aacute;ctica para los participantes.</p>\r\n\r\n<p>Actualmente no son muchos los varones que practican la gimnasia, es un deporte que por lo general se ha visto dominado por las mujeres. Sin embargo, en Wolosky somos fuertes promotores de la rama de gimnasia varonil y nos sentimos muy orgullosos con lo que hemos logrado hasta ahora.</p>\r\n\r\n<p>Quienes fueron seleccionados para&nbsp;el Campeonato son:&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>-Alfredo Zenteno Gonz&aacute;lez.<br />\r\n-Pedro Lehi Pavon Matus.<br />\r\n-Jorge Arturo Sarmiento Moreno.<br />\r\n-Mois&eacute;s Trujillo Marin.<br />\r\n-Emanuel Camacho Mendez.<br />\r\n-Edgar Javier Velazquez Cruz.<br />\r\n-Uzias Ramirez Calvo.</p>\r\n\r\n<p>Gracias por todo su apoyo.</p>\r\n\r\n<p>&quot;Con esfuerzo y dedicaci&oacute;n, todo se puede lograr&quot;</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1560901011_WOLOSKY_TEAM_ps+ lr.jpg', '2019-06-18 23:36:51', '2019-06-18 23:36:51'),
(113, 276, 'Club Wolosky consiguió 2 medallas en el Campeonato Nacional de Gimnasia Varonil', 'Luego de una dura competencia, los concursantes pretenden regresar con más fuerza el año próximo', '2019-05-27', '<p>Luego de una estupenda participaci&oacute;n por parte de nuestro equipo, regresamos a casa con 2 medallas obtenidas por Pedro Lehi Pav&oacute;n Matus; quien consigui&oacute;&nbsp;una medalla de tercer lugar en salto, con una puntuaci&oacute;n de 8.800 y un quinto lugar en barras paralelas con 9.370 puntos en el nivel 5 E. Con una puntuaci&oacute;n global de 52.376.&nbsp;</p>\r\n\r\n<p>Este a&ntilde;o el equipo estaba casi enteramente conformado por alumnos sin experiencia en este tipo de competencias, siendo Pedro uno de ellos, por lo que estamos muy felices por el resultado obtenido. Este logro significa mucho para nosotros y sirve como una motivaci&oacute;n m&aacute;s para seguir participando en este Campeonato.</p>\r\n\r\n<p>A pesar de los nervios y la presi&oacute;n que sintieron, los muchachos lograron sobreponerse y armarse de valor, enfrentando los ejercicios y haciendo sus rutinas con gran prestez. En una competencia a donde s&oacute;lo asisten los mejores de todo el pa&iacute;s, lograron dar la talla y adquirieron la experiencia necesaria para el a&ntilde;o entrante.</p>\r\n\r\n<p>Seguiremos trabajando con gran motivaci&oacute;n en la gimnasia varonil, con todo el talento que hay en Chiapas, y esperamos contar con una participaci&oacute;n mayor para el 2020.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1560901272_IMG_1250.JPEG', '2019-06-18 23:41:12', '2019-06-18 23:41:12'),
(114, 276, 'Wolosky Gym Fest 2019', 'En Wolosky festejamos en grande nuestro 22° aniversario.', '2019-06-07', '<p>Con motivo de festejar 22 a&ntilde;os&nbsp;de&nbsp;trayectoria, nuestros alumnos y entrenadores del club organizaron el&nbsp;Gym Fest 2019, donde participaron m&aacute;s de 118 gimnastas de nuestra Academia, desde los m&aacute;s peque&ntilde;os hasta los m&aacute;s experimentados. La entrada fue totalmente gratuita para las personas que nos acompa&ntilde;aron en esta nueva edici&oacute;n de aniversaro.</p>\r\n\r\n<p>Entre los n&uacute;meros que se presentaron, destacaron: el equipo femenil&nbsp;de nivel de Regional, el grupo de&nbsp;peque&ntilde;os de&nbsp;los d&iacute;as s&aacute;bados, una exhibici&oacute;n de nuestro equipo varonil que asisti&oacute; al Campeonato Nacional de este a&ntilde;o, y un performance&nbsp;realizado por alumnos de la Licenciatura en Entrenamiento Deportivo de&nbsp;la Universidad Descartes, entre otros.</p>\r\n\r\n<p>As&iacute;mismo, hacemos una menci&oacute;n especial a los&nbsp;ni&ntilde;os del club que est&aacute;n en la clase para capacidades diferentes, quienes realizaron un circuito para demostrar c&oacute;mo la gimnasia les ayudado a desarrollarse mejor y que ellos tambi&eacute;n pueden hacer cosas maravillosas si se les brinda atenci&oacute;n y comprensi&oacute;n.</p>\r\n\r\n<p>Para finalizar, presentamos el n&uacute;mero ensayado para la Gymnaestrada Mundial Dornbirn, Austria 2019 en compa&ntilde;&iacute;a de todo el alumnado e instructores, que aunque desafortunadamente no podremos presentar, estamos orgullosos de haberlo mostrado ante las m&aacute;s de 400 personas que nos acompa&ntilde;aron esa tarde.</p>\r\n\r\n<p>Estos 22 a&ntilde;os de vida con la academia&nbsp;se dicen&nbsp;r&aacute;pido, sin embargo, en todo este tiempo nos hemos dedicado al desarrollo de la gimnasia,&nbsp;buscando cumplir el&nbsp;sue&ntilde;o de&nbsp;consolidarnos como&nbsp;el mejor club&nbsp;de nuestro estado; siempre hemos creido que para lograrlo es importante&nbsp;formar ni&ntilde;os y j&oacute;venes, no s&oacute;lo f&iacute;sicamente, sino tambi&eacute;n en car&aacute;cter y en valores.</p>\r\n\r\n<p>Agradecemos profundamente a nuestro equipo de instructores y entrenadores que con su trabajo y dedicaci&oacute;n han hecho posible el desarrollo de cada alumno que asiste a la Academia. Es un orgullo contar con su apoyo y compromiso diario. Y a todos los familiares y amigos que apoyan los sue&ntilde;os de sus hijos y ven c&oacute;mo crecen d&iacute;a con d&iacute;a, gracias por incluirnos en sus vidas, y por ser parte de esta gran familia.</p>\r\n\r\n<p>Por favor sigamos apoyando esta actividad, y de parte de todo el staff y alumnado, esperamos que lo hayan disfrutado.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1560901389_fest ps+ lr-7.jpg', '2019-06-18 23:43:09', '2019-06-18 23:43:09'),
(115, 276, '¡Vamos a la Gymnaestrada en Austria!', 'La directora de la Academia, Rebeca Wolosky, representará a Chiapas en la Gymnaestrada Mundial 2019, como parte de la Delegación Mexicana de Gimnasia participante.', '2019-07-05', '<p>La profesora Rebeca Wolosky se encuentra de viaje por&nbsp;Europa&nbsp;en representaci&oacute;n de la Academia de Gimnasia Wolosky y del estado de Chiapas. Forma parte de la Delegaci&oacute;n Mexicana de Gimnasia participante en la Gymnastrada Mundial 2019 que se llevar&aacute; a cabo en Dornbirn, Austria este 6 de julio.&nbsp;&nbsp;</p>\r\n\r\n<p>La Gymnaestrada Mundial es actualmente el evento de gimnasia no competitivo m&aacute;s grande que existe, y est&aacute; organizada por la Federaci&oacute;n Internacional de Gimnasia con el objetivo de promover el deporte a trav&eacute;s de una jornada de diversos montajes gimn&aacute;sticos. Cada cuatro a&ntilde;os tiene lugar en una ciudad diferente, siendo Dornbirn la elegida para este 2019.</p>\r\n\r\n<p>La Delegaci&oacute;n mexicana est&aacute; conformada por 220 gimnastas de todo el pa&iacute;s, que desarrollar&aacute;n varias rutinas acrob&aacute;ticas. Adem&aacute;s de participar en la inauguraci&oacute;n y clausura del evento, estar&aacute;n en la presentaci&oacute;n de la UPAG (uni&oacute;n Panamericana de Gimnasia) y en la Gala Gimn&aacute;stica Internacional, as&iacute; como en la Noche Nacional Mexicana.</p>\r\n\r\n<p>Podr&aacute;n sintonizar las presentaciones en los siguientes canales: Dish Claro Sport, canal 336, o por Internet a trav&eacute;s de Claro video del 6 al 13 de julio.</p>\r\n\r\n<p>Muchas gracias por todo su apoyo, esperamos que con esta participaci&oacute;n el nombre de nuestra Academia y de nuestro estado se alcen con orgullo, pronto daremos m&aacute;s noticias a trav&eacute;s de la p&aacute;gina y nuestras redes sociales.</p>\r\n\r\n<p>S&iacute;guenos en nuestras redes como Gimnasia Artistica WOLOSKY en Facebook y como @Rebewolosky en Instagram.</p>\r\n\r\n<p>&quot;Con esfuerzo y dedicaci&oacute;n, todo se puede lograr&quot;</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1562347446_2.2.jpg', '2019-07-05 17:24:06', '2019-07-05 17:24:06'),
(116, 276, 'Preparación para la inauguración de la Gymnaestrada 2019', 'Estuvimos presentes junto con otros atletas mexicanos, observando a los equipos ensayar sus rutinas para esta gran festividad', '2019-07-06', '<p>Luego de cuatro a&ntilde;os, la Gymnaestrada regresa prometiendo una celebraci&oacute;n&nbsp;llena de color. Desde Dornbirn, Austria;&nbsp;Wolosky estuvo presente junto con otros atletas mexicanos que tambi&eacute;n asistieron al festival. Los ensayos estuvieron colmados de energ&iacute;a y buena vibra por parte de los asistentes.&nbsp;</p>\r\n\r\n<p>La Gymnaestrada busca que los participantes y espectadores de diferentes pa&iacute;ses tengan una experiencia global y agradable con la que se busca fomentar valores importantes como el respeto a traves del bello deporte de la gimnasia.&nbsp;</p>\r\n\r\n<p>&quot;El deporte es capaz de unir las diferentes culturas del mundo&quot;</p>\r\n\r\n<p>#Wolosky</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1562461915_3.jpeg', '2019-07-07 01:11:55', '2019-07-07 15:33:28'),
(117, 276, 'CANCELADA la inauguración de la Gymnaestrada 2019', 'Debido a fuertes tormentas eléctricas el comité optó por cancelar la inauguración del evento', '2019-07-07', '<p>La ceremonia de inauguraci&oacute;n que se supone iniciar&iacute;a este Domingo a las 4 de la tarde en Austria termin&oacute; siendo cancelada 90 minutos antes de comenzar, ante la preocupaci&oacute;n del comit&eacute; organizador por la seguridad de las personas debido a fuertes tormentas el&eacute;ctricas.</p>\r\n\r\n<p>Alrededor del mediod&iacute;a ya se pod&iacute;an observar algunas nubes de tormenta, pero la decisi&oacute;n fue aplazada con la esperanza de que el pron&oacute;stico pudiera mejorar. Se estima que alrededor de 25,000 personas estar&iacute;an presentes al momento de la inauguraci&oacute;n.&nbsp;</p>\r\n\r\n<p>Sin embargo, la ceremonia se reubicar&aacute; para el d&iacute;a mi&eacute;rcoles y ser&aacute; televisada entre las 2:20 y 5:00pm hora local, que para M&eacute;xico son las 7:20 y 10:00 am por la diferencia de horarios.</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1562514232_tormenta 2.jpg', '2019-07-07 15:43:52', '2019-07-07 15:59:35'),
(118, 276, 'Ceremonia de Inauguración de la World Gymnaestrada', 'Este miércoles se retomó la ceremonia que había sido suspendida', '2019-07-10', '<p>Desde las 2:30pm hora local, los asistentes compartieron por instagram sus fotos con&nbsp;los hashtags &quot;<strong>#gymnaestrada</strong>&quot; y &quot;<strong>#wg2019</strong>&quot;, capturando&nbsp;momentos inolvidables en este evento donde participan m&aacute;s de 60 pa&iacute;ses de todo el mundo.</p>\r\n\r\n<p>Entre los asistentes estuvo como invitado especial el alem&aacute;n&nbsp;<strong>Fabian Hamb&uuml;chen</strong>, campe&oacute;n ol&iacute;mpico que partici&oacute; por primera vez en este evento.</p>\r\n\r\n<p>Algo que es importante destacar es la participaci&oacute;n de cada vez m&aacute;s gente joven, sin dejar de lado a los adultos mayores y personas con discapacidad, que a pesar de tener algunos inconvenientes para presentarse a&uacute;n nos demuestran sus mejores pasos en las rutinas que prepararon.&nbsp;</p>\r\n\r\n<p>A pesar de que la mayor parte de quienes conforman la familia <strong>Wolosky</strong> no pudieron participar, pueden ver en nuestras redes sociales videos y fotos donde compartimos nuestra experiencia, s&iacute;guenos en <strong>@rebewolosky</strong> en instagram y en facebook como <strong>Gimnasia Art&iacute;stica Wolosky</strong>!</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1563047564_headerstart.jpg', '2019-07-13 19:52:44', '2019-07-13 19:52:44'),
(119, 276, 'Inicio del Curso de Verano 2019', 'Del 15 de julio al 09 de agosto, los niños y niñas realizarán actividades como gimnasia en telas y gimnasia acrobática, y desarrollarán rutinas que presentarán el último día de clases.', '2019-07-15', '<p>Este Lunes dimos inicio a nuestro Curso de Verano, donde a&ntilde;o con a&ntilde;o varios ni&ntilde;os y ni&ntilde;as se divierten y aprenden de gimnasia. El objetivo del curso es introducir a los ni&ntilde;os y ni&ntilde;as en la Gimnasia y promover un estilo de vida saludable y activo, logrando que el deporte sea parte de su d&iacute;a a d&iacute;a.</p>\r\n\r\n<p>Con los juegos y&nbsp;actividades que realizar&aacute;n ir&aacute;n desarrollando sus aptitudes f&iacute;sicas, mejorar&aacute;n su coordinaci&oacute;n, socializar&aacute;n con chicos de su edad y practicar&aacute;n para sorprender a sus familias este 9 de Agosto con sus rutinas finales.</p>\r\n\r\n<p>A todos los pap&aacute;s y mam&aacute;s que quieran acompa&ntilde;arnos, est&aacute;n cordialmente invitados, as&iacute;mismo, les recordamos que SEGUIMOS con nuestras clases normales, de Lunes a Viernes de 4 a 8pm y Los d&iacute;as s&aacute;bados de 9am a 12pm.</p>\r\n\r\n<p>S&iacute;gannos en nuestras redes sociales, donde estaremos compartiendo fotos y videos de nuestras actividades:</p>\r\n\r\n<p>Instagram: @rebewolosky</p>\r\n\r\n<p>Facebook: Gimnasia Art&iacute;stica Wolosky</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1563301209_IMG_0064.jpg', '2019-07-16 18:16:57', '2019-07-16 18:20:09'),
(120, 276, '¿Qué es la gimnasia artística?', 'En este artículo explicamos brevemente qué es la gimnasia artística.', '2019-07-20', '<p>La <strong>gimnasia art&iacute;stica</strong> es un <strong>deporte ol&iacute;mpico</strong> que requiere ciertas cualidades f&iacute;sicas como equilibrio, flexibilidad, coordinaci&oacute;n y fuerza, que se van desarrollando poco a poco. Estas cualidades se ponen a prueba durante las competencias regionales, nacionales e internacionales.</p>\r\n\r\n<p>La <strong>gimnasia art&iacute;stica</strong> puede ser practicada por <strong>hombres y mujeres</strong>, que buscan dominar los diferentes ejercicios gimn&aacute;sticos a trav&eacute;s de una fuerte preparaci&oacute;n f&iacute;sica y t&eacute;cnica.&nbsp;</p>\r\n\r\n<p>Las mujeres y los hombres compiten por separado en diferentes aparatos y modalidades. En el caso de las mujeres en cuatro aparatos y en el caso de los hombres en 6 aparatos.</p>\r\n\r\n<p>Los aparatos que se utilizan en la <em><strong>categor&iacute;a femenina</strong></em> son:</p>\r\n\r\n<ul>\r\n	<li>Suelo</li>\r\n	<li>Potro (caballo de salto)</li>\r\n	<li>Barra de equilibrio</li>\r\n	<li>Barras asim&eacute;tricas</li>\r\n</ul>\r\n\r\n<p>En la <em><strong>categor&iacute;a masculina</strong></em>, los aparatos son:</p>\r\n\r\n<ul>\r\n	<li>Barra fija</li>\r\n	<li>Barras paralelas</li>\r\n	<li>Potro (caballo de salto)</li>\r\n	<li>Caballo con arcos</li>\r\n	<li>Aros y ejercicios de&nbsp;suelo</li>\r\n</ul>\r\n\r\n<p>Se puede competir por<strong> equipos</strong>, o de manera <strong>individual</strong> por aparato. En cada uno de los aparatos se establecen rutinas obligatorias y en las competencias se eval&uacute;a qu&eacute; tan bien se realizaron de acuerdo a est&aacute;ndares preestablecidos.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/8hMnKdlWiXo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1563643601_2 lr.jpg', '2019-07-20 17:26:41', '2019-07-20 17:41:52'),
(121, 276, '¿Hasta qué edad puedo empezar a entrenar gimnasia?', 'Nunca es demasiado tarde para obtener los beneficios de la práctica de este deporte.', '2019-07-22', '<p>Ya hemos hablado de algunos de los <strong>beneficios de la gimnasia</strong>, desde mejorar la <strong>flexibilidad </strong>y el <strong>equilibrio</strong> hasta las consecuencias positivas para la mente de las personas como la<strong> confianza</strong> en s&iacute; mismos. Esta vez queremos explicar por qu&eacute; <strong>la gimnasia es un deporte para todas las personas.</strong></p>\r\n\r\n<p>En <strong>Wolosky</strong>, tenemos grupos&nbsp;desde ni&ntilde;os peque&ntilde;os, que apenas van desarrollando su capacidades motrices,&nbsp;hasta adultos que buscan ponerse en forma; y todos disfrutan de la gimnasia.</p>\r\n\r\n<p>Es muy sabido que varios&nbsp;gimnastas de elite comenzaron a entrenar desde peque&ntilde;os,&nbsp;ya que los ni&ntilde;os son m&aacute;s ligeros y flexibles que los adultos,&nbsp;tienden a tener menos miedo para enfrentar los retos de los entrenamientos y pueden adaptarse a las rutinas con facilidad. Es por esta raz&oacute;n que muchas personas nos preguntan seguido&nbsp;si a&nbsp;los 15,18 o incluso 30&nbsp;a&ntilde;os es muy tarde para empezar la gimnasia. Sin embargo, hemos demostrado que <strong>practicar gimnasia en la adolescencia</strong>&nbsp;o incluso de adultos&nbsp;puede mejorar el rendimiento en cualquier otra actividad, adem&aacute;s de mejorar la salud f&iacute;sica y emocional de los alumnos.&nbsp;</p>\r\n\r\n<p>A pesar de todo, uno de los retos a los que se enfrentan&nbsp;los m&aacute;s grandes al practicar es que&nbsp;pueden llegar a&nbsp;sentirse frustrados al ver c&oacute;mo los ni&ntilde;os peque&ntilde;os muestran un desempe&ntilde;o mayor, esto sucede sobretodo al inicio, y es algo que se aprende a sobrellevar al ver c&oacute;mo uno mismo va mejorando con la <strong>pr&aacute;ctica</strong> y la <strong>constancia</strong>, adem&aacute;s de un buen plan de entrenamiento.&nbsp;</p>\r\n\r\n<p>Pero sobre todo, la principal raz&oacute;n para hacer gimnasia es la <strong>diversi&oacute;n,</strong> disfrutar de hacer una actividad y el proceso que conlleva nos ayuda a tener vidas m&aacute;s sanas y satisfactorias, es por ello que en la <strong>Academia</strong> nunca nos cansamos de decir que cualquiera puede intentarlo.&nbsp;</p>\r\n\r\n<p>Ofrecemos clases de muestra sin compromiso a todo el que quiera empezar en esta actividad, para mayor informaci&oacute;n estamos disponibles en nuestra p&aacute;gina oficial de <a href=\"https://www.facebook.com/GimnasiaWolosky/?ref=br_rs\">Facebook</a> y al n&uacute;mero&nbsp;(961) 593 6833.</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1563828311_IMG_0007.jpg', '2019-07-22 20:45:11', '2019-07-22 20:58:13'),
(122, 276, 'Fabián de Luna gana medalla de oro en los Juegos Panamericanos Lima 2019', 'Esta es la decimotercera medalla de oro para México en los Juegos Panamericanos de este año', '2019-07-30', '<p>El gimnasta mexicano&nbsp;Fabi&aacute;n de Luna, consigui&oacute;&nbsp;la medalla de oro en gimnasia luego de una incre&iacute;ble rutina en la prueba de anillos, con la que obtuvo un puntaje final de 14.500 superando&nbsp;al brasile&ntilde;o&nbsp;Arthur Zanett y al Argentino&nbsp;Federico Molinari, con un puntaje de&nbsp;14.400 y 14.066 cada uno.&nbsp;</p>\r\n\r\n<p>Esta medalla de oro es la decimotercera que M&eacute;xico obtiene durante estos juegos, adem&aacute;s de medallas de bronce y plata por las disciplinas de canotaje, rifle y voleibol de playa, respectivamente.</p>\r\n\r\n<p>Fabi&aacute;n continuar&aacute; su participaci&oacute;n en los Juegos Panamericanos Lima 2019, &iexcl;muchas felicidades por este gran logro!</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/7Eu_OF8es3E\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '1564522815_de-luna-ok-ok.jpg', '2019-07-30 21:36:28', '2019-07-30 21:42:15'),
(123, 276, 'Clausura del Curso de Verano 2019', 'Este viernes dimos por finalizado nuestro ciclo de verano con rutinas desarrolladas por nuestros alumnos del curso a lo largo de cuatro semanas.', '2019-08-09', '<p>Este<strong> viernes 9 de Agosto&nbsp;</strong>tuvimos nuestra ceremonia de <strong>clausura del</strong> <strong>Curso de Verano 2019</strong>. De 12 a 1pm, nos dimos cita con pap&aacute;s, alumnos e invitados para que nos acompa&ntilde;aran a ver el progreso que los ni&ntilde;os hicieron a lo largo del mes y con el que estamos muy satisfechos. Al principio fue todo un reto coordinar a <strong>m&aacute;s de 80 ni&ntilde;os y ni&ntilde;as</strong> de diferentes edades pero al final lograron aprender, convivir y divertirse.&nbsp;</p>\r\n\r\n<p>Las exhibiciones estuvieron divididas por grupos de diferentes colores, que iban intercambiandose entre las distintas actividades (<strong>Drum fit</strong>, <strong>Gimnasia</strong> y <strong>Danza en telas</strong>). Adem&aacute;s, presentamos un par de n&uacute;meros especiales con las competidoras de la pr&oacute;xima <strong>competencia estatal</strong> de los niveles 4 y 5, que buscar&aacute;n hacerse con la medalla este a&ntilde;o.&nbsp;</p>\r\n\r\n<p>Al terminar la ceremonia, se llevaron a casa una pecera que hicieron como actividad de manualidades y su playera de recuerdo. Esperamos que disfrutaran de este peque&ntilde;o evento, y a nombre de todo el equipo <strong>Wolosky</strong>, gracias por asistir.</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1565541526_67830284_920268484973246_6080942004802420736_n.jpg', '2019-08-11 16:38:46', '2019-08-11 16:38:46'),
(124, 276, 'Capacitación con el renombrado Coach Marco A. Bravo', 'Viajamos hasta Coatzacoalcos, Veracruz, para recibir mentoría por parte del maestro Marco, que tiene más de 30 años de experiencia.', '2019-08-10', '<p>Del <strong>08 al 10 de agosto</strong>, asistimos al&nbsp;<strong>Centro de Alto Rendimiento de Gimnasia Art&iacute;stica de Coatzacoalcos&nbsp;</strong>para participar en este curso impartido por el coach <strong>Marco A. Bravo</strong>, entrenador con m&aacute;s de 30 a&ntilde;os de experiencia en gimnasia internacional&nbsp;de alto nivel; tiene experiencia formando a gimnastas desde preescolar hasta varios&nbsp;atletas de nivel 10. Entre sus logros destaca el haber llevado formado a 4 representantes del Equipo Nacional de Gimnasia de Estados Unidos.</p>\r\n\r\n<p>Alumnos y maestros pudieron recibir indicaciones y consejos directamente del coach, quien estuvo al pendiente de todos ellos. Los entrenadores<em> Uz&iacute;as Calvo Ram&iacute;rez</em> y <em>Berenice Flores</em> compartieron su experiencia en el curso a trav&eacute;s de redes sociales, que podr&aacute;n ver pr&oacute;ximamente en nuestra p&aacute;gina de <strong>Facebook</strong> &quot;<strong>Gimnasia Art&iacute;stica Wolosky</strong>&quot;</p>\r\n\r\n<p>Cabe destacar que asistir a este tipo de cursos ayuda bastante a mejorar el nivel de los atletas mexicanos, especificamente en el caso de Chiapas, donde este deporte a&uacute;n tiene mucho que dar.&nbsp;</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1565649315_1.1PS.jpg', '2019-08-12 22:35:15', '2019-08-12 23:21:40'),
(125, 276, 'Impartimos cursos de Gimnasia para alumnos del CUM Villaflores', 'Recibimos a los alumnos del Centro Universitario Mesoamericano de Villaflores, quienes vinieron a capacitarse con nosotros en la materia de Gimnasia.', '2019-08-16', '<p>En convenio con el CUM (Centro Universitario Mesoamericano) Villaflores, m&aacute;s de 30 alumnos de la Licenciatura de Entrenamiento Deportivo acudieron a las instalaciones de la Academia Wolosky&nbsp;como parte de su programa de estudios, que contempla a la gimnasia en los primeros semestres.</p>\r\n\r\n<p>Las actividades que se desarrollaron con este curso incluyeron ejercicios de preparaci&oacute;n y elementos acrob&aacute;ticos en los diferentes aparatos. Todo bajo la supervisi&oacute;n de los entrenadores del gimnasio y la Directora Rebeca Wolosky, en coordinaci&oacute;n con la maestra Ivonne Gonz&aacute;lez y maestros del CUM Villaflores.</p>\r\n\r\n<p>Llevamos trabajando con esta instituci&oacute;n desde que se inaugur&oacute; la Licenciatura en Entrenamiento Deportivo, y hasta la fecha, varios alumnos que cursan las materias de Gimnasia 1 y 2&nbsp; vienen con nosotros para mejorar sus habilidades en instalaciones especialmente habilitadas para ellos, donde pueden entrenar con aparatos oficiales.&nbsp;</p>\r\n\r\n<p>Agradecemos al Ing. Jos&eacute; Javier Bautista, Director del CUM Villaflores, por confiar en nosotros para el desarrollo de los alumnos. Este es uno de los convenios que realiza&nbsp;Wolosky en conjunto con&nbsp;instituciones particulares, para ayudar a las licenciaturas deportivas a ofrecer una mejor calidad educativa en cuanto a gimnasia se refiere.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1566001961_13.jpeg', '2019-08-17 00:32:41', '2019-08-17 00:32:41'),
(126, 276, 'Colecta de fondos para asistir al Campeonato Regional en Boca del Río 2019', 'Para apoyar a las jóvenes atletas que viajarán la próxima semana al Campeonato Regional representando a Chiapas, los padres de familia han organizado un evento para recolectar fondos.', '2019-08-19', '<p>Del <strong>27 de Agosto al 1&nbsp;de septiembre</strong>, 17 atletas j&oacute;venes de entre 10 y 22 a&ntilde;os de edad, competir&aacute;n en el <strong>Campeonato Regional 2019</strong> que se celebra en <strong>Boca del R&iacute;o, Veracruz</strong>. En el campeonato, participar&aacute;n los estados de Chiapas, Veracruz, Tabasco, Yucat&aacute;n y Quintana Roo.&nbsp;</p>\r\n\r\n<p>Debido a los costos que el viaje implica para las familias, varios familiares de las concursantes han organizado un evento este 24 de agosto con el que esperan juntar fondos suficientes.</p>\r\n\r\n<p>Quienes gusten apoyar al equipo de gimnastas, este <strong>S&aacute;bado 24 de Agosto</strong>, los esperamos en <strong>Cin&eacute;polis Plaza Las Am&eacute;ricas</strong> a las <strong>10 a.m</strong>, donde se proyectar&aacute; la pel&iacute;cula de&nbsp;<strong><em>Aquaman&nbsp;</em></strong>y se rifar&aacute;n varios premios que incluyen:</p>\r\n\r\n<ul>\r\n	<li>Luz y sonido para evento.</li>\r\n	<li>Lentes de sol y lentes deportivos.</li>\r\n	<li>Dos desayunos para dos personas.</li>\r\n	<li>Sesi&oacute;n de fisioterapia.</li>\r\n	<li>Perfume para dama.</li>\r\n	<li>Todo un mes de clases de gimnasia en <strong><em>Wolosky</em></strong>, adem&aacute;s de un mes de estacionamiento.</li>\r\n</ul>\r\n\r\n<p>Pueden adquirir sus boletos en la <strong>2a. Poniente entre 2 y 3 norte<em>&nbsp;&nbsp;</em></strong>o el mismo d&iacute;a del evento, el&nbsp;<strong>costo del boleto es de&nbsp;$50.&nbsp;</strong></p>\r\n\r\n<p>De antemano, agradecemos mucho el apoyo que puedan ofrecer a estas j&oacute;venes que van a darlo todo en esta competencia para llegar al siguiente nivel.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>&quot;Con esfuerzo y dedicaci&oacute;n, todo se puede lograr&quot;</em></p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1566255840_colecta fondos veracruz.jpg', '2019-08-19 23:04:00', '2019-08-20 03:16:45'),
(128, 276, '43 medallas para Wolosky en el Regional de Boca del Río 2019', 'Oro, plata y bronce para las gimnastas que participaron representando a Chiapas', '2019-09-08', '<p>Hace unos d&iacute;as adelant&aacute;bamos en Instagram acerca de los resultados del pasado Campeonato Regional, hoy estamos muy felices y contentos de comunicar los resultados finales que obtuvo el equipo Wolosky.</p>\r\n\r\n<p>En total fueron 43 medallas que se ganaron en todas las categor&iacute;as y grupos en los que participamos, niveles 3, 4, y 5.&nbsp;</p>\r\n\r\n<p>Resultado final:</p>\r\n\r\n<ul>\r\n	<li>4 medallas de oro.</li>\r\n	<li>1 medalla de plata.</li>\r\n	<li>34 medallas de bronce.</li>\r\n	<li>4 medallas de participaci&oacute;n.</li>\r\n</ul>\r\n\r\n<p>Las gimnastas que participaron&nbsp;en este Campeonato son:</p>\r\n\r\n<p><br />\r\n<strong>Nivel</strong> <strong>3</strong><br />\r\nValentina Rendon<br />\r\nCarolina Gallegos<br />\r\nJade Pascual<br />\r\nGabriela Ruiz<br />\r\nVictoria Guillen<br />\r\nEthel Chac&oacute;n de La Cruz<br />\r\nIngrid Martinez</p>\r\n\r\n<p><strong>Nivel 4</strong><br />\r\nIngrid Ochoa<br />\r\nValeria Grajales<br />\r\nItzel Cetina<br />\r\nDaniela Paniagua<br />\r\nValentina Vazquez<br />\r\nHanna Tello<br />\r\nValentina L&oacute;pez</p>\r\n\r\n<p><strong>Nivel 5</strong><br />\r\nCinthia S&aacute;nchez<br />\r\nValeria Castellanos</p>\r\n\r\n<p><strong>Delegada:</strong></p>\r\n\r\n<ul>\r\n	<li>Rebeca Wolosky &Aacute;lvarez</li>\r\n</ul>\r\n\r\n<p><strong>Entrenadores:</strong></p>\r\n\r\n<ul>\r\n	<li>Berenice Flores Arrazola</li>\r\n	<li>Edgar Velazquez Cruz</li>\r\n	<li>Brayan de Jes&uacute;s Aguilar Mora</li>\r\n	<li>Cristhian Tadeo Flores Martinez</li>\r\n	<li>Luis Eduardo Cundapi L&oacute;pez</li>\r\n</ul>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1567964446_IMG_0015.jpg', '2019-09-08 17:40:46', '2019-09-08 17:44:54'),
(129, 276, 'Wolosky elegido como anfitrión en la gira Internacional del Grupo Ollerup de gimnasia.', 'Después de nuestra participación en la Gymnaestrada Mundial, nuestro estado tendrá la gran oportunidad de recibir a 40 gimnastas del grupo Ollerup', '2019-09-09', '<p>Damos a conocer que despu&eacute;s de nuestra participaci&oacute;n en la Gymnastrada Mundial y contactos que se realizaron con la Coordinaci&oacute;n de la mejor escuela de gimnasia en Dinamarca nuestro estado tendr&aacute; la gran oportunidad de recibirlos y compartir conocimientos y pr&aacute;cticas con ellos el grupo &ldquo;Ollerup&rdquo; 40 gimnastas que compartir&aacute;n sus conocimientos con nuestros clubes en Chiapas.</p>\r\n\r\n<p>La Federaci&oacute;n Mexicana de Gimnasia A.C. otorg&oacute; la sede a nuestro estado de Chiapas para la realizaci&oacute;n de un evento de car&aacute;cter Internacional mismo que estar&aacute; coordinado con la Federaci&oacute;n de Gimnasia de Dinamarca.</p>\r\n\r\n<p>La Asociaci&oacute;n Chiapaneca de Gimnasia A.C. a trav&eacute;s de los clubes que la conformamos:</p>\r\n\r\n<p>Seremos anfitriones en la gira del grupo dan&eacute;s que viene a cumplir un proyecto de car&aacute;cter mundial donde el objetivo de promocionar la gimnasia alrededor del mundo.</p>\r\n\r\n<p>Los estados que recibir&aacute;n esta incre&iacute;ble oportunidad son: Jalisco, Quer&eacute;taro, Puebla, CDMX, Guanajuato y CHIAPAS.</p>\r\n\r\n<p>La fecha para Chiapas es del 20 al 23 de octubre del a&ntilde;o en curso.</p>\r\n\r\n<p>Esperamos el apoyo de todos los clubes afiliados y la m&aacute;xima participaci&oacute;n en las cl&iacute;nicas y gala show que Dinamarca prepar&oacute; para M&eacute;xico.</p>\r\n\r\n<p>En breve estaremos lanzando la convocatoria para las cl&iacute;nicas y la gala show que verdaderamente ser&aacute; un espect&aacute;culo incre&iacute;ble de calidad Internacional.</p>\r\n\r\n<p>Aprovechemos esta gran oportunidad de participar y aprender con este maravilloso grupo de Daneses!</p>\r\n\r\n<p>Adjuntamos el link con toda la informaci&oacute;n de este proyecto para que se motiven y sean parte de este extraordinario evento nunca antes visto en Chiapas.</p>\r\n\r\n<p>https://drive.google.com/drive/folders/10fUpqh_U_6uRMtf7r-4RXk1GkKn5L21V?usp=sharing</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ATENTAMENTE</p>\r\n\r\n<p>Rebeca Wolosky</p>\r\n\r\n<p>Informes 9615936833</p>\r\n\r\n<p>Tuxtla Guti&eacute;rrez 9 de septiembre de 2019.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1568068291_Dinamarca-DATOS-WOLOSKY.png', '2019-09-09 22:31:31', '2019-09-09 22:31:31'),
(130, 276, 'Workshops para gimnastas con la Escuela de Dinamarca, Ollerup', 'Niños y jóvenes gimnastas tuvieron la oportunidad de aprender de la mano de gimnastas de talla internacional.', '2019-10-21', '<p>Nos dimos cita este Lunes 22 en el Centro de Convenciones de Chiapas&nbsp;para los workshops abiertos tanto para gimnastas como para p&uacute;blico en general. Ni&ntilde;os y j&oacute;venes tuvieron&nbsp;la oportunidad de aprender de la mano de gimnastas venidos directamente de Dinamarca para su gira mundial, siendo Chiapas uno de sus destinos programados. Hubo una gran variedad de actividades, enfocadas en la flexibilidad y habilidades acrob&aacute;ticas de los alumnos, mejorando y aprendiendo t&eacute;xnicas de saltos y ejercicios de suelo.</p>\r\n\r\n<p>Tenemos el compromiso de traer lo mejor en gimnasia para nuestros alumnos, ya sea en cl&iacute;nicas, talleres o eventos, y as&iacute; ir mejorando el nivel de Wolosky y de Chiapas para futuras competencias Regionales y Nacionales.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1572111064_IMG_0197.jpg', '2019-10-26 17:31:04', '2019-10-26 17:31:04'),
(131, 276, 'Gala Show Internacional con el equipo de Ollerup, Dinamarca', 'Una experiencia inolvidable en el primer show de Gimnasia Internacional en Chiapas', '2019-10-22', '<p>Este martes 22 de octubre, terminamos los Workshops y cerramos el d&iacute;a con un espectacular show en compa&ntilde;&iacute;a de varios invitados destacados por parte del Gobierno de Chiapas, de la Federaci&oacute;n Mexicana de Gimnasia y la Asociaci&oacute;n Chiapaneca de Gimnasia, entre otros.</p>\r\n\r\n<p>El evento, organizado por los mejores cuatro clubes de gimnasia en Chiapas: Wolosky, Dorthom, Lima y Milenka, tuvo una duraci&oacute;n aproximada de 2 horas y media y cont&oacute; con varios n&uacute;meros gimn&aacute;sticos por parte de los diferentes clubes.</p>\r\n\r\n<p>En la presentaci&oacute;n estelar, el club Ollerup de Dinamarca luci&oacute; sus mejores movimientos y nos demostr&oacute; la calidad de la gimnasia Europea, sus n&uacute;meros de baile, salto y acrobacias se llevaron los aplausos de los m&aacute;s de 200 asistentes a la gala. Al finalizar, tuvimos una peque&ntilde;a sesi&oacute;n de fotos que podr&aacute;n ver&nbsp;en nuestras redes sociales as&iacute; como la presentaci&oacute;n completa de este gran equipo europeo.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1572112815_IMG_4360.jpg', '2019-10-26 18:00:15', '2019-10-26 18:00:15'),
(132, 276, '¡Gracias por todo el apoyo!', 'Un breve agradecimiento a todos los que fueron partícipes de este gran evento, sin quienes no hubiera sido posible hacerlo realidad.', '2019-10-24', '<p>De parte de la Directora <em><strong>Rebeca Wolosky</strong></em>, y todos los que conformamos el equipo del <strong>Club de Gimnasia Wolosky</strong>, agradecemos enormemente el compromiso de los clubes de Gimnasia de Chiapas, a <strong>Milenka</strong>, <strong>Lima</strong> y <strong>Dorthom</strong> por su activa participaci&oacute;n en la organizaci&oacute;n durante el evento y por la calidad excepcional de sus participaciones. As&iacute; mismo damos las gracias por el apoyo recibido de parte de la <strong>Asociaci&oacute;n Chiapaneca de Gimnasia</strong> y la <strong>Federaci&oacute;n Mexicana de Gimnasia</strong> con quienes mantuvimos una comunicaci&oacute;n muy cercana estas &uacute;ltimas semanas.</p>\r\n\r\n<p>Gracias a todos los patrocinadores del evento, especialmente a <strong>Sistemas Contino</strong> y al <em><strong>Lic. Gerardo Poo Gil</strong></em>, que sin ellos no habr&iacute;amos logrado este magno evento; a <strong>Kerigma</strong> Luz y Sonido como a la <strong>Cl&iacute;nica Larrosa</strong> por facilitarnos la ambulancia como medida de seguridad.</p>\r\n\r\n<p>Por &uacute;ltimo pero no menos importante a la profesora <em><strong>Cristiane Fiorin-Fuglsang</strong></em> y a la escuela de <strong>Ollerup</strong>, <strong>Dinamarca</strong> por considerarnos dentro de su gira mundial con el excelente y maravilloso show que nos ofrecieron ayer.</p>\r\n\r\n<p><strong><em>&quot;Con esfuerzo y dedicaci&oacute;n, todo se puede lograr&quot;</em></strong></p>\r\n\r\n<p>_____________</p>\r\n\r\n<p><em>-Directora de Wolosky,</em><strong> Rebeca Wolosky &Aacute;lvarez.</strong><br />\r\n-<strong>Lic. Ana Karen Flores Lopez.</strong><br />\r\n<em>Representante de la Federaci&oacute;n Mexicana de Gimnasia.</em><br />\r\n-<strong>Mar&iacute;a Esther Thomas Castorena</strong><br />\r\n<em>Pdta. De la Asociaci&oacute;n Chiapaneca de gimnasia.</em><br />\r\n-<strong>Prof. Cristiane Fiorin-Fuglsang</strong><br />\r\n<em>Jefa de la Academia Internacional en Ollerup.</em></p>\r\n\r\n<p>_____________</p>\r\n\r\n<p><strong>ACADEMIA DE GIMNASIA ART&Iacute;STICA WOLOSKY</strong><br />\r\nFundada en 1998, tambi&eacute;n es miembro Fundador de la Asociacion Chiapaneca de Gimnasia en 2003. Con una misi&oacute;n clara de formar TRIUNFADORES,y dar seguridad a trav&eacute;s de la disciplina, fortaleciendo el car&aacute;cter y autoestima de los alumnos; cuenta con programas para ni&ntilde;os con capacidades diferentes y adultos mayores, obteniendo grandes logros, fortaleciendo su salud f&iacute;sica y mental as&iacute; como su inclusi&oacute;n a la sociedad.</p>\r\n\r\n<p><strong>ESCUELA INTERNACIONAL DE GIMNASIA OLLERUP</strong><br />\r\nEs un equipo de gimnastas seleccionados de la escuela Ollerup Gymnastikh&oslash;jskolen en Dinamarca; como su nombre lo indica son los m&aacute;s grandes representantes de la Gimnasia Danesa, una de las escuelas m&aacute;s antiguas e importantes en el mundo, tienen como objetivo, mediante espect&aacute;culos, cl&iacute;nicas y cursos, incentivar a la pr&aacute;ctica deportiva y mostrar los alcances del Deporte para todos, en todas las etapas de la vida.</p>\r\n\r\n<p><strong>ESCUELA DE GIMNASIA ART&Iacute;STICA DORTHOM</strong><br />\r\nFundada en 1983, cuentan con m&aacute;s de 35 a&ntilde;os formando atletas de alto rendimiento, siempre comprometidos con el desarrollo integral de sus alumnos, buscan fomentar el deporte Chiapaneco a trav&eacute;s de sus atletas.</p>\r\n\r\n<p><strong>ESCUELA DE GIMNASIA RITMICA MILENKA</strong><br />\r\nFundada el 14 de febrero del 2018 en la ciudad de Tapachula, Chiapas. Tiene el objetivo de formar deportistas con car&aacute;cter y con una vision puesta hacia un futuro exitoso en cada una de sus alumnas.<br />\r\nLa escuela esta conformada por dos entrenadoras de gimnasia r&iacute;tmica , una entrenadora con maestria en educacion y una juez t&eacute;cnica avalada por la federacion mexicana de gimnasia. Su visi&oacute;n a largo plazo es que todas y cada una de sus alumnas alcanzen el mayor logro posible en competiciones de gimnasia r&iacute;tmica, apoyadas con eventos, competencias, cursos y cl&iacute;nicas tanto a nivel nacional como internacional.</p>\r\n\r\n<p><strong>ESCUELA DE GIMNASIA ART&Iacute;STICA LIMA</strong><br />\r\nAbri&oacute; sus puertas el 18 de Enero del 2016. Con una trayectoria muy prometedora, participando activamente en competiciones a nivel nacional, su primera copa fue en el 2017 en el estado de Guerrero. En el Regional en Canc&uacute;n en el 2018, lograron el primer lugar en la categor&iacute;a D en barras asim&eacute;tricas, estando en los primeros diez lugares en los dem&aacute;s aparatos y diferentes categor&iacute;as.<br />\r\nA tres a&ntilde;os de abrir las puertas del Gimnasio, el nombre LIMA se est&aacute; dando a conocer dentro de la Regi&oacute;n Sureste, los resultados obtenidos han sido muy satisfactorios, y a pesar de todas las dificultades por las que han pasado, los resultados han hablado por ellos.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1572113157_IMG_0346.jpg', '2019-10-26 18:05:57', '2019-10-26 18:05:57'),
(133, 276, 'Ensayos finales para el Festival Nacional en Toluca', 'Festival Nacional de Gimnasia Para Todos 2019', '2019-12-02', '<p>Desde este mi&eacute;rcoles, Wolosky ser&aacute; part&iacute;cipe del &quot;Festival Nacional de Gimnasia Para Todos 2019&quot; donde alumnos y entrenadores presentar&aacute;n un n&uacute;mero inspirado en el Folcklore Mexicano, siguiendo el tema de presentaci&oacute;n &quot;Nuestras ra&iacute;ces&quot;.</p>\r\n\r\n<p>Esta vez, estamos muy orgullosos de ser clasificados dentro de la categor&iacute;a de grupo rojo, con los grupos m&aacute;s avanzados. Reconociendo as&iacute;, el valioso esfuerzo de los integrantes del equipo.</p>\r\n\r\n<p>Con este Festival estaremos a punto de concluir los eventos de este a&ntilde;o, siendo el &uacute;ltimo el Festival navide&ntilde;o de cada diciembre.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1575310564_IMG_5763.jpg', '2019-12-02 18:16:04', '2019-12-02 18:16:04'),
(134, 276, 'Inauguración del Festival Nacional de Gimnasia Para Todos', 'El día de ayer, los participantes de cada grupo finalizaron los últimos detalles para celebrar la inauguración del día de hoy.', '2019-12-06', '<p>Con ensayos y c&aacute;tedras realizadas el d&iacute;a de ayer, estaremos presentes en este gran evento, iniciando a las 10:00 am y finalizando a las 8:00 pm del d&iacute;a de hoy. Y ma&ntilde;ana 7 de Diciembre, se realizar&aacute; la Gala Gimn&aacute;stica de 7 a 9 de la noche para cerrar con broche de oro. Wolosky participar&aacute; con el n&uacute;mero &quot;Nuestras ra&iacute;ces&quot;, inspirado en el folcklore mexicano.</p>\r\n\r\n<p>Direcci&oacute;n: Ciudad Deportiva &quot;Lic. Juan Fern&aacute;ndez Albarran&quot;. Calle Deportiva no. 100, col. Irma Patricia Galindo de Reza, Zinacantepec, Estado de M&eacute;xico.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1575646231_WhatsApp Image 2019-12-05 at 23.19.10.jpeg', '2019-12-06 15:30:31', '2019-12-06 15:48:05'),
(135, 276, 'Presentación de Wolosky en el Festival Nacional de Gimnasia\"', 'Presentación del número \"Nuestras Raíces\" y Gala del Festival de Gimnasia Para Todos.', '2019-12-07', '<p>Celebramos el esfuerzo de todo el equipo, que el d&iacute;a de ayer dio un incre&iacute;ble espect&aacute;culo dentro del &quot;Festival Nacional de Gimnasia Para Todos 2019&quot;, con un performance lleno de energ&iacute;a. Hab&iacute;an estado ensayando arduamente estas semanas previas al festival para entregar una presentaci&oacute;n de gran calidad.</p>\r\n\r\n<p>El d&iacute;a de hoy dimos por finalizada nuestra participaci&oacute;n dentro de este gran evento con la entrega de reconocimientos a los directores de&nbsp;las distintas escuelas participantes en la Gala de Gimnasia.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1576779133_20191206_184650_IMG_0701.jpg', '2019-12-19 18:12:13', '2019-12-19 18:12:13');
INSERT INTO `noticias` (`id`, `user_id`, `titulo`, `resumen`, `fecha`, `texto`, `youtube`, `imagen`, `created_at`, `updated_at`) VALUES
(136, 276, 'Festival Navideño 2019', 'Cerramos el año con un evento muy especial donde participaron los alumnos de todos los grupos.', '2019-12-19', '<p>Excelente cierre de a&ntilde;o con el Festival Navide&ntilde;o 2019, donde pudieron apreciar lo que los alumnos de diferentes grupos estuvieron preparando para todos ustedes con mucho cari&ntilde;o. Nos sentimos muy agradecidos por el apoyo incondicional de los familiares y amigos que estuvieron presentes no s&oacute;lo en este evento sino a lo largo todo el a&ntilde;o; sin ustedes nada de esto ser&iacute;a posible, por lo que siempre los tenemos en mente en cada competencia y evento al que asistimos.</p>\r\n\r\n<p>Esperamos que este Festival fuera de su agrado, y aprovechamos la ocasi&oacute;n para recordarles que el S&aacute;bado 21 de Diciembre iniciamos el periodo vacacional y estaremos de vuelta este 6 de Enero con un nuevo ciclo escolar.</p>\r\n\r\n<p>&iexcl;Felices fiestas y pr&oacute;spero A&ntilde;o Nuevo!</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1576779223_20191218_195333_IMG_0517.jpg', '2019-12-19 18:13:43', '2019-12-19 18:13:43'),
(137, 276, 'Clínica de Gimnasia en Yajalón', 'Club Wolosky busca expandir la práctica gimnástica fuera de Tuxtla Gutiérrez.', '2020-02-27', '<p>En Wolosky, nos encontramos trabajando muy activamente en la difusi&oacute;n de la gimnasia en otros municipios. Es por eso que este 27 de Febrero se impartieron cursos en el Mpio. de Yajal&oacute;n, contando con la presencia de&nbsp;la directora Rebeca Wolosky y entrenadores de la academia de Tuxtla Guti&eacute;rrez.&nbsp;</p>\r\n\r\n<p>Adem&aacute;s de los cursos, que se dan con regularidad, se busca que el club de Gimnasia Wolosky Yajal&oacute;n sea reconocido por la Asociaci&oacute;n Chiapaneca de Gimnasia, adem&aacute;s de mejorar la calidad de las instalaciones y equipo necesario para que las ni&ntilde;as practiquen.&nbsp;</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1582998968_WhatsApp Image 2020-02-29 at 01.14.01.jpeg', '2020-02-29 17:56:08', '2020-02-29 17:56:08'),
(138, 276, 'Clínica de Gimnasia en Villaflores', 'Continuando con la promoción del deporte en el estado de Chiapas, esta vez tocó el turno a Villaflores', '2020-03-05', '<p>A tan s&oacute;lo unos d&iacute;as despu&eacute;s&nbsp;de las cl&iacute;nicas en Yajal&oacute;n, la profesora Rebeca Wolosky junto con un grupo de entrenadores imparti&oacute; una cl&iacute;nica de gimnasia&nbsp;en el club Val-Key, de Villaflores.</p>\r\n\r\n<p>Bajo la direcci&oacute;n&nbsp;del profesor&nbsp;Grajales Moreno y el profesor David Mac&iacute;as, el Club Val-key y Wolosky mantienen una estrecha relaci&oacute;n que busca mejorar la calidad t&eacute;cnica de los gimnastas, para que en un futuro puedan competir a nivel regional y nacional.</p>\r\n\r\n<p>Cabe destacar que estas cl&iacute;nicas estuvieron supervisadas por la propia profesora Rebeca Wolosky, contando con el apoyo de la profesora Berenice Flores Arrazola, y los profesores, Edgar Esteban Alegr&iacute;a Toledo y Aziel Guti&eacute;rrez.</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1583731700_28ahortocutnavilla.jpg', '2020-03-09 05:28:20', '2020-03-09 05:28:20'),
(139, 276, 'Clínica de Gimnasia con Club Viga', 'Gimnastas de Tapachula acudieron a Club Wolosky para capacitarse este fin de semana.', '2020-03-07', '<p>Este fin de semana se llev&oacute; a cabo la Cl&iacute;nica de Gimnasia impartido por el Club de Gimnasia Art&iacute;stica Viga, a cargo de la maestra Vanessa Garc&iacute;a, en conjunto con la profesora Rebeca Wolosky, dentro de las instalaciones del club en Tuxtla Guti&eacute;rrez.</p>\r\n\r\n<p>Un total de 25 gimnastas de Club Viga &nbsp;viajaron desde Tapachula para prepararse para los campeonatos que est&aacute;n por venir este a&ntilde;o.</p>\r\n\r\n<p>Desde hace tres a&ntilde;os, Wolosky ha realizado visitas y talleres en diferentes escuelas e instituciones, con el fin de promover este deporte en Chiapas.</p>\r\n\r\n<p>Con tres sesiones, de tres horas cada una, se trabajaron los cuatro aparatos de las ramas femenil y varonil, adem&aacute;s de clases de expresi&oacute;n corporal.</p>\r\n\r\n<p>Para practicar la gimnasia no hay l&iacute;mite de edad, pueden empezar a partir de los dos a&ntilde;os y medio, incluso se recomienda su pr&aacute;ctica en adultos mayores, puesto que la Federaci&oacute;n Internacional de Gimnasia promueve la modalidad de Gimnasia Para Todos, un acercamiento m&aacute;s inclusivo para quienes quieran practicar este deporte.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1583732987_20200301_132528_IMG_0570.jpg', '2020-03-09 05:49:47', '2020-03-09 05:49:47'),
(140, 276, 'Gimnasia para Niños con Discapacidad.', 'En entrevista para El Diario de Chiapas, platicamos un poco del programa de integración gimnástica para niños con discapacidad mental y/o motriz.', '2020-03-26', '<p>Aprovechando estos d&iacute;as de cuarentena, queremos recapitular algunas actividades realizadas a lo largo de este mes. Empezando con la entrevista en el&nbsp;<a href=\"https://www.facebook.com/DiarioDeChiapas/?__tn__=K-R&amp;eid=ARBhF-z4OYGzO0fjiWpRmIrlO4BlY2fB8W4AyXQGdB1ufAI_EyPZs6chZYY4utTfYrd1Eo8v1Ed6Dcld&amp;fref=mentions&amp;__xts__%5B0%5D=68.ARBZUK9mvwdt2EyBB00AsL1oPmZlh6zgRTZ5DouwHPyxDCsM4CK8ElFhgibWyz04E3CvNY2Tq4Wd0DIpdHwbC4Y2FFmrvy-_huYg3aZ6P3UBQvwjyr0DYl9Q-kklNGwWWl1qoVMCxRSP7lpZ5AIa3KIUYKK1MI2Q19tSJMZM8Vm2qmvgmPxDAAhMq_md3LmMaNO_VVSkrCFP-GTrTQvdULsMshUaj3ZPDxioMIbdqQH3zr7PyruI_aO6lxld2P8sQ2hJIIoMAtSrcVTunDe7CMxfwBOhZoYcgQQNAvgiNER7vLbGOHUl4Esdv4m7Fe6pJubgJMlIpQYbW4V-kxWkWfcbZuwpgb5kfUO2h308MD43T8ZzxoDf7cesuNAx4YCD6ZDDf42lC72duWXCtWDAZGZnLEg-41vVdYnqm8hL947pzA8\">Diario de Chiapas</a>&nbsp;dentro de la secci&oacute;n &quot;De charla con Vero Rodr&iacute;guez&quot;, donde tuvimos la oportunidad de asistir y platicar un poco de la labor que realizamos en favor de los ni&ntilde;os con discapacidad mental y motriz (Trisom&iacute;a, TDA, Asperger, etc).</p>\r\n\r\n<p>Dentro de este programa, que tiene ya algunos a&ntilde;os dentro de la academia, buscamos contribuir a la sociedad al lograr integrar a ni&ntilde;os con necesidades especiales dentro de las actividades cotidianas y que puedan desempe&ntilde;arse como cualquier otra persona.</p>\r\n\r\n<p>Esto se logra a trav&eacute;s del desarrollo de la coordinaci&oacute;n a trav&eacute;s de la acrobacia, comenzando por el gateo, con lo que estimulamos el desarrollo de sus conexiones neuronales para poder ir avanzando y que los padres tambi&eacute;n vean un crecimiento en la formaci&oacute;n del car&aacute;cter de los ni&ntilde;os, logrando vencer retos en preparaci&oacute;n de lo que enfrentar&aacute;n en su vida adulta a nivel personal y profesional.</p>\r\n\r\n<p>El costo del programa para ni&ntilde;os con discapacidad es de:<br />\r\n$400 mensuales que incluyen dos clases por semana con entrenadores capacitados para atender sus necesidades.</p>\r\n\r\n<p>Para mayor informaci&oacute;n pueden contactarnos a nuestro n&uacute;mero telef&oacute;nico: (961) 593 6833.</p>\r\n\r\n<p>&nbsp;</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1585266626_1524670778_14woloskycnclassoblemntespcials[1].jpg', '2020-03-26 23:50:27', '2020-03-26 23:50:27'),
(141, 276, 'Parkour en Wolosky', 'El Parkour una Nueva Modalidad Gimnástica en Gimnasio Wolosky', '2020-03-26', '<p>Tambi&eacute;n tuvimos la oportunidad de entrenar con el grupo Chiapaskour Fw Parkour, quienes vinieron a capacitarse a las instalaciones del gimnasio el d&iacute;a 8 de marzo.</p>\r\n\r\n<p>Creemos que esta colaboraci&oacute;n es importante para impulsar la t&eacute;cnica gimn&aacute;stica como una base que puede ser utilizada para mejorar el desempe&ntilde;o de los j&oacute;venes en otras disciplinas.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1585267700_89692509_200566544511456_5118191593249046528_o.jpg', '2020-03-27 00:08:20', '2020-03-27 00:08:20'),
(142, 276, 'Clases de gimnasia GRATIS por Facebook', 'Como una forma de mantenernos activos durante esta cuarentena, los invitamos a que nos acompañen a las transmisiones de Facebook en vivo', '2020-04-21', '<p>Quedan atentamente invitados a las transmisiones en vivo en punto de las 6:00 p.m. todos los d&iacute;as de Lunes a Viernes. Gimnasia para toda la familia con ejercicios que podemos realizar desde casa, &iexcl;No hay excusa para no mantenernos activos!</p>\r\n\r\n<p>Para las personas interesadas, tambi&eacute;n tenemos clases personalizadas v&iacute;a ZOOM, con mayor seguimiento. Estas clases tienen un costo semanal para apoyar a los entrenadores.</p>\r\n\r\n<p>Para mayor informaci&oacute;n respecto a las clases de ZOOM:<br />\r\nWhatsapp: (961) 593 6833</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1587501902_ClasesEnCasa.jpg', '2020-04-21 20:45:02', '2020-04-21 20:45:02'),
(143, 276, 'Wolosky adaptándose al cambio', 'Comenzamos a implementar clases en línea, a través de plataformas públicas y privadas de internet.', '2020-04-29', '<p>Adapt&aacute;ndose a la actual contingencia por el brote de covid 19, fomentando a la vez la necesidad de quedarse en casa pero sin perder contacto con alumnos y apoyando econ&oacute;micamente a sus instructores, la Academia de Gimnasia Wolosky comenz&oacute; a implementar clases en l&iacute;nea, a trav&eacute;s de plataformas p&uacute;blicas y privadas de internet.</p>\r\n\r\n<p>&ldquo;Debido a la contingencia que estamos viviendo, la academia cerr&oacute; sus puertas ya desde hace m&aacute;s de un mes, el d&iacute;a 20 de marzo, sin embargo, esto no ha sido freno para detener las actividades de la instituci&oacute;n&rdquo;, detall&oacute; la profesora Rebeca Wolosky, directora de la prestigiada instituci&oacute;n.</p>\r\n\r\n<p>En este sentido, detall&oacute; que se buscaron alternativas para mantenerse en actividad, &ldquo;adapt&aacute;ndonos al cambio para seguir dando el servicio y aportar a la comunidad gimn&aacute;stica deportiva, amigos, compa&ntilde;eros, colegas y al p&uacute;blico en general de cualquier lugar desde donde se encuentren, no solo a nuestra entidad&rdquo;.</p>\r\n\r\n<p>De tal forma que la academia opt&oacute; por laborar bajo dos esquemas; el primero, realizando trabajo en l&iacute;nea con la aplicaci&oacute;n Zoom, tanto para el equipo de competencia como para ni&ntilde;os de iniciaci&oacute;n de clases regulares. Dichas sesiones se est&aacute;n llevando a cabo de lunes a viernes, de 5:00 a 6:00 de la tarde, apoy&aacute;ndose en un programa establecido y de desarrollo, de ni&ntilde;os, j&oacute;venes, adultos y adultos mayores.</p>\r\n\r\n<p>&ldquo;Esto nos est&aacute; permitiendo generar un poco de recurso para ir solventando gastos principalmente de la n&oacute;mina de nuestros entrenadores, y para nosotros es de vital importancia seguir adelante en este tiempo y no dejar desamparados a nuestra gente&rdquo;, comparti&oacute; la entrenadora.</p>\r\n\r\n<p>Clases p&uacute;blicas</p>\r\n\r\n<p>Por la otra parte, desde hace tres semanas la academia inici&oacute; con transmisiones en vivo a trav&eacute;s de sus p&aacute;ginas oficiales de Facebook (Gimnasia Art&iacute;stica Wolosky y Rebeca Wolosky), con clases de lunes a viernes a las 6:00 de la tarde.</p>\r\n\r\n<p>Estas clases, explic&oacute;, van dirigidas a toda la familia, sin importar qu&eacute; actividad deportiva realicen o si nunca antes en su vida han practicado la Gimnasia. &ldquo;Recordemos que la base de cualquier deporte es la Gimnasia y nuestra intenci&oacute;n es proveer un rato de desestr&eacute;s y sacar todas esas emociones negativas que se van acumulando en esta &eacute;poca de cuarentena&rdquo;, a&ntilde;adi&oacute;.</p>\r\n\r\n<p><em><strong>Fuente: Cuarto Poder MX</strong></em></p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/RkfIOagXQLo\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1588180133_20200301_123501_IMG_0230.jpg', '2020-04-29 17:08:53', '2020-04-29 17:09:44'),
(144, 276, 'FELIZ DÍA DEL NIÑO', 'Les deseamos un feliz día del niño', '2020-04-30', '<p>El Club de Gimnasia Art&iacute;stica Wolosky,</p>\r\n\r\n<p>Les desea un Feliz D&iacute;a del Ni&ntilde;o y tambi&eacute;n a todos y cada uno de nuestros compa&ntilde;eros, colegas, amigos y familiares que llevan su ni&ntilde;o dentro del coraz&oacute;n&nbsp;</p>\r\n\r\n<p>&iexcl;&iexcl;FELICIDADES!!</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/za62mkZz8Zg\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1588273719_IMG_0044.jpg', '2020-04-30 19:08:39', '2020-04-30 19:08:39'),
(145, 276, 'Feliz Aniversario Wolosky 2020', '¡Felicidades a Toda la Comunidad!', '2020-05-01', '<p>A pesar de la contingencia &iexcl;seguimos en pie!, desde aqu&iacute; queremos agradecerles por la confianza que han tenido en nosotros durante todos estos a&ntilde;os. &iexcl;Feliz Aniversario Club Wolosky!</p>\r\n\r\n<p>La CONSTANCIA y la PERSEVERANCIA son la CLAVE del &Eacute;XITO</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/l7insmuCObI\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1588636277_fest ps+ lr-9.jpg', '2020-05-04 18:50:21', '2020-05-04 23:51:20'),
(146, 276, 'Retos Wolosky #1   Parar la Botella', 'El primer reto consiste en acomodar la botella mientras están parados de manos! #QuédateEnCasa', '2020-05-06', '<p>Este es el primer reto que traemos con los alumnos del gimnasio, para mantenernos activos y divirti&eacute;ndonos desde casa.</p>\r\n\r\n<p>Tratando de lograr dejar la botella parada mientras estamos parados de manos.</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/GPsjecNu9w0\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1588813934_WhatsApp Image 2020-04-30 at 02.33.40 (1).jpeg', '2020-05-07 01:12:14', '2020-06-26 05:54:49'),
(147, 276, 'Retos Wolosky #2  Mayor Toque de Hombros', 'Este reto trata de lograr el mayor toque de hombros mientras se está parado de manos!', '2020-05-07', '<p>En el segundo video de retos, incrementamos la dificultad. Esta vez los alumnos subieron sus mejores clips intentando lograr el mayor n&uacute;mero de toques de hombros!</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/T7TZwU4QqAc\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1588897530_WhatsApp Image 2020-04-30 at 02.33.36.jpeg', '2020-05-08 00:25:30', '2020-06-26 05:57:11'),
(148, 276, 'FELÍZ DÍA DE LAS MADRES 2020', 'Felíz día para todas las mamás les desea Club Wolosky', '2020-05-10', '<p>Gracias por todo su apoyo, esto es para ustedes:</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/d9ljcntmBsI\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1589132650_INICIO.jpg', '2020-05-10 17:44:10', '2020-06-26 05:58:07'),
(149, 276, 'Retos Wolosky #3 Elevacion de piernas a la vertical.', 'Reto de elevación de pienas a la vertical pasando por orcajada.', '2020-05-12', '<p>Alumnos de las clases Virtuales de Wolosky, trabajando en casa y el reto esta vez de elevar&nbsp;las piernas a la vertical pasando por orcajada.<br />\r\nFelicidades!!!! un excelente trabajo Chicos</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/iPGHTWU_16E\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1589314227_WhatsApp Image 2020-04-30 at 02.29.48 (1).jpeg', '2020-05-12 20:09:52', '2020-06-26 06:02:47'),
(150, 276, 'FELIZ DÍA del MAESTRO', 'Queremos felicitar a todos nuestros maestros y entrenadores por su gran labor.', '2020-05-15', '<p>Un buen maestro nunca se olvida Y su ense&ntilde;anza perdura por toda la vida</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/V4GpMb8QoTw\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1589572981_iniciofinalwolosky.png', '2020-05-15 20:03:01', '2020-05-15 20:03:01'),
(151, 276, 'Reto # 4   Tik Tok Challenge!', 'Tic Toc Challange increible el logro que tienen nuestros gimnastas.', '2020-05-19', '<p>Un&nbsp;esfuerzo extraordinario chicas, sigamos adelante!</p>\r\n\r\n<p>#Wolosky #Qu&eacute;dateEnCasa</p>', '<iframe width=\"453\" height=\"255\" src=\"https://www.youtube.com/embed/Pz3s9SeSFk4\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', '1589919447_WhatsApp Image 2020-04-30 at 02.33.40 (3).jpeg', '2020-05-19 20:17:27', '2020-06-26 06:05:41'),
(152, 276, 'Retos Wolosky #5   A Quitarse la Playera', 'Esta vez los alumnos intentan quitarse la playera mientras están parados de manos!', '2020-05-22', '<p>Padrisimos todos sus clips, este reto es bastante exigente pero lo lograron!</p>\r\n\r\n<p>FELICIDADES!!!</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/vs37k_qh82Y\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>', 'principal.jpeg', '2020-05-23 00:04:52', '2020-06-26 06:07:55'),
(153, 313, 'Reto # 6  Trabajo en Familia 2', 'Trabajo en Familia #Wolosky #Quedateencasa', '2020-06-21', '<p>Gran trabajo que se ha venido desarrollando en <strong>WOLOSKY&nbsp; GYMWORK&nbsp; QUEDATE EN CASA</strong>.</p>\r\n\r\n<p><strong>Felicidades a Todos!!!!</strong></p>', 'https://www.youtube.com/watch?v=5kPn1O-OAdg', 'principal.jpeg', '2020-06-26 06:17:39', '2020-06-26 06:17:39'),
(154, 313, 'FELIZ DIA DEL PADRE', 'Felicitaciones a Todos nuestros queridos papas, son el Ejemplo de nuestros pequeños!!!!', '2020-06-21', '<p>Con <strong>Todo nuestro cari&ntilde;o</strong> y de sus peques un peque&ntilde;o regalo para todos ustedes en su Dia.</p>\r\n\r\n<p><strong>FELIZ DIA PAPA!!!</strong></p>', 'https://www.youtube.com/watch?v=hhOSpGrgPYA&t=3s', 'principal.jpeg', '2020-06-26 06:21:48', '2020-06-26 06:21:48'),
(155, 313, 'RETO GIMNASIA MX  Nacional RETO #1  BINGO GIMNASTICO', 'RETO GIMNASIA MX  Nacional RETO #1  BINGO GIMNASTICO', '2020-06-20', '<p>RETO GIMNASIA MX&nbsp; Evento Nacional que se conforma de 4 RETOS</p>\r\n\r\n<p>Reto #1 &nbsp;BINGO GIMNASTICO</p>\r\n\r\n<p>Desarrollo de figuras Gimnasticas Formando un&nbsp; BINGO</p>', 'https://www.youtube.com/watch?v=6bTfGiFrspk&t=3s', 'principal.jpeg', '2020-06-26 07:19:27', '2020-06-26 07:19:27'),
(156, 313, 'Entrenamientos Internacionales Virtuales', 'Wolosky participa en los Entrenamientos Internacionales Virtuales que se llevaron a cabo del 15 al 20junio 2020.', '2020-06-20', '<p>Gimnasia Artistica Wolosky participa en los Entrenamientos Internacionales Virtuales que se llevaron a cabo del 15 al 20junio 2020.<br />\r\nFue una extraordinaria experiencia para Todos a cargo de entrenadores de Talla Mundial.</p>', 'https://www.youtube.com/watch?v=BhNbwZgOnuQ&t=5s', 'principal.jpeg', '2020-06-29 06:55:42', '2020-06-29 06:55:42'),
(157, 313, 'WOLOSKY en el Desafío Nacional Deportivo del 2020', 'WOLOSKY en el Desafío Nacional Deportivo del 2020', '2020-05-28', '<p>Participaci&oacute;n de WOLOSKY en el Desaf&iacute;o Nacional Deportivo del 2020</p>', 'https://www.youtube.com/watch?v=dddGFO0N__s', 'principal.jpeg', '2020-06-29 08:16:34', '2020-06-29 08:16:34');
